one'),(2845,'','default','Feeds contain published content, and may be grouped in categories, generally by topic. Users view feed content in the <a href=\"@aggregator\">main aggregator display</a>, or by <a href=\"@aggregator-sources\">their source</a> (usually via an RSS feed reader). The most recent content in a feed or category can be displayed as a block through the <a href=\"@admin-block\">Blocks administration page</a>.','','none'),(2846,'','default','Adding, editing, and deleting feeds','','none'),(2847,'','default','Administrators can add, edit, and delete feeds, and choose how often to check each feed for newly updated items on the <a href=\"@feededit\">Feed aggregator administration page</a>.','','none'),(2848,'','default','OPML integration','','none'),(2849,'','default','A <a href=\"@aggregator-opml\">machine-readable OPML file</a> of all feeds is available. OPML is an XML-based file format used to share outline-structured information such as a list of RSS feeds. Feeds can also be <a href=\"@import-opml\">imported via an OPML file</a>.','','none'),(2850,'','default','Configuring cron','','none'),(2851,'','default','A correctly configured <a href=\"@cron\">cron maintenance task</a> is required to update feeds automatically.','','none'),(2852,'','default','<acronym title=\"Outline Processor Markup Language\">OPML</acronym> is an XML format used to exchange multiple feeds between aggregators. A single OPML document may contain a collection of many feeds. Drupal can parse such a file and import all feeds at once, saving you the effort of adding them manually. You may either upload a local file from your computer or enter a URL where Drupal can download it.','','none'),(2853,'','default','Administer news feeds','','none'),(2854,'','default','View news feeds','','none'),(2855,'','default','Configure the behavior of the feed aggregator, including when to discard feed items and how to present feed items and categories.','','none'),(2856,'','default','Override the default title for the block. Use <em>!placeholder</em> to display no title, or leave blank to use the default block title.','','none'),(2857,'','default','Specify in which themes and regions this block is displayed.','','none'),(2858,'','default','All pages except those listed','','none'),(2859,'','default','Only the listed pages','','none'),(2860,'','default','Specify pages by using their paths. Enter one path per line. The \'*\' character is a wildcard. Example paths are %blog for the blog page and %blog-wildcard for every personal blog. %front is the front page.','','none'),(2861,'','default','Pages on which this PHP code returns <code>TRUE</code> (experts only)','','none'),(2862,'','default','Pages or PHP code','','none'),(2863,'','default','If the PHP option is chosen, enter PHP code between %php. Note that executing incorrect PHP code can break your Drupal site.','','none'),(2864,'','default','Customizable per user','','none'),(2865,'','default','Customizable, visible by default','','none'),(2866,'','default','Customizable, hidden by default','','none'),(2867,'','default','Ensure that each block description is unique.','','none'),(2868,'','default','The Block module allows you to create boxes of content, which are rendered into an area, or region, of one or more pages of a website. The core Seven administration theme, for example, implements the regions \"Content\", \"Help\", \"Dashboard main\", and \"Dashboard sidebar\", and a block may appear in any one of these regions. The <a href=\"@blocks\">Blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.','','none'),(2869,'','default','Positioning content','','none'),(2870,'','default','When working with blocks, remember that all themes do <em>not</em> implement the same regions, or display regions in the same way. Blocks are positioned on a per-theme basis. Users with the <em>Administer blocks</em> permission can disable blocks. Disabled blocks are listed on the <a href=\"@blocks\">Blocks administration page</a>, but are not displayed in any region.','','none'),(2871,'','default','Controlling visibility','','none'),(2872,'','default','Blocks can be configured to be visible only on certain pages, only to users of certain roles, or only on pages displaying certain <a href=\"@content-type\">content types</a>. Administrators can also allow specific blocks to be enabled or disabled by users when they edit their <a href=\"@user\">My account</a> page. Some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.','','none'),(2873,'','default','Creating custom blocks','','none'),(2874,'','default','Users with the <em>Administer blocks</em> permission can <a href=\"@block-add\">add custom blocks</a>, which are then listed on the <a href=\"@blocks\">Blocks administration page</a>. Once created, custom blocks behave just like default and module-generated blocks.','','none'),(2875,'','default','This page provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. Since not all themes implement the same regions, or display regions in the same way, blocks are positioned on a per-theme basis. Remember that your changes will not be saved until you click the <em>Save blocks</em> button at the bottom of the page. Click the <em>configure</em> link next to each block to configure its specific title and visibility settings.','','none'),(2876,'','default','Demonstrate block regions (@theme)','','none'),(2877,'','default','Administer blocks','','none'),(2878,'','default','A brief description of your block. Used on the <a href=\"@overview\">Blocks administration page</a>.','','none'),(2879,'','default','Personalize blocks','','none'),(2880,'','default','Blocks consist of content or information that complements the main content of the page. Enable or disable optional blocks using the checkboxes below.','','none'),(2881,'','default','Cache blocks','','7.31'),(2882,'','default','Block caching is inactive because you have enabled modules defining content access restrictions.','','none'),(2883,'','default','Controls the visual building blocks a page is constructed with. Blocks are boxes of content rendered into an area, or region, of a web page.','','none'),(2884,'','default','Use for multi-user blogs. Every user gets a personal blog.','','none'),(2885,'','default','Single-user blogs','','none'),(2886,'','default','Each user\'s blog entries are automatically displayed with a link to the user\'s main blog page. You can create as many single-user blogs as you have site users with permission to create blog content.','','none'),(2887,'','default','Multi-user blogs','','none'),(2888,'','default','Blog entries from each single-user blog are also aggregated into one central multi-user blog, which displays the blog content of all users in a single listing.','','none'),(2889,'','default','There is an optional <em>Blogs</em> menu item added to the Navigation menu, which displays all blogs available on your site, and a <em>My blog</em> item displaying the current user\'s blog entries.','','none'),(2890,'','default','The Blog module also creates a default <em>Recent blog posts</em> block that may be enabled at the <a href=\"@blocks\">blocks administration page</a>.','','none'),(2891,'','default','Create new blog entry','','none'),(2892,'','default','Enables multi-user blogs.','','none'),(2893,'','default','No books available.','','none'),(2894,'','default','Content types allowed in book outlines','','none'),(2895,'','default','Users with the %outline-perm permission can add all content types.','','none'),(2896,'','default','Administer book outlines','','none'),(2897,'','default','The Book module is used for creating structured, multi-page content, such as site resource guides, manuals, and wikis. It allows you to create content that has chapters, sections, subsections, or any similarly-tiered structure. For more information, see the online handbook entry for <a href=\"@book\">Book module</a>.','','none'),(2898,'','default','Adding and managing book content','','none'),(2899,'','default','You can assign separate permissions for <em>creating</em>, <em>editing</em>, and <em>deleting</em> book content, as well as <em>adding content to books</em>, and <em>creating new books</em>. Users with the <em>Administer book outlines</em> permission can add <em>any</em> type of content to a book by selecting the appropriate book outline while editing the content. They can also view a list of all books, and edit and rearrange section titles on the <a href=\"@admin-book\">Book administration page</a>.','','none'),(2900,'','default','Book pages have a default book-specific navigation block. This navigation block contains links that lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. This block can be enabled on the <a href=\'@admin-block\'>Blocks administration page</a>. For book pages to show up in the book navigation, they must be added to a book outline.','','none'),(2901,'','default','Books can be created collaboratively, as they allow users with appropriate permissions to add pages into existing books, and add those pages to a custom table of contents menu.','','none'),(2902,'','default','Printing books','','none'),(2903,'','default','Users with the <em>View printer-friendly books</em> permission can select the <em>printer-friendly version</em> link visible at the bottom of a book page\'s content to generate a printer-friendly display of the page and all of its subsections.','','none'),(2904,'','default','The book module offers a means to organize a collection of related content pages, collectively known as a book. When viewed, this content automatically displays links to adjacent book pages, providing a simple navigation system for creating and reviewing structured content.','','none'),(2905,'','default','The outline feature allows you to include pages in the <a href=\"@book\">Book hierarchy</a>, as well as move them within the hierarchy or to <a href=\"@book-admin\">reorder an entire book</a>.','','none'),(2906,'','default','Create new books','','none'),(2907,'','default','Add content and child pages to books','','none'),(2908,'','default','View printer-friendly books','','none'),(2909,'','default','View a book page and all of its sub-pages as a single document for ease of printing. Can be performance heavy.','','none'),(2910,'','default','<em>Books</em> have a built-in hierarchical navigation. Use for handbooks or tutorials.','','none'),(2911,'','default','Allows users to create and organize related content in an outline.','','none'),(2912,'','default','The Color module allows users with the <em>Administer site configuration</em> permission to quickly and easily change the color scheme of themes that have been built to be compatible with it. For more information, see the online handbook entry for <a href=\"@color\">Color module</a>.','','none'),(2913,'','default','Changing colors','','none'),(2914,'','default','Using the Color module allows you to easily change the color of links, backgrounds, text, and other theme elements. To change the color settings for a compatible theme, select the <em>Settings</em> link for your theme on the <a href=\'@configure\'>Themes administration page</a>. If you don\'t see a color picker on that page, then your theme is not compatible with the color module. If you are sure that the theme does indeed support the color module, but the color picker does not appear, then <a href=\'@troubleshoot\'>follow these troubleshooting procedures</a>.','','none'),(2915,'','default','The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. This means that if you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if they haven\'t changed</em>. This step is required because the module stylesheets (in the files directory) need to be recreated to include your changes.','','none'),(2916,'','default','The GD library for PHP is enabled, but was compiled without PNG support. Check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','','none'),(2917,'','default','The GD library for PHP is missing or outdated. Check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','','none'),(2918,'','default','Allows administrators to change the color scheme of compatible themes.','','none'),(2919,'','default','Select one or more comments to perform the update on.','','none'),(2920,'','default','There do not appear to be any comments to delete, or your selected comment was deleted by another administrator.','','none'),(2921,'','default','Deleted @count comments.','','none'),(2922,'','default','Deleted comment @cid and its replies.','','none'),(2923,'','default','Comment approved.','','none'),(2924,'','default','Tokens for comments posted on the site.','','none'),(2925,'','default','The Comment module allows users to comment on site content, set commenting defaults and permissions, and moderate comments. For more information, see the online handbook entry for <a href=\"@comment\">Comment module</a>.','','none'),(2926,'','default','Default and custom settings','','none'),(2927,'','default','Each <a href=\'@content-type\'>content type</a> can have its own default comment settings configured as: <em>Open</em> to allow new comments, <em>Hidden</em> to hide existing comments and prevent new comments, or <em>Closed</em> to view existing comments, but prevent new comments. These defaults will apply to all new content created (changes to the settings on existing content must be done manually). Other comment settings can also be customized per content type, and can be overridden for any given item of content. When a comment has no replies, it remains editable by its author, as long as the author has a user account and is logged in.','','none'),(2928,'','default','Full comment','','none'),(2929,'','default','Unapproved comments (@count)','','none'),(2930,'','default','Administer comments and comment settings','','none'),(2931,'','default','Edit own comments','','none'),(2932,'','default','Number of recent comments','','none'),(2933,'','default','Threading','','none'),(2934,'','default','Show comment replies in a threaded list.','','none'),(2935,'','default','Default comment setting for new content','','none'),(2936,'','default','Allow comment title','','none'),(2937,'','default','Show reply form on the same page as comments','','none'),(2938,'','default','Users with the \"Post comments\" permission can post comments.','','none'),(2939,'','default','Users cannot post comments, but existing comments will be displayed.','','none'),(2940,'','default','Comments are hidden from view.','','none'),(2941,'','default','Users cannot post comments.','','none'),(2942,'','default','Your comment has been queued for review by site administrators and will be published after approval.','','none'),(2943,'','default','Your comment has been posted.','','none'),(2944,'','default','<a href=\"@login\">Log in</a> or <a href=\"@register\">register</a> to post comments','','none'),(2945,'','default','<a href=\"@login\">Log in</a> to post comments','','none'),(2946,'','default','Flat list','','none'),(2947,'','default','Threaded list','','none'),(2948,'','default','Save comment','','none'),(2949,'','default','The comment will be unpublished if it contains any of the phrases above. Use a case-sensitive, comma-separated list of phrases. Example: funny, bungee jumping, \"Company, Inc.\"','','none'),(2950,'','default','Published comment %subject.','','none'),(2951,'','default','Saved comment %title','','none'),(2952,'','default','List and edit site comments and the comment approval queue.','','none'),(2953,'','default','Unapproved comments','','none'),(2954,'','default','Example: \'webmaster@example.com\' or \'sales@example.com,support@example.com\' . To specify multiple recipients, separate each e-mail address with a comma.','','none'),(2955,'','default','Category %category has been saved.','','none'),(2956,'','default','You cannot send more than %limit messages in @interval. Try again later.','','none'),(2957,'','default','Contact @username','','none'),(2958,'','default','%sender-name (@sender-from) sent an e-mail regarding %category.','','none'),(2959,'','default','%sender-name (@sender-from) sent %recipient-name an e-mail.','','none'),(2960,'','default','The Contact module allows visitors to contact site administrators and other users. Users specify a subject, write their message, and can have a copy of their message sent to their own e-mail address. For more information, see the online handbook entry for <a href=\"@contact\">Contact module</a>.','','none'),(2961,'','default','User contact forms','','none'),(2962,'','default','Site users can be contacted with a user contact form that keeps their e-mail address private. Users may enable or disable their personal contact forms by editing their <em>My account</em> page. If enabled, a <em>Contact</em> tab leads to a personal contact form displayed on their user profile. Site administrators are still able to use the contact form, even if has been disabled. The <em>Contact</em> tab is not shown when you view your own profile.','','none'),(2963,'','default','Site-wide contact forms','','none'),(2964,'','default','The <a href=\"@contact\">Contact page</a> provides a simple form for users with the <em>Use the site-wide contact form</em> permission to send comments, feedback, or other requests. You can create categories for directing the contact form messages to a set of defined recipients. Common categories for a business site, for example, might include \"Website feedback