"@url\">personal contact form</a> which keeps your e-mail address hidden. Note that some privileged users such as site administrators are still able to contact you even if you choose to disable this feature.','','none'),(2979,'','default','Enable the personal contact form by default for new users.','','none'),(2980,'','default','Changing this setting will not affect existing users.','','none'),(2981,'','default','The Contextual links module displays links related to regions of pages on your site to users with <em>access contextual links</em> permission. For more information, see the online handbook entry for <a href=\"@contextual\">Contextual links module</a>.','','none'),(2982,'','default','Displaying contextual links','','none'),(2983,'','default','Contextual links are supplied by modules, to give you quick access to tasks associated with regions of pages on your site. For instance, if you have a custom menu block displayed in a sidebar of your site, the Blocks and Menus modules will supply links to configure the block and edit the menu. The Contextual links module collects these links into a list for display by your theme, and also adds JavaScript code to the page to hide the links initially, and display them when your mouse hovers over the block.','','none'),(2984,'','default','Use contextual links','','none'),(2985,'','default','Use contextual links to perform actions related to elements on a page.','','none'),(2986,'','default','Contextual links','','none'),(2987,'','default','Provides contextual links to perform actions related to elements on a page.','','none'),(2988,'','default','Tracking user activity','','none'),(2989,'','default','By enabling blocks such as <em>Who\'s online</em> and <em>Who\'s new</em>, site users can track who is logged in and new user signups at a centralized location.','','none'),(2990,'','default','Tracking content activity','','none'),(2991,'','default','By enabling blocks such as <em>Recent blog posts</em>, <em>New forum topics</e