 it is <em>listed</em> or not. Listed files are displayed automatically in a section at the bottom of your content; non-listed files are available for embedding in your content, but are not included in the list at the bottom.','','none'),(3114,'','default','Managing file locations','','none'),(3115,'','default','When you create a File field, you can specify a directory where the files will be stored, which can be within either the <em>public</em> or <em>private</em> files directory. Files in the public directory can be accessed directly through the web server; when public files are listed, direct links to the files are used, and anyone who knows a file\'s URL can download the file. Files in the private directory are not accessible directly through the web server; when private files are listed, the links are Drupal path requests. This adds to server load and download time, since Drupal must start up and resolve the path for each file download request, but allows for access restrictions.','','none'),(3116,'','default','An unrecoverable error occurred. Use of this form has expired. Try reloading the page and submitting again.','','none'),(3117,'','default','The file referenced by the !name field does not exist.','','none'),(3118,'','default','The file in the !name field was unable to be uploaded.','','none'),(3119,'','default','The upload directory %directory for the file field !name could not be created or is not accessible. A newly uploaded file could not be saved in this directory as a consequence, and the upload was canceled.','','none'),(3120,'','default','Your server is not capable of displaying file upload progress. File upload progress requires an Apache server running PHP with mod_php.','','none'),(3121,'','default','All roles may use this format','','none'),(3122,'','default','The text format ordering has been saved.','','none'),(3123,'','default','Add text format','','7.31'),(3124,'','default','All roles for this text format must be enabled and cannot be changed.','','none'),(3125,'','default','Filter processing order','','none'),(3126,'','default','Text format names must be unique. A format named %name already exists.','','none'),(3127,'','default','Added text format %format.','','none'),(3128,'','default','The text format %format has been updated.','','none'),(3129,'','default','Text formats','','7.31'),(3130,'','default','The Filter module allows administrators to configure text formats. A text format defines the HTML tags, codes, and other input allowed in content and comments, and is a key feature in guarding against potentially damaging input from malicious users. For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.','','none'),(3131,'','default','Applying filters to text','','none'),(3132,'','default','Each text format uses filters to manipulate text, and most formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes, or transforms elements within user-entered text before it is displayed. A filter does not change the actual content, but instead, modifies it temporarily before it is displayed. One filter may remove unapproved HTML tags, while another automatically adds HTML to make URLs display as clickable links.','','none'),(3133,'','default','Defining text formats','','none'),(3134,'','default','One format is included by default: <em>Plain text</em> (which removes all HTML tags). Additional formats may be created by your installation profile when you install Drupal, and more can be created by an administrator on the <a href=\"@text-formats\">Text formats page</a>.','','none'),(3135,'','default','Choosing a text format','','none'),(3136,'','default','A text format contains filters that change the user input, for example stripping out malicious HTML or making URLs clickable. Filters are executed from top to bottom and the order is important, since one filter may prevent another 