to German (de). <em>Domain</em>: URLs like http://de.example.com/contact set the language to German. <strong>Warning: Changing this setting may break incoming URLs. Use with caution on a production site.</strong>','','none'),(3296,'','default','Request/session parameter','','none'),(3297,'','default','Name of the request/session parameter used to determine the desired language.','','none'),(3298,'','default','Filter translatable strings','','none'),(3299,'','default','Date type','','none'),(3300,'','default','Are you sure you want to reset the date formats for %language to the global defaults?','','none'),(3301,'','default','Resetting will remove all localized date formats for this language. This action cannot be undone.','','none'),(3302,'','default','The Locale module allows your Drupal site to be presented in languages other than the default English, and to be multilingual. The Locale module works by maintaining a database of translations, and examining text as it is about to be displayed. When a translation of the text is available in the language to be displayed, the translation is displayed rather than the original text. When a translation is unavailable, the original text is displayed, and then stored for review by a translator. For more information, see the online handbook entry for <a href=\"@locale\">Locale module</a>.','','none'),(3303,'','default','Translating interface text','','none'),(3304,'','default','Translations of text in the Drupal interface may be provided by:','','none'),(3305,'','default','Translating within your site, using the Locale module\'s integrated <a href=\'@translate\'>translation interface</a>.','','none'),(3306,'','default','Importing files from a set of existing translations, known as a translation package. A translation package enables the display of a specific version of Drupal in a specific language, and contains files in the Gettext Portable Object (<em>.po</em>) format. Although not all languages are available for every version of Drupal, translation packages for many languages are available for download from the <a href=\"@translations\">Drupal translations page</a>.','','none'),(3307,'','default','If an existing translation package does not meet your needs, the Gettext Portable Object (<em>.po</em>) files within a package may be modified, or new <em>.po</em> files may be created, using a desktop Gettext editor. The Locale module\'s <a href=\'@import\'>import</a> feature allows the translated strings from a new or modified <em>.po</em> file to be added to your site. The Locale module\'s <a href=\'@export\'>export</a> feature generates files from your site\'s translated strings, that can either be shared with others or edited offline by a Gettext translation editor.','','none'),(3308,'','default','Configuring a multilingual site','','none'),(3309,'','default','Language negotiation allows your site to automatically change language based on the domain or path used for each request. Users may (optionally) select their preferred language on their <em>My account</em> page, and your site can be configured to honor a web browser\'s preferred language settings. Site content can be translated using the <a href=\'@content-help\'>Content translation module</a>.','','none'),(3310,'','default','With multiple languages enabled, interface text can be translated, registered users may select their preferred language, and authors can assign a specific language to content. <a href=\"@translations\">Download contributed translations</a> from Drupal.org.','','none'),(3311,'','default','Add a language to be supported by your site. If your desired language is not available in the <em>Language name</em> drop-down, click <em>Custom language</em> and provide a language code and other details manually. When providing a language code manually, be sure to enter a standardized language code, since this code may be used by browsers to determine an appropriate display language.','','none'),(3312,'','default','Determine the language from a request/session parameter. Example: \"http://example.com?language=de\" sets language to German based on the use of \"de\" within the \"language\" parameter.','','none'),(3313,'','default','See the <a href=\"@languages\">Languages page</a> for more information on adding support for additional languages.','','none'),(3314,'','default','This page imports the translated strings contained in an individual Gettext Portable Object (<em>.po</em>) file. Normally distributed as part of a translation package (each translation package may contain several <em>.po</em> files), a <em>.po</em> file may need to be imported after offline editing in a Gettext translation editor. Importing an individual <em>.po</em> file may be a lengthy process.','','none'),(3315,'','default','This page allows a translator to search for specific translated and untranslated strings, and is used when creating or editing translations. (Note: For translation tasks involving many strings, it may be more convenient to <a href=\"@export\">export</a> strings for offline editing in a desktop Gettext translation editor.) Searches may be limited to strings found within a specific text group or in a specific language.','','none'),(3316,'','default','Administer languages','','none'),(3317,'','default','Translate interface texts','','none'),(3318,'','default','Order of language detection methods for content. If a version of content is available in the detected language, it will be displayed.','','none'),(3319,'','default','Order of language detection methods for user interface text. If a translation of user interface text is available in the detected language, it will be displayed.','','none'),(3320,'','default','Determine the language from the URL (Path prefix or domain).','','none'),(3321,'','default','Determine the language from a request/session parameter.','','none'),(3322,'','default','Follow the user\'s language preference.','','none'),(3323,'','default','Determine the language from th