 and menu items</em> permission can add, edit and delete custom menus on the <a href=\"@menu\">Menus administration page</a>. Custom menus can be special site menus, menus of external links, or any combination of internal and external links. You may create an unlimited number of additional menus, each of which will automatically have an associated block. By selecting <em>list links</em>, you can add, edit, or delete links for a given menu. The links listing page provides a drag-and-drop interface for controlling the order of links, and creating a hierarchy within the menu.','','none'),(3371,'','default','Displaying menus','','none'),(3372,'','default','After you have created a menu, you must enable and position the associated block on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(3373,'','default','You can enable the newly-created block for this menu on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(3374,'','default','Each menu has a corresponding block that is managed on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(3375,'','default','Administer menus and menu items','','none'),(3376,'','default','Provide a menu link','','none'),(3377,'','default','Menu links with smaller weights are displayed before links with larger weights.','','none'),(3378,'','default','Available menus','','none'),(3379,'','default','The menus available to place links in for this content type.','','none'),(3380,'','default','Default parent item','','none'),(3381,'','default','Choose the menu item to be the default parent for a new link in the content authoring form.','','none'),(3382,'','default','Add new menus to your site, edit existing menus, and rename and reorganize menu links.','','7.31'),(3383,'','default','Parent menu items','','none'),(3384,'','default','Edit menu link','','none'),(3385,'','default','Reset menu link','','none'),(3386,'','default','Delete menu link','','none'),(3387,'','default','The <em>Navigation</em