','Individual content types can have different fields, behaviors, and permissions assigned to them.','','none'),(3435,'','default','Content items can be displayed using different view modes: Teaser, Full content, Print, RSS, etc. <em>Teaser</em> is a short format that is typically used in lists of multiple content items. <em>Full content</em> is typically used when the content is displayed on its own page.','','none'),(3436,'','default','Here, you can define which fields are shown and hidden when %type content is displayed in each view mode, and define how the fields are displayed in each view mode.','','none'),(3437,'','default','Revisions allow you to track differences between multiple versions of your content, and revert back to older versions.','','none'),(3438,'','default','Full content','','7.31'),(3439,'','default','Search result','','7.31'),(3440,'','default','The content on this page has either been modified by another user, or you have already submitted modifications using this form. As a result, your changes cannot be saved.','','none'),(3441,'','default','Administer content types','','none'),(3442,'','default','Warning: Give to trusted roles only; this permission has security implications.','','none'),(3443,'','default','View published content','','none'),(3444,'','default','Access the content overview page','','none'),(3445,'','default','Bypass content access control','','none'),(3446,'','default','View content revisions','','none'),(3447,'','default','Revert content revisions','','none'),(3448,'','default','Delete content revisions','','none'),(3449,'','default','View own unpublished content','','none'),(3450,'','default','Content is sticky at top of lists','','none'),(3451,'','default','Content is promoted to the front page','','none'),(3452,'','default','Recent content','','none'),(3453,'','default','Number of recent content items to display','','none'),(3454,'','default','Show block for specific content types','','none'),(3455,'','default','Show this block only on pages that display content of the given type(s). If you select no types, there will be no type-specific limitation.','','none'),(3456,'','default','Welcome to @site-name','','none'),(3457,'','default','No front page content has been created yet.','','none'),(3458,'','default','Unpublish content','','none'),(3459,'','default','Make content sticky','','none'),(3460,'','default','Make content unsticky','','none'),(3461,'','default','Promote content to front page','','none'),(3462,'','default','Remove content from front page','','none'),(3463,'','default','Change the author of content','','none'),(3464,'','default','Save content','','none'),(3465,'','default','Unpublish content containing keyword(s)','','none'),(3466,'','default','The content will be unpublished if it contains any of the phrases above. Use a case-sensitive, comma-separated list of phrases. Example: funny, bungee jumping, \"Company, Inc.\"','','none'),(3467,'','default','If the site is experiencing problems with permissions to content, you may have to rebuild the permissions cache. Rebuilding will remove all privileges to content and replace them with permissions based on the current modules and settings. Rebuilding may take some time if there is a lot of content or complex permission settings. After rebuilding has completed, content will automatically use the new permissions.','','none'),(3468,'','default','Node Access Permissions','','none'),(3469,'','default','One permission in use','','none'),(3470,'','default','@count permissions in use','','none'),(3471,'','default','@count[2] permissions in use','','none'),(3472,'','default','Find and manage content.','','7.31'),(3473,'','default','Manage content types, including default status, front page promotion, comment settings, etc.','','7.31'),(3474,'','default','Edit content type','','none'),(3475,'','default','This site supports <a href=\"@openid-net\">OpenID</a>, a secure way to log in to many websites using a single username and password. OpenID can reduce the necessity of managing many usernames and passwords for many websites.','','none'),(3476,'','default','If you already have an OpenID, enter the URL to your OpenID server below (e.g. myusername.openidprovider.com). Next time you log in, you will be able to use this URL instead of a regular username and password. You can have multiple OpenID servers if you like; just keep adding them here.','','none'),(3477,'','default','The OpenID module allows users to log in using the OpenID single sign on service. <a href=\"@openid-net\">OpenID</a> is a secure method for logging into many websites with a single username and password. It does not require special software, and it does not share passwords with any site to which it is associated, including the site being logged into. The main benefit to users is that they can have a single password that they can use on many websites. This means they can easily update their single password from a centralized location, rather than having to change dozens of passwords individually. For more information, see the online handbook entry for <a href=\"@handbook\">OpenID module</a>.','','none'),(3478,'','default','Logging in with OpenID','','none'),(3479,'','default','To log in using OpenID, a user must already have an OpenID account. Users can then create site accounts using their OpenID, assign one or more OpenIDs to an existing account, and log in using an OpenID. This lowers the barrier to registration, which helps increase the user base, and offers convenience and security to the users. Because OpenID cannot guarantee a user is legitimate, email verification is still necessary. When logging in, users are presented with the option of entering their OpenID URL, which will look like <em>myusername.openidprovider.com</em>. The site then communicates with the OpenID server, asking it to verify the identity of the user. If the user is logged into their OpenID server, the server communicates back to your site, verifying the user. If they are not logged in, the OpenID server will ask the user for their password. At no point does the site being logged into record the user\'s OpenID password.','','none'),(3480,'','default','Once you have verified your e-mail address, you may log in via OpenID.','','none'),(3481,'','default','Sorry, that is not a valid OpenID. Ensure you have spelled your ID correctly.','','none'),(3482,'','default','Complete the registration by filling out the form below. If you already have an account, you can <a href=\"@login\">log in</a> now and add your OpenID under \"My account\".','','none'),(3483,'','default','Account registration using the information provided by your OpenID provider failed due to the reasons listed below. Complete the registration by filling out the form below. If you already have an account, you can <a href=\"@login\">log in</a> now and add your OpenID under \"My account\".','','none'),(3484,'','default','The Overlay module makes the administration pages on your site display in a JavaScript overlay of the page you were viewing when you clicked the administrative link, instead of replacing the page in your browser window. Use the close link on the overlay to return to the page you were viewing when you clicked the link. For more information, see the online handbook entry for <a href=\"@overlay\">Overlay module</a>.','','none'),(3485,'','default','Access the administrative overlay','','none'),(3486,'','default','View administrative pages in the overlay.','','none'),(3487,'','default','Displays the Drupal administration interface in an overlay.','','none'),(3488,'','default','@title dialog','','none'),(3489,'','default','Specify the existing path you wish to alias. For example: node/28, forum/1, taxonomy/term/1.','','none'),(3490,'','default','The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\"@pathauto\">Pathauto</a>. For more information, see the online handbook entry for the <a href=\"@path\">Path module</a>.','','none'),(3491,'','default','Creating aliases','','none'),(3492,'','default','Users with sufficient <a href=\"@permissions\">permissions</a> can create aliases under the <em>URL path settings</em> section when they create or edit content. Some examples of aliases are: ','','none'),(3493,'','default','<em>member/jane-smith</em> aliased to internal path <em>user/123</em>','','none'),(3494,'','default','<em>about-us/team</em> aliased to internal path <em>node/456</em>','','none'),(3495,'','default','Managing aliases','','none'),(3496,'','default','The Path module provides a way to search and view a <a href=\"@aliases\">list of all aliases</a> that are in use on your website. Aliases can be added, edited and deleted through this list.','','none'),(3497,'','default','An alias defines a different name for an existing URL path - for example, the alias \'about\' for the URL path \'node/1\'. A URL path can have multiple aliases.','','none'),(3498,'','default','Administer URL aliases','','none'),(3499,'','default','Create and edit URL aliases','','none'),(3500,'','default','The alias is already in use.','','none'),(3501,'','default','Optionally specify an alternative URL by which this term can be accessed. Use a relative path and don\'t add a trailing slash or the URL alias won\'t work.','','none'),(3502,'','default','Enabling execution of PHP in text fields','','none'),(3503,'','default','The PHP filter module allows users with the proper permissions to include custom PHP code that will get executed when pages of your site are processed. While this is a powerful and flexible feature if used by a trusted user with PHP experience, it is a significant and dangerous security risk in the hands of a malicious or inexperienced user. Even a trusted user may accidentally compromise the site by entering malformed or incorrect PHP code. Only the most trusted users should be granted permission to use the PHP filter, and all PHP code added through the PHP filter should be carefully examined before use. <a href=\"@php-snippets\">Example PHP snippets</a> can be found on Drupal.org.','','none'),(3504,'','default','Use PHP for settings','','none'),(3505,'','default','<p>Add a custom block to your site, named \"Welcome\" . With its text format set to \"PHP code\" (or another format supporting PHP input), add the following in the Block body:</p>\n<pre>\nprint t(\'Welcome visitor! Thank you for visiting.\');\n</pre>','','none'),(3506,'','default','<p>To display the name of a registered user, use this instead:</p>\n<pre>\nglobal $user;\nif ($user->uid) {\n  print t(\'Welcome @name! Thank you for visiting.\', array(\'@name\' => format_username($user)));\n}\nelse {\n  print t(\'Welcome visitor! Thank you for visiting.\');\n}\n</pre>','','none'),(3507,'','default','The PHP module has been disabled. Any existing content that was using the PHP filter will now be visible in plain text. This might pose a security risk by exposing sensitive information, if any, used in the PHP code.','','none'),(3508,'','default','The Poll module can be used to create simple surveys or questionnaires that display cumulative results. A poll is a good way to receive feedback from site users and community members. For more information, see the online handbook entry for the <a href=\"@poll\">Poll module</a>.','','none'),(3509,'','default','Creating a poll','','none'),(3510,'','default','Users can create a poll by clicking on Poll on the <a href=\"@add-content\">Add new content</a> page, and entering the question being posed, the answer choices, and beginning vote counts for each choice. The status (closed or active) and duration (length of time the poll remains active for new votes) can also be specified.','','none'),(3511,'','default','Viewing polls','','none'),(3512,'','default','You can visit the <a href=\"@poll\">Polls</a> page to view all current polls, or alternately enable the <em>Most recent poll</em> block on the <a href=\"@blocks\">Blocks administration page</a>. To vote in or view the results of a specific poll, you can click on the poll itself.','','none'),(3513,'','default','Vote on polls','','none'),(3514,'','default','Cancel and change own votes','','none'),(3515,'','default','Your vote was cancelled.','','none'),(3516,'','default','To enable browsing this field by value, enter a title for the resulting page. The word <code>%value</code> will be substituted with the corresponding value. An example page title is \"People whose favorite color is %value\" . This is only applicable for a public field.','','none'),(3517,'','default','To enable browsing this field by value, enter a title for the resulting page. An example page title is \"People who are employed\" . This is only applicable for a public field.','','none'),(3518,'','default','The Profile module allows site administrators to define custom fields (such as country, full name, or age) for user profiles, which are then displayed in the <a href=\"@user\">My Account</a> section. This permits users of a site to share more information about themselves, and can help community-based sites organize users around specific information. For more information, see the online handbook entry for <a href=\"@profile\">Profile module</a>.','','none'),(3519,'','default','Adding fields to the default profile','','none'),(3520,'','default','To provide the ability for users to enter more information about themselves, the Profile module allows additional fields to be added to the default user profile. Examples of common additions would be <em>Location</em>, <em>Company</em>, <em>Age</em>, or <em>About me</em>.','','none'),(3521,'','default','User information pages','','none'),(3522,'','default','The Profile module enables links to see further information about site users. You can view both a main <a href=\"@profile\">User list page</a>, and more specified pages by clicking on linked fields in any profile. For example, the <a href=\"@profile-country\">People who live in Canada</a> listing on Drupal.org displays all users who have entered <em>Canada</em> in the <em>Country</em> field on their user profile.','','none'),(3523,'','default','Author information block','','none'),(3524,'','default','The <em>Author information block</em> is a default block created by the Profile module that can be enabled on the <a href=\"@blocks\">Blocks administration page</a>. It shows visitors of your website information about the author of the page they are reading.','','none'),(3525,'','default','This page displays a list of the existing custom profile fields to be displayed on a user\'s <em>My account</em> page. To provide structure, similar or related fields may be placed inside a category. To add a new category (or edit an existing one), edit a profile field and provide a new category name.','','none'),(3526,'','default','Enriches your content with metadata to let other applications (e.g. search engines, aggregators) better understand its relationships and attributes.','','none'),(3527,'','default','The active search modules have been changed.','','none'),(3528,'','default','You must include at least one positive keyword with 1 character or more.','','none'),(3529,'','default','You must include at least one positive keyword with @count characters or more.','','none'),(3530,'','default','You must include at least one positive keyword with @count[2] characters or more.','','none'),(3531,'','default','Searched %type for %keys.','','none'),(3532,'','default','The Search module provides the ability to index and search for content by exact keywords, and for users by username or e-mail. For more information, see the online handbook entry for <a href=\"@search-module\">Search module</a>.','','none'),(3533,'','default','Searching content and users','','none'),(3534,'','default','Users with <em>Use search</em> permission can use the search block and <a href=\"@search\">Search page</a>. Users with the <em>View published content</em> permission can search for content containing exact keywords. Users with the <em>View user profiles</em> permission can search for users containing the keyword anywhere in the user name, and users with the <em>Administer users</em> permission can search for users by email address. Additionally, users with <em>Use advanced search</em> permission can find content using more complex search methods and filtering by choosing the <em>Advanced search</em> option on the <a href=\"@search\">Search page</a>.','','none'),(3535,'','default','Indexing content with cron','','none'),(3536,'','default','Configuring search settings','','none'),(3537,'','default','Indexing behavior can be adjusted using the <a href=\"@searchsettings\">Search settings page</a>. Users with <em>Administer search</em> permission can control settings such as the <em>Number of items to index per cron run</em>, <em>Indexing settings</em> (word length), <em>Active search modules</em>, and <em>Content ranking</em>, which lets you adjust the priority in which indexed content is returned in results.','','none'),(3538,'','default','The Search module includes a default <em>Search form</em> block, which can be enabled and configured on the <a href=\"@blocks\">Blocks administration page</a>. The block is available to users with the <em>Search content</em> permission.','','none'),(3539,'','default','Extending Search module','','none'),(3540,'','default','By default, the Search module only supports exact keyword matching in content searches. You can modify this behavior by installing a language-specific stemming module for your language (such as <a href=\"http://drupal.org/project/porterstemmer\">Porter Stemmer</a> for American English), which allows words such as walk, walking, and walked to be matched in the Search module. Another approach is to use a third-party search technology with stemming or partial word matching features built in, such as <a href=\"http://drupal.org/project/apachesolr\">Apache Solr</a> or <a href=\"http://drupal.org/project/sphinx\">Sphinx</a>. These and other <a href=\"@contrib-search\">search-related contributed modules</a> can be downloaded by visiting Drupal.org.','','none'),(3541,'','default','<ul>\n<li>Check if your spelling is correct.</li>\n<li>Remove quotes around phrases to search for each word individually. <em>bike shed</em> will often show more results than <em>&quot;bike shed&quot;</em>.</li>\n<li>Consider loosening your query with <em>OR</em>. <em>bike OR shed</em> will often show more results than <em>bike shed</em>.</li>\n</ul>','','none'),(3542,'','default','Administer search','','none'),(3543,'','default','Use search','','none'),(3544,'','default','Use advanced search','','none'),(3545,'','default','Configure relevance settings for search and other indexing options.','','7.31'),(3546,'','default','Choose a set of shortcuts to use','','none'),(3547,'','default','Choose a set of shortcuts for this user','','none'),(3548,'','default','You are now using the new %set_name shortcut set. You can edit it from this page or <a href=\"@switch-url\">switch back to a different one.</a>','','none'),(3549,'','default','%user is now using a new shortcut set called %set_name. You can edit it from this page.','','none'),(3550,'','default','You are now using the %set_name shortcut set.','','none'),(3551,'','default','%user is now using the %set_name shortcut set.','','none'),(3552,'','default','Change set','','none'),(3553,'','default','The shortcut set has been updated.','','none'),(3554,'','default','Add new shortcut','','none'),(3555,'','default','Editing @shortcut','','none'),(3556,'','default','The name of the shortcut.','','none'),(3557,'','default','The path to the shortcut.','','none'),(3558,'','default','The link must correspond to a valid path on the site.','','none'),(3559,'','default','The shortcut %link has been updated.','','none'),(3560,'','default','Added a shortcut for %title.','','none'),(3561,'','default','Are you sure you want to delete the shortcut %title?','','none'),(3562,'','default','The shortcut %title has been deleted.','','none'),(3563,'','default','Unable to add a shortcut for %title.','','none'),(3564,'','default','Adding and removing shortcuts','','none'),(3565,'','default','Displaying shortcuts','','none'),(3566,'','default','You can display your shortcuts by enabling the Shortcuts block on the <a href=\"@blocks\">Blocks administration page</a>. Certain administrative modules also display your shortcuts; for example, the core <a href=\"@toolbar-help\">Toolbar module</a> displays them near the top of the page, along with an <em>Edit shortcuts</em> link.','','none'),(3567,'','default','Administer shortcuts','','none'),(3568,'','default','@shortcut_set shortcuts','','none'),(3569,'','default','Add to %shortcut_set shortcuts','','7.31'),(3570,'','default','Add to shortcuts','','none'),(3571,'','default','Remove from %shortcut_set shortcuts','','none'),(3572,'','default','Remove from shortcuts','','none'),(3573,'','default','Edit shortcuts','','none'),(3574,'','default','Add shortcut','','none'),(3575,'','default','Edit shortcut','','none'),(3576,'','default','Delete shortcut','','none'),(3577,'','default','Allows users to manage customizable lists of shortcut links.','','none'),(3578,'','default','Value @value is TRUE.','','none'),(3579,'','default','Value @value is FALSE.','','none'),(3580,'','default','Value @value is NULL.','','none'),(3581,'','default','Value @value is not NULL.','','none'),(3582,'','default','Value @first is equal to value @second.','','none'),(3583,'','default','Value @first is not equal to value @second.','','none'),(3584,'','default','Value @first is identical to value @second.','','none'),(3585,'','default','Value @first is not identical to value @second.','','none'),(3586,'','default','The test did not complete due to a fatal error.','','none'),(3587,'','default','Link with label %label found.','','none'),(3588,'','default','Link with label %label not found.','','none'),(3589,'','default','Link containing href %href found.','','none'),(3590,'','default','No link containing href %href found.','','none'),(3591,'','default','Clicked link %label (@url_target) from @url_before','','none'),(3592,'','default','Option @option for field @id is selected.','','none'),(3593,'','default','Option @option for field @id is not selected.','','none'),(3594,'','default','By default SimpleTest will clear the results after they have been viewed on the results page, but in some cases it may be useful to leave the results in the database. The results can then be viewed at <em>admin/config/development/testing/[test_id]</em>. The test ID can be found in the database, simpletest table, or kept track of when viewing the results the first time. Additionally, some modules may provide more analysis or features that require this setting to be disabled.','','none'),(3595,'','default','GSS negotiate','','none'),(3596,'','default','NTLM','','none'),(3597,'','default','Any safe','','none'),(3598,'','default','The Testing module provides a framework for running automated unit tests. It can be used to verify a working state of Drupal before and after any code changes, or as a means for developers to write and execute tests for their modules. For more information, see the online handbook entry for <a href=\"@simpletest\">Testing module</a>.','','none'),(3599,'','default','Running tests','','none'),(3600,'','default','Visit the <a href=\"@admin-simpletest\">Testing page</a> to display a list of available tests. For comprehensive testing, select <em>all</em> tests, or individually select tests for more targeted testing. Note that it might take several minutes for all tests to complete. For more information on creating and modifying your own tests, see the <a href=\"@simpletest-api\">Testing API Documentation</a> in the Drupal handbook.','','none'),(3601,'','default','After the tests run, a message will be displayed next to each test group indicating whether tests within it passed, failed, or had exceptions. A pass means that the test returned the expected results, while fail means that it did not. An exception normally indicates an error outside of the test, such as a PHP warning or notice. If there were failures or exceptions, the results will be expanded to show details, and the tests that had failures or exceptions will be indicated in red or pink rows. You can then use these results to refine your code and tests, until all tests pass.','','none'),(3602,'','default','Administer tests','','none'),(3603,'','default','The test run finished in @elapsed.','','none'),(3604,'','default','Use the <em>Clean environment</em> button to clean-up temporary files and tables.','','none'),(3605,'','default','The testing framework requires the PHP <a href=\"@open_basedir-url\">open_basedir</a> restriction to be disabled. Check your webserver configuration or contact your web host.','','none'),(3606,'','default','The testing framework could not be installed because the PHP <a href=\"@curl_url\">cURL</a> library is not available.','','none'),(3607,'','default','The testing framework could not be installed because the PHP <a href=\"@hash_url\">hash</a> extension is disabled.','','none'),(3608,'','default','PHP open_basedir restriction','','none'),(3609,'','default','unblock IP address','','none'),(3610,'','default','block IP address','','none'),(3611,'','default','The Statistics module shows you how often a given page is viewed, who viewed it, the previous page the user visited (referrer URL), and when it was viewed. These statistics are useful in determining how users are visiting and navigating your site. For more information, see the online handbook entry for the <a href=\"@statistics\">Statistics module</a>.','','none'),(3612,'','default','Managing logs','','none'),(3613,'','default','To enable collection of statistics, the <em>Enable access log</em> checkbox on the <a href=\"@statistics-settings\">Statistics settings page</a> must be checked. The <em>Discard access logs older than</em> setting on the settings page specifies the length of time entries are kept in the log before they are deleted. This setting requires a correctly configured <a href=\"@cron\">cron maintenance task</a> to run.','','none'),(3614,'','default','Viewing site usage','','none'),(3615,'','default','The Statistics module can help you break down details about your users and how they are using the site. The module offers four reports:','','none'),(3616,'','default','<a href=\"@recent-hits\">Recent hits</a> displays information about the latest activity on your site, including the URL and title of the page that was accessed, the user name (if available) and the IP address of the viewer.','','none'),(3617,'','default','<a href=\"@top-referrers\">Top referrers</a> displays where visitors came from (referrer URL).','','none'),(3618,'','default','<a href=\"@top-pages\">Top pages</a> displays a list of pages ordered by how often they were viewed.','','none'),(3619,'','default','<a href=\"@top-visitors\">Top visitors</a> shows you the most active visitors for your site and allows you to ban abusive visitors.','','none'),(3620,'','default','Displaying popular content','','none'),(3621,'','default','The module includes a <em>Popular content</em> block that displays the most viewed pages today and for all time, and the last content viewed. To use the block, enable <em>Count content views</em> on the <a href=\"@statistics-settings\">statistics settings page</a>, and then you can enable and configure the block on the <a href=\"@blocks\">blocks administration page</a>.','','none'),(3622,'','default','Page view counter','','none'),(3623,'','default','The Statistics module includes a counter for each page that increases whenever the page is viewed. To use the counter, enable <em>Count content views</em> on the <a href=\"@statistics-settings\">statistics settings page</a>, and set the necessary <a href=\"@permissions\">permissions</a> (<em>View content hits</em>) so that the counter is visible to the users.','','none'),(3624,'','default','Administer statistics','','none'),(3625,'','default','View content access statistics','','none'),(3626,'','default','View content hits','','none'),(3627,'','default','Control details about what and how your site logs access statistics.','','none'),(3628,'','default','The Syslog module logs events by sending messages to the logging facility of your web server\'s operating system. Syslog is an operating system administrative logging tool that provides valuable information for use in system management and security auditing. Most suited to medium and large sites, Syslog provides filtering tools that allow messages to be routed by type and severity. For more information, see the online handbook entry for <a href=\'@syslog\'>Syslog module</a> and PHP\'s <a href=\'@php_openlog\'>openlog</a> and <a href=\'@php_syslog\'>syslog</a> functions.','','none'),(3629,'','default','Logging for UNIX, Linux, and Mac OS X','','none'),(3630,'','default','On UNIX, Linux, and Mac OS X, the file <em>/etc/syslog.conf</em> defines the routing configuration. Messages can be flagged with the codes <code>LOG_LOCAL0</code> through <code>LOG_LOCAL7</code>. For information on Syslog facilities, severity levels, and how to set up <em>syslog.conf</em>, see the <em>syslog.conf</em> manual page on your command line.','','none'),(3631,'','default','Logging for Microsoft Windows','','none'),(3632,'','default','On Microsoft Windows, messages are always sent to the Event Log using the code <code>LOG_USER</code>.','','none'),(3633,'','default','Syslog facility','','none'),(3634,'','default','Depending on the system configuration, Syslog and other logging tools use this code to identify or filter messages from within the entire system log.','','none'),(3635,'','default','The image %file could not be rotated because the imagerotate() function is not available in this PHP installation.','','none'),(3636,'','default','The image %file could not be desaturated because the imagefilter() function is not available in this PHP installation.','','none'),(3637,'','default','Screenshot for !theme theme','','none'),(3638,'','default','Settings for !theme theme','','none'),(3639,'','default','Disable !theme theme','','none'),(3640,'','default','Set !theme as default theme','','none'),(3641,'','default','Enable !theme theme','','none'),(3642,'','default','Enable and set default','','none'),(3643,'','default','Enable !theme as default theme','','none'),(3644,'','default','default theme','','none'),(3645,'','default','Choose \"Default theme\" to always use the same theme as the rest of the site.','','none'),(3646,'','default','Use the administration theme when editing or creating content','','none'),(3647,'','default','The %theme theme has been enabled.','','none'),(3648,'','default','The %theme theme was not found.','','none'),(3649,'','default','%theme is the default theme and cannot be disabled.','','none'),(3650,'','default','The %theme theme has been disabled.','','none'),(3651,'','default','Please note that the administration theme is still set to the %admin_theme theme; consequently, the theme on this page remains unchanged. All non-administrative sections of the site, however, will show the selected %selected_theme theme by default.','','none'),(3652,'','default','%theme is now the default theme.','','none'),(3653,'','default','User verification status in comments','','none'),(3654,'','default','These settings only exist for the themes based on the %engine theme engine.','','none'),(3655,'','default','The logo could not be uploaded.','','none'),(