8,'','default','The URL of the site\'s front page without the protocol.','','7.31'),(3729,'','default','Short format','','7.31'),(3730,'','default','A date in \'short\' format. (%date)','','7.31'),(3731,'','default','Medium format','','7.31'),(3732,'','default','A date in \'medium\' format. (%date)','','7.31'),(3733,'','default','Long format','','7.31'),(3734,'','default','A date in \'long\' format. (%date)','','7.31'),(3735,'','default','A date in a custom format. See !php-date for details.','','7.31'),(3736,'','default','the PHP documentation','','7.31'),(3737,'','default','Time-since','','7.31'),(3738,'','default','Raw timestamp','','7.31'),(3739,'','default','A date in UNIX timestamp format (%date)','','7.31'),(3740,'','default','The System module is integral to the site, and provides basic but extensible functionality for use by other modules and themes. Some integral elements of Drupal are contained in and managed by the System module, including caching, enabling and disabling modules and themes, preparing and displaying the administrative page, and configuring fundamental site settings. A number of key system maintenance operations are also part of the System module. For more information, see the online handbook entry for <a href=\"@system\">System module</a>.','','none'),(3741,'','default','Managing modules','','none'),(3742,'','default','The System module allows users with the appropriate permissions to enable and disable modules on the <a href=\"@modules\">Modules administration page</a>. Drupal comes with a number of core modules, and each module provides a discrete set of features and may be enabled or disabled depending on the needs of the site. Many additional modules contributed by members of the Drupal community are available for download at the <a href=\"@drupal-modules\">Drupal.org module page</a>.','','none'),(3743,'','default','Managing themes','','none'),(3744,'','default','The System module allows users with the appropriate permissions to enable and disable themes on the <a href=\"@themes\">Appearance administration page</a>. Themes determine the design and presentation of your site. Drupal comes packaged with several core themes, and additional contributed themes are available at the <a href=\"@drupal-themes\">Drupal.org theme page</a>.','','none'),(3745,'','default','Managing caching','','none'),(3746,'','default','The System module allows users with the appropriate permissions to manage caching on the <a href=\'@cache-settings\'>Performance settings page</a>. Drupal has a robust caching system that allows the efficient re-use of previously-constructed web pages and web page components. Pages requested by anonymous users are stored in a compressed format; depending on your site configuration and the amount of your web traffic tied to anonymous visitors, the caching system may significantly increase the speed of your site.','','none'),(3747,'','default','Performing system maintenance','','none'),(3748,'','default','Configuring basic site settings','','none'),(3749,'','default','The System module also handles basic configuration options for your site, including <a href=\"@date-time-settings\">Date and time settings</a>, <a href=\"@file-system\">File system settings</a>, <a href=\"@clean-url\">Clean URL support</a>, <a href=\"@site-info\">Site name and other information</a>, and a <a href=\"@maintenance-mode\">Maintenance mode</a> for taking your site temporarily offline.','','none'),(3750,'','default','Configuring actions','','none'),(3751,'','default','Actions are individual tasks that the system can do, such as unpublishing a piece of content or banning a user. Modules, such as the <a href=\"@trigger-help\">Trigger module</a>, can fire these actions when certain system events happen; for example, when a new post is added or when a user logs in. Modules may also provide additional actions. Visit the <a href=\"@actions\">Actions page</a> to configure actions.','','none'),(3752,'','default','Set and configure the default theme for your website.  Alternative <a href=\"@themes\">themes</a> are available.','','none'),(3753,'','default','Download additional <a href=\"@modules\">contributed modules</a> to extend Drupal\'s functionality.','','none'),(3754,'','default','Regularly review and install <a href=\"@updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated.','','none'),(3755,'','default','Regularly review <a href=\"@updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated.','','none'),(3756,'','default','Regularly review available updates to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated. Enable the Update manager module to update and install modules and themes.','','none'),(3757,'','default','If you are upgrading to a newer version of Drupal or upgrading contributed modules or themes, you may need to run the <a href=\"@update-php\">update script</a>.','','none'),(3758,'','default','There are two types of actions: simple and advanced. Simple actions do not require any additional configuration, and are listed here automatically. Advanced actions need to be created and configured before they can be used, because they have options that need to be specified; for example, sending an e-mail to a specified address, or unpublishing content containing certain words. To create an advanced action, select the action from the drop-down list in the advanced action section below and click the <em>Create</em> button.','','none'),(3759,'','default','An advanced action offers additional configuration options which may be filled out below. Changing the <em>Description</em> field is recommended, in order to better identify the precise action taking place. This description will be displayed in modules such as the Trigger module when assigning actions to system events, so it is best if it is as descriptive as possible (for example, \"Send e-mail to Moderation Team\" rather than simply \"Send e-mail\").','','none'),(3760,'','default','Administer modules','','none'),(3761,'','default','Administer site configuration','','none'),(3762,'','default','Administer themes','','none'),(3763,'','default','Administer actions','','none'),(3764,'','default','Use the administration pages and help','','none'),(3765,'','default','Use the site in maintenance mode','','none'),(3766,'','default','View site reports','','none'),(3767,'','default','Block IP addresses','','none'),(3768,'','default','Public files','','7.31'),(3769,'','default','Public local files served by the webserver.','','7.31'),(3770,'','default','Private local files served by Drupal.','','none'),(3771,'','default','Temporary files','','7.31'),(3772,'','default','Temporary local files for upload and previews.','','7.31'),(3773,'','default','Update modules','','none'),(3774,'','default','Update themes','','none'),(3775,'','default','SSH','','none'),(3776,'','default','Your password is not saved in the database and is only used to establish a connection.','','none'),(3777,'','default','The connection will be created between your web server and the machine hosting the web server files. In the vast majority of cases, this will be the same machine, and \"localhost\" is correct.','','none'),(3778,'','default','Configure your <a href=\"@user-edit\">account time zone setting</a>.','','none'),(3779,'','default','Select the desired local time and time zone. Dates and times throughout this site will be displayed using this time zone.','','none'),(3780,'','default','Your time zone setting will be automatically detected if possible. Confirm the selection and click save.','','none'),(3781,'','default','System help','','none'),(3782,'','default','The directory %directory does not exist and could not be created.','','none'),(3783,'','default','