 by genre with terms and sub-terms could look as follows:','','none'),(3841,'','default','<em>vocabulary</em>: Music','','none'),(3842,'','default','<em>term</em>: Jazz','','none'),(3843,'','default','<em>sub-term</em>: Swing','','none'),(3844,'','default','<em>sub-term</em>: Fusion','','none'),(3845,'','default','<em>term</em>: Rock','','none'),(3846,'','default','<em>sub-term</em>: Country rock','','none'),(3847,'','default','<em>sub-term</em>: Hard rock','','none'),(3848,'','default','You can assign a sub-term to multiple parent terms. For example, <em>fusion</em> can be assigned to both <em>rock</em> and <em>jazz</em>.','','none'),(3849,'','default','Terms in a <em>free-tagging vocabulary</em> can be built gradually as you create or edit content. This is often done used for blogs or photo management applications.','','none'),(3850,'','default','Assigning vocabularies to content types','','none'),(3851,'','default','Before you can use a new vocabulary to classify your content, a new Taxonomy term field must be added to a <a href=\"@ctedit\">content type</a> on its <em>manage fields</em> page. When adding a taxonomy field, you choose a <em>widget</em> to use to enter the taxonomy information on the content editing page: a select list, checkboxes, radio buttons, or an auto-complete field (to build a free-tagging vocabulary). After choosing the field type and widget, on the subsequent <em>field settings</em> page you can choose the desired vocabulary, whether one or multiple terms can be chosen from the vocabulary, and other settings. The same vocabulary can be added to multiple content types, by using the \"Add existing field\" section on the manage fields page.','','none'),(3852,'','default','Classifying content','','none'),(3853,'','default','After the vocabulary is assigned to the content type, you can start classifying content. The field with terms will appear on the content editing screen when you edit or <a href=\"@addnode\">add new content</a>.','','none'),(3854,'','default','Viewing listings and RSS feeds by term','','none'),(3855,'','default','Each taxonomy term automatically provides a page listing content that has its classification, and a corresponding RSS feed. For example, if the taxonomy term <em>country rock</em> has the ID 123 (you can see this by looking at the URL when hovering on the linked term, which you can click to navigate to the listing page), then you will find this list at the path <em>taxonomy/term/123</em>. The RSS feed will use the path <em>taxonomy/term/123/feed</em> (the RSS icon for this term\'s listing will automatically display in your browser\'s address bar when viewing the listing page).','','none'),(3856,'','default','Extending Taxonomy module','','none'),(3857,'','default','There are <a href=\"@taxcontrib\">many contributed modules</a> that extend the behavior of the Taxonomy module for both display and organization of terms.','','none'),(3858,'','default','Taxonomy is for categorizing content. Terms are grouped into vocabularies. For example, a vocabulary called \"Fruit\" would contain the terms \"Apple\" and \"Banana\".','','none'),(3859,'','default','You can reorganize the terms in %capital_name using their drag-and-drop handles, and group terms under a parent term by sliding them under and to the right of the parent.','','none'),(3860,'','default','%capital_name contains terms grouped under parent terms. You can reorganize the terms in %capital_name using their drag-and-drop handles.','','none'),(3861,'','default','%capital_name contains terms with multiple parents. Drag and drop of terms with multiple parents is not supported, but you can re-enable drag-and-drop support by editing each term to include only a single parent.','','none'),(3862,'','default','Administer vocabularies and terms','','none'),(3863,'','default','Edit terms in %vocabulary','','none'),(3864,'','default','Delete terms from %vocabulary','','none'),(3865,'','default','Taxonomy term page','','7.31'),(3866,'','default','Term reference','','7.31'),(3867,'','default','This field stores a reference to a taxonomy term.','','7.31'),(3868,'','default','Autocomplete term widget (tagging)','','7.31'),(3869,'','default','The vocabulary which supplies the options for this field.','','none'),(3870,'','default','The Toolbar module displays links to top-level administration menu items and links from other modules at the top of the screen. For more information, see the online handbook entry for <a href=\"@toolbar\">Toolbar module</a>.','','none'),(3871,'','default','Displaying administrative links','','none'),(3872,'','default','Use the administration toolbar','','none'),(3873,'','default','Toggle drawer visibility','','none'),(3874,'','default','Provides a toolbar that shows the top-level administration menu items and links from other modules.','','none'),(3875,'','default','The Tracker module displays the most recently added and updated content on your site, and allows you to follow new content created by each user. This module has no configuration options. For more information, see the online handbook entry for <a href=\"@tracker\">Tracker module</a>.','','none'),(3876,'','default','The Tracker module adds a new menu item to the Navigation menu, called <em>Recent content</em>. You can configure menu items via the <a href=\"@menus\">Menus administration page</a>.','','none'),(3877,'','default','Tracking new and updated site content','','none'),(3878,'','default','The <a href=\'@recent\'>Recent content</a> page shows new and updated content in reverse chronological order, listing the content type, title, author\'s name, number of comments, and time of last update. Content is considered updated when changes occur in the text, or when new comments are added. The <em>My recent content</em> tab limits the list to the currently logged-in user.','','none'),(3879,'','default','Tracking user-specific content','','none'),(3880,'','default','To follow a specific user\'s new and updated content, sel