dle that already has an instance of that field.','','none'),(4142,'','default','Field API to add fields to entities like nodes and users.','','none'),(4143,'','default','Overview of fields on all entity types.','','7.31'),(4144,'','default','Configuring text formats','','none'),(4145,'','default','Configure text formats on the <a href=\"@formats\">Text formats page</a>. <strong>Improper text format configuration is a security risk</strong>. To ensure security, untrusted users should only have access to text formats that restrict them to either plain text or a safe set of HTML tags, since certain HTML tags can allow embedding malicious links or scripts in text. More trusted registered users may be granted permission to use less restrictive text formats in order to create rich content.','','none'),(4146,'','default','Users with access to more than one text format can use the <em>Text format</em> fieldset to choose between available text formats when creating or editing multi-line content. Administrators can define the text formats available to each user role, and control the order of formats listed in the <em>Text format</em> fieldset on the <a href=\"@text-formats\">Text formats page</a>.','','none'),(4147,'','default','Text formats define the HTML tags, code, and other formatting that can be used when entering text. <strong>Improper text format configuration is a security risk</strong>. Learn more on the <a href=\"@filterhelp\">Filter module help page</a>.','','none'),(4148,'','default','Show more content','','none'),(4149,'','default','Collapse','','none'),(4150,'','default','The testing framework requires the DOMDocument class to be available. Check the configure command at the <a href=\"@link-phpinfo\">PHP info page</a>.','','none'),(4151,'','default','Error messages to display','','none'),(4152,'','default','It is recommended that sites running on production environments do not display any errors.','','none'),(4153,'','default','Cannot open %file_path','','none'),(4154,'','default','Term name textfield','','none'),(4155,'','default','Term description textarea','','none'),(4156,'','default','Password reset instructions will be mailed to %email. You must log out to use the password reset link in the e-mail.','','none'),(4157,'','default','Enter your current password to change the %mail or %pass. !request_new.','','none'),(4158,'','default','Current password','','none'),(4159,'','default','Your current password is missing or incorrect; it\'s required to change the %name.','','none'),(4160,'','default','A welcome message with further instructions has been e-mailed to the new user <a href=\"@url\">%name</a>.','','none'),(4161,'','default','A welcome message with further instructions has been sent to your e-mail address.','','none'),(4162,'','default','Configure user accounts.','','7.31'),(4163,'','default','Configure default behavior of users, including registration requirements, e-mails, fields, and user pictures.','','7.31'),(4164,'','default','%module module installed.','','none'),(4165,'','default','Table %name already exists.','','none'),(4166,'','default','Cannot rename %table to %table_new: table %table doesn\'t exist.','','none'),(4167,'','default','Cannot rename %table to %table_new: table %table_new already exists.','','none'),(4168,'','default','Cannot add field %table.%field: table doesn\'t exist.','','none'),(4169,'','default','Cannot add field %table.%field: field already exists.','','none'),(4170,'','default','Cannot set default value of field %table.%field: field doesn\'t exist.','','none'),(4171,'','default','Cannot remove default value of field %table.%field: field doesn\'t exist.','','none'),(4172,'','default','Cannot add primary key to table %table: table doesn\'t exist.','','none'),(4173,'','default','Cannot add primary key to table %table: primary key already exists.','','none'),(4174,'','default','Cannot add unique key %name to table %table: table doesn\'t exist.','','none'),(4175,'','default','Cannot add unique key %name to table %table: unique key already exists.','','none'),(4176,'','default','Cannot add index %name to table %table: table doesn\'t exist.','','none'),(4177,'','default','Cannot add index %name to table %table: index already exists.','','none'),(4178,'','default','Cannot change the definition of field %table.%name: field doesn\'t exist.','','none'),(4179,'','default','Cannot rename field %table.%name to %name_new: target field already exists.','','none'),(4180,'','default','Use this page to create a new custom block.','','none'),(4181,'','default','Number of recent blog posts to display','','none'),(4182,'','default','@node_type comment','','none'),(4183,'','default','Edit comment %comment','','none'),(4184,'','default','The Field UI module provides an administrative user interface (UI) for attaching and managing fields. Fields can be defined at the content-type level for content items and comments, at the vocabulary level for taxonomy terms, and at the site level for user accounts. Other modules may also enable fields to be defined for their data. Field types (text, image, number, etc.) are defined by modules, and collected and managed by the <a href=\"@field\">Field module</a>. For more information, see the online handbook entry for <a href=\"@field_ui\" target=\"_blank\">Field UI module</a>.','','none'),(4185,'','default','Planning fields','','none'),(4186,'','default','What the field will be called','','none'),(4187,'','default','A field has a <em>label</em> (the name displayed in the user interface) and a <em>machine name</em> (the name used internally). The label can be changed after you create the field, if needed, but the machine name cannot be changed after you have created the field.','','none'),(4188,'','default','What type of data the field will store','','none'),(4189,'','default','Each field can store one type of data (text, number, file, etc.). When you define a field, you choose a particular <em>field type</em>, which corresponds to the type of data you want to store. The field type cannot be changed after you have created the field.','','none'),(4190,'','default','How the data will be input and displayed','','none'),(4191,'','default','How many values the field will store','','none'),(4192,'','default','You can store one value, a specific maximum number of values, or an unlimited number of values in each field. For example, an employee identification number field might store a single number, whereas a phone number field might store multiple phone numbers. This setting can be changed after you have created the field, but if you reduce the maximum number of values, you may lose information.','','none'),(4193,'','default','Reusing fields','','none'),(4194,'','default','Once you have defined a field, you can reuse it. For example, if you define a custom image field for one content type, and you need to have an image field with the same parameters on another content type, you can add the same field to the second content type, in the <em>Add existing field</em> area of the user interface. You could also add this field to a taxonomy vocabulary, comments, user accounts, etc.','','none'),(4195,'','default','Some settings of a reused field are unique to each use of the field; others are shared across all places you use the field. For example, the label of a text field is unique to each use, while the setting for the number of values is shared.','','none'),(4196,'','default','There are two main reasons for reusing fields. First, reusing fields can save you time over defining new fields. Second, reusing fields also allows you to display, filter, group, and sort content together by field across content types. For example, the contributed Views module allows you to create lists and tables of content. So if you use the same field on multiple content types, you can create a View containing all of those content types together displaying that field, sorted by that field, and/or filtered by that field.','','none'),(4197,'','default','Fields on content items','','none'),(4198,'','default','Fields on content items are defined at the content-type level, on the <em>Manage fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you define a field for a content type, each content item of that type will have that field added to it. Some fields, such as the Title and Body, are provided for you when you create a content type, or are provided on content types created by your installation profile.','','none'),(4199,'','default','Fields on taxonomy terms','','none'),(4200,'','default','Fields on taxonomy terms are defined at the taxonomy vocabulary level, on the <em>Manage fields</em> tab of the vocabulary edit page (which you can reach from the <a href=\"@taxonomy\">Taxonomy page</a>). When you define a field for a vocabulary, each term in that vocabulary will have that field added to it. For example, you could define an image field for a vocabulary to store an icon with each term.','','none'),(4201,'','default','Fields on user accounts','','none'),(4202,'','default','Fields on user accounts are defined on a site-wide basis on the <a href=\"@fields\">Manage fields tab</a> of the <a href=\"@accounts\">Account settings</a> page. When you define a field for user accounts, each user account will have that field added to it. For example, you could add a long text field to allow users to include a biography.','','none'),(4203,'','default','Fields on comments','','none'),(4204,'','default','Fields on comments are defined at the content-type level, on the <em>Comment fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you add a field for comments, each comment on a content item of that type will have that field added to it. For example, you could add a website field to the comments on forum posts, to allow forum commenters to add a link to their website.','','none'),(4205,'','default','Administer text formats and filters','','none'),(4206,'','default','@type language detection','','none'),(4207,'','default','Strings in the uploaded file replace existing ones, new ones are added. The plural format is updated.','','none'),(4208,'','default','Existing strings and the plural format are kept, only new strings are added.','','none'),(4209,'','default','Define how to decide which language is used to display page elements (primarily text provided by Drupal and modules, such as field labels and help text). This decision is made by evaluating a series of detection methods for languages; the first detection method that gets a result will determine which language is used for that type of text. Define the order of evaluation of language detection methods on this page.','','none'),(4210,'','default','User interface text','','none'),(4211,'','default','Use the detected interface language.','','none'),(4212,'','default','Add new %type','','none'),(4213,'','default','The new set is created by copying items from your default shortcut set.','','none'),(4214,'','default','The new set is created by copying items from the %default set.','','none'),(4215,'','default','You are currently using the %set-name shortcut set.','','none'),(4216,'','default','edit set name','','none'),(4217,'','default','delete set','','none'),(4218,'','default','Create new set','','none'),(4219,'','default','The %set_name shortcut set has been created. You can edit it from this page.','','none'),(4220,'','default','Updated set name to %set-name.','','none'),(4221,'','default','If you have chosen this shortcut set as the default for some or all users, they may also be affected by deleting it.','','none'),(4222,'','default','Are you sure you want to delete the shortcut set %title?','','none'),(4223,'','default','The shortcut set %title has been deleted.','','none'),(4224,'','default','1 user has chosen or been assigned to this shortcut set.','','none'),(4225,'','default','@count users have chosen or been assigned to this shortcut set.','','none'),(4226,'','default','@count[2] users have chosen or been assigned to this shortcut set.','','none'),(4227,'','default','The Shortcut module allows users to create sets of <em>shortcut</em> links to commonly-visited pages of the site. Shortcuts are contained within <em>sets</em>. Each user with <em>Select any shortcut set</em> permission can select a shortcut set created by anyone at the site. For more information, see the online handbook entry for <a href=\"@shortcut\">Shortcut module</a>.','','none'),(4228,'','default','Administering shortcuts','','none'),(4229,'','default','Users with the <em>Administer shortcuts</em> permission can manage shortcut sets and edit the shortcuts within sets from the <a href=\"@shortcuts\">Shortcuts administration page</a>.','','none'),(4230,'','default','Choosing shortcut sets','','none'),(4231,'','default','Users with permission to switch shortcut sets can choose a shortcut set to use from the Shortcuts tab of their user account page.','','none'),(4232,'','default','The Shortcut module creates an add/remove link for each page on your site; the link lets you add or remove the current page from the currently-enabled set of shortcuts (if your theme displays it and you have permission to edit your shortcut set). The core Seven administration theme displays this link next to the page title, as a small + or - sign. If you click on the + sign, you will add that page to your preferred set of shortcuts. If the page is already part of your shortcut set, the link will be a - sign, and will allow you to remove the current page from your shortcut set.','','none'),(4233,'','default','Define which shortcut set you are using on the <a href=\"@shortcut-link\">Shortcuts tab</a> of your account page.','','none'),(4234,'','default','Edit current shortcut set','','none'),(4235,'','default','Editing the current shortcut set will affect other users if that set has been assigned to or selected by other users. Granting \"Select any shortcut set\" permission along with this permission will grant permission to edit any shortcut set.','','none'),(4236,'','default','Select any shortcut set','','none'),(4237,'','default','From all shortcut sets, select one to be own active set. Without this permission, an administrator selects shortcut sets for users.','','none'),(4238,'','default','Add and modify shortcut sets.','','7.31'),(4239,'','default','Add shortcut set','','7.31'),(4240,'','default','Edit set name','','none'),(4241,'','default','Delete shortcut set','','none'),(4242,'','default','@remote could not be saved to @path.','','none'),(4243,'','default','Drupal requires you to enable the PHP extensions in the following list (see the <a href=\"@system_requirements\">system requirements page</a> for more information):','','none'),(4244,'','default','Database support','','none'),(4245,'','default','Your web server does not appear to support any common PDO database extensions. Check with your hosting provider to see if they support PDO (PHP Data Objects) and offer any databases that <a href=\"@drupal-databases\">Drupal supports</a>.','','none'),(4246,'','default','Footer first column','','7.31'),(4247,'','default','Footer second column','','7.31'),(4248,'','default','Footer third column','','7.31'),(4249,'','default','Footer fourth column','','7.31'),(4250,'','default','Kyrgyz','','none'),(4251,'','default','theme() may not be called until all modules are loaded.','','none'),(4252,'','default','GD library PNG support','','none'),(4253,'','default','The date the comment was most recently updated.','','none'),(4254,'','default','Comment posted: %subject.','','none'),(4255,'','default','On value','','none'),(4256,'','default','If left empty, \"1\" will be used.','','none'),(4257,'','default','Off value','','none'),(4258,'','default','If left empty, \"0\" will be used.','','none'),(4259,'','default','This field has been disabled because you do not have sufficient permissions to edit it.','','none'),(4260,'','default','Select a forum.','','none'),(4261,'','default','The GD Library for PHP is enabled, but was compiled without support for functions used by the rotate and desaturate effects. It was probably compiled using the official GD libraries from http://www.libgd.org instead of the GD library bundled with PHP. You should recompile PHP --with-gd using the bundled GD library. See <a href=\"http://www.php.net/manual/book.image.php\">the PHP manual</a>.','','none'),(4262,'','default','GD library rotate and desaturate effects','','none'),(4263,'','default','View, edit and delete all content regardless of permission restrictions.','','none'),(4264,'','default','You must validate your email address for this account before logging in via OpenID.','','none'),(4265,'','default','The HTML ID %id is unique.','','none'),(4266,'','default','Syslog format','','none'),(4267,'','default','Specify the format of the syslog entry. Available variables are: <dl><dt><code>!base_url</code></dt><dd>Base URL of the site.</dd><dt><code>!timestamp</code></dt><dd>Unix timestamp of the log entry.</dd><dt><code>!type</code></dt><dd>The category to which this message belongs.</dd><dt><code>!ip</code></dt><dd>IP address of the user triggering the message.</dd><dt><code>!request_uri</code></dt><dd>The requested URI.</dd><dt><code>!referer</code></dt><dd>HTTP Referer if available.</dd><dt><code>!uid</code></dt><dd>User ID.</dd><dt><code>!link</code></dt><dd>A link to associate with the message.</dd><dt><code>!message</code></dt><dd>The message to store in the log.</dd></dl>','','none'),(4268,'','default','External resources can be optimized automatically, which can reduce both the size and number of requests made to your website.','','7.31'),(4269,'','default','A date in \'time-since\' format. (%date)','','7.31'),(4270,'','default','The location of the file relative to Drupal root.','','7.31'),(4271,'','default','HTTP error @errorcode occurred when trying to fetch @remote.','','none'),(4272,'','default','Your system or network configuration does not allow Drupal to access web pages, resulting in reduced functionality. This could be due to your webserver configuration or PHP settings, and should be resolved in order to download information about available updates, fetch aggregator feeds, sign in via OpenID, or use other network-dependent services. If you are certain that Drupal can access web pages but you are still seeing this message, you may add <code>$conf[\'drupal_http_request_fails\'] = FALSE;</code> to the bottom of your settings.php file.','','none'),(4273,'','default','A translation of %title in %language already exists, a new %type will be created instead of a translation.','','none'),(4274,'','default','Your modules have been downloaded and updated.','','none'),(4275,'','default','<a href=\"@update\">Run database updates</a>','','none'),(4276,'','default','@name <em>(locked)</em>','','none'),(4277,'','default','Are you sure you want to delete the role %name ?','','none'),(4278,'','default','Permissions let you control what users can do and see on your site. You can define a specific set of permissions for each role. (See the <a href=\"@role\">Roles</a> page to create a role). Two important roles to consider are Authenticated Users and Administrators. Any permissions granted to the Authenticated Users role will be given to any user who can log into your site. You can make any role the Administrator role for the site, meaning this will be granted all new permissions automatically. You can do this on the <a href=\"@settings\">User Settings</a> page. You should be careful to ensure that only trusted users are given this access and level of control of your site.','','none'),(4279,'','default','Roles allow you to fine tune the security and administration of Drupal. A role defines a group of users that have certain privileges as defined on the <a href=\"@permissions\">permissions page</a>. Examples of roles include: anonymous user, authenticated user, moderator, administrator and so on. In this area you will define the names and order of the roles on your site. It is recommended to order your roles from least permissive (anonymous user) to most permissive (administrator). To delete a role choose \"edit role\".','','none'),(4280,'','default','Use <em>articles</em> for time-sensitive content like news, press releases or blog posts.','','none'),(4281,'','default','Filipino','','none'),(4282,'','default','Swiss German','','none'),(4283,'','default','Scots','','none'),(4284,'','default','Cache pages for anonymous users','','7.31'),(4285,'','default','Bartik','','7.31'),(4286,'','default','A flexible, recolorable theme with many regions.','','none'),(4287,'','default','Highlighted','','7.31'),(4288,'','default','Sidebar second','','7.31'),(4289,'','default','Triptych first','','7.31'),(4290,'','default','Triptych middle','','7.31'),(4291,'','default','Triptych last','','7.31'),(4292,'','default','Main background','','none'),(4293,'','default','Sidebar background','','none'),(4294,'','default','Sidebar borders','','none'),(4295,'','default','Footer background','','none'),(4296,'','default','Plum','','none'),(4297,'','default','!local-task-title!active','','7.31'),(4298,'','default','A space-separated list of HTML tags allowed in the content of feed items. Disallowed tags are stripped from the content.','','none'),(4299,'','default','%field may only contain characters a-z, underscores, or hyphens.','','none'),(4300,'','default','%field cannot contain any markup.','','none'),(4301,'','default','No URL aliases available. <a href=\"@link\">Add URL alias</a>.','','none'),(4302,'','default','To provide keyword searching, the search engine maintains an index of words found in the content and its fields, along with text added to your content by other modules (such as comments from the core Comment module, and taxonomy terms from the core Taxonomy module). To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Users with <em>Administer search</em> permission can further configure the cron settings on the <a href=\"@searchsettings\">Search settings page</a>.','','none'),(4303,'','default','Content reindexing','','none'),(4304,'','default','Content-related actions on your site (creating, editing, or deleting content and comments) automatically cause affected content items to be marked for indexing or reindexing at the next cron run. When content is marked for reindexing, the previous content remains in the index until cron runs, at which time it is replaced by the new content. Unlike content-related actions, actions related to the structure of your site do not cause affected content to be marked for reindexing. Examples of structure-related actions that affect content include deleting or editing taxonomy terms, enabling or disabling modules that add text to content (such as Taxonomy, Comment, and field-providing modules), and modifying the fields or display parameters of your content types. If you take one of these actions and you want to ensure that the search index is updated to reflect your changed site structure, you can mark all content for reindexing by clicking the \"Re-index site\" button on the <a href=\"@searchsettings\">Search settings page</a>. If you have a lot of content on your site, it may take several cron runs for the content to be reindexed.','','none'),(4305,'','default','Cached pages will not be re-created until at least this much time has elapsed.','','7.31'),(4306,'','default','Expiration of cached pages','','7.31'),(4307,'','default','The maximum time an external cache can use an old version of a page.','','7.31'),(4308,'','default','These options control the display settings for the %name theme. When your site is displayed using this theme, these settings will be used.','','none'),(4309,'','default','Administer software updates','','none'),(4310,'','def