предоставляют метод группировки похожих строк, они часто используются для фокусировки усилий по переводу отдельных зон интерфейса Drupal.','ru',0,0),(2209,'Заметьте, что файлы <em>.po</em> из пакета перевода импортируются автоматически (по возможности), когда подключаются новые модули или темы оформления. Так как эта страница позволяет одновременно закачивать только один <em>.po</em> файл, возможно, будет проще скачать и распаковать пакет перевода в ваш корневой каталог Drupal и <a href=\"@language-add\">добавить язык</a> (это автоматически импортирует все <em>.po</em> файлы пакета). Пакеты перевода доступны для скачивания на <a href=\"@translations\">странице переводов Drupal</a>.','ru',0,0),(2210,'Эта страница экспортирует переведённые строки вашего сайта. Экспортируемый файл может быть записан в формате Gettext Portable Object (<em>.po</em>), включающим как оригинальную строку, так и её перевод (для обмена переводами с другими); или в формате шаблона для Gettext Portable Object (<em>.pot</em>), включающим только оригинальные строки (для создания новых переводов с помощью Gettext-редактора).','ru',0,0),(2211,'Встроенный интерфейс','ru',0,0),(2212,'Язык по умолчанию этой учетной записи для e-mail и внешнего вида сайта.','ru',0,0),(2213,'Язык по умолчанию.','ru',0,0),(2214,'Синоним, установленный для определенного языка, всегда будет использоваться при отображении этой страницы на этом языке, а также будет иметь преимущество над другими синонимами с опцией <em>на всех языках</em>.','ru',0,0),(2215,'Включает поддержку нескольких языков для этого типа материала. Если включено, к форме редактирования будет добавлено поле выбора языка, позволяющее выбрать один из <a href=\"!languages\">доступных языков</a>. Если отключено, новые сообщения сохраняются с языком по умолчанию. На существующее содержимое эта опция не оказывает влияния.','ru',0,0),(2216,'Настройка языков, используемых для материалов и интерфейса пользователей.','ru',0,0),(2217,'Настройка перевода пользователь