href=\"@php-snippets\">образцы фрагментов PHP</a>,  или, если вы располагаете некоторым опытом работы с PHP и знанием системы Drupal, вы можете создать собственные.','ru',0,0),(2263,'Вы можете размещать PHP-код. Необходимо добавлять теги &lt;?php ?&gt;.','ru',0,0),(2264,'Использовать пользовательский PHP-код','ru',0,0),(2265,'Пользовательский PHP-код может быть внедрен в некоторые типы имеющегося на сайте содержимого, включая сообщения и блоки. Хотя внедрение кода PHP в сообщение или блок является сильным и гибким инструментом, если используется пользующимся доверием пользователем, располагающим опытом работы с PHP, оно может составлять существенную угрозу безопасности, если будет использовано ненадлежащим образом. Даже незначительная ошибка при внедрении кодов PHP может случайно поставить под угрозу ваш сайт.','ru',0,0),(2266,'Если вы незнакомы с PHP, SQL или Drupal, то избегаете использования пользовательских кодов PHP внутри сообщений. Экспериментирование с PHP может повредить вашу базу данных, сделать ваш сайт неработоспособным или создать значительную угрозу безопасности.','ru',0,0),(2267,'Примечания:','ru',0,0),(2268,'Не забудьте перепроверить каждую строку на наличие синтаксических и логических ошибок <strong>перед</strong> сохранением.','ru',0,0),(2269,'Операторы должны правильно завершаться точками с запятой.','ru',0,0),(2270,'Глобальные переменные, используемые в вашем PHP-коде, сохраняют свои значения после выполнения скрипта.','ru',0,0),(2271,'<code>register_globals</code> <strong>выключен</strong>. Если вам приходится использовать формы, ознакомьтесь и воспользуйтесь функциями в <a href=\"@formapi\"> Drupal Form API</a>.','ru',0,0),(2272,'Используйте операторы <code>печатать</code> или <code>возвратить</code> в вашем коде чтобы обеспечить вывод содержимого.','ru',0,0),(2273,'Разработайте и проверьте свой PHP-код, используя отдельный тестовый скрипт и образец базы данных, прежде чем развернуть его на основном сайте.','ru',0,0),(2274,'Предпочтительнее раз