.','ru',0,0),(2820,'Данная ссылка - неработающая.','ru',0,0),(2821,'Новых RSS-лент не добавлено.','ru',0,0),(2822,'Ссылка %url - неработающая.','ru',0,0),(2823,'RSS-лента с названием %title уже существует.','ru',0,0),(2824,'RSS-лента со ссылкой %url уже существует.','ru',0,0),(2825,'Сборщики скачивают данные из внешнего источника. Выберите подходящий сборщик для внешнего источника, откуда хотите скачивать.','ru',0,0),(2826,'Парсеры трансформируют скачанные данные в стандартные структуры. Выберите парсер, подходящий  для типа лент, которые вы хотите собирать.','ru',0,0),(2827,'Процессоры взаимодействуют с собранными данными лент, например, хранят их содержимое. Выберите нужный процессор для вашей задачи.','ru',0,0),(2828,'Для большинства задач по сбору подходят настройки по умолчанию.','ru',0,0),(2829,'Категория %category уже существует. Пожалуйста, введите уникальное название.','ru',0,0),(2830,'Сборщик по умолчанию','ru',0,0),(2831,'Скачивает данные','ru',0,0),(2832,'Обработчик по умолчанию','ru',0,0),(2833,'Обрабатывает ленты RSS, Atom и RDF.','ru',0,0),(2834,'Процессор по умолчанию','ru',0,0),(2835,'Создает краткие записи из новостей лент.','ru',0,0),(2836,'Настройки процессора по умолчанию','ru',0,0),(2837,'Пункты на странице','ru',0,0),(2838,'Обновление происходит при <a href=\"@cron\">запуске cron</a>.','ru',0,0),(2839,'Выберите категории используя','ru',0,0),(2840,'Тип переключателя, при выборе категории для пункта ленты. При использовании большого количества категорий удобнее использовать мультивыбор.','ru',0,0),(2841,'Размер краткого содержания','ru',0,0),(2842,'Выберите количество знаков, которое будет содержаться в краткой версии документа. Отметьте: это значение будет применяться только к новым или обновлённым документам.','ru',0,0),(2843,'Модуль Aggregator собирает и показывает обновления с RSS-, RDF-, и Atom-лент со всего Интернета. Тысячи сайтов (обычно новости сайтов и блогов) публикуют свои последние обновления в лентах, используя несколько стандартизированных форматов, основанных на XML. Для дополнительной информации смотрите страницу модуля <a href=\"@aggregator-module\">Aggregator</a> в сетевом руководстве.','ru',0,0),(2844,'Просмотр лент','ru',0,0),(2845,'Ленты могут быть сгруппированы по категориям. Обычно такую группировку делают исходя из тематики ленты, например, ленты могут собираться в категории «Спорт», «Компьютеры» или «Новости». Пользователи могут просматривать собираемые ленты на <a href=\"@aggregator\">основной странице</a> агрегатора или просматривать содержание по <a href=\"@aggregator-sources\">источникам лент</a>. Для каждой добавленной ленты генерируется свой блок, который <a href=\"@admin-block\">можно вывести</a> в каком-либо регионе темы.','ru',0,0),(2846,'Добавление, редактирование и удаление RSS-лент','ru',0,0),(2847,'Администраторы сайта могут добавлять, редактировать и удалять ленты, а также настраивать интервал их обновления на <a href=\"@feededit\">странице лент</a>.','ru',0,0),(2848,'Интеграция OPML','ru',0,0),(2849,'Модулем генерируется <a href=\"@aggregator-opml\">OPML-файл</a> лент. Кроме этого, ленты могут быть и <a href=\"@import-opml\">импортированы</a> из OPML-файла.','ru',0,0),(2850,'Настройка <em>cron</em>','ru',0,0),(2851,'При настройке интервала обновления лент учитывайте, что обновление лент происходит при <a href=\"@cron\">запуске cron</a>. Таким образом, чтобы лента обновлялась с заданным интервалом, запуск <em>cron</em> должен выполняться с такой же периодичность или чаще.','ru',0,0),(2852,'<acronym title=\"Outline Processor Markup Language\">OPML</acronym> - это формат XML, применяемый для обмена множеством RSS-лент между агрегаторами. Один OPML документ может содержать коллекцию из нескольких RSS-лент. Друпал способен анализировать и импортировать все RSS-ленты сразу, экономя ваши усилия по добавлению их вручную. Вы можете как загрузить файл со своего компьютера так и указать ссылку, по которой Друпал сможет скачать его.','ru',0,0),(2853,'Управление новостными лентами','ru',0,0),(2854,'Просмотр новостных лент','ru',0,0),(2855,'Настройка поведения сборщика лент, включая отбор элементов и представление категорий лент и их элементов.','ru',0,0),(2856,'Введите название блока. Для отключения вывода названия, используйте запись <em>!placeholder</em>. Если нужно использовать стандартное название, то оставьте это поле незаполненным.','ru',0,0),(2857,'Укажите в каких темах и регионах должен отображаться этот блок.','ru',0,0),(2858,'Все страницы, кроме перечисленных','ru',0,0),(2859,'Только на перечисленных страницах','ru',0,0),(2860,'Вводите путь к каждой странице в отдельной строке. При указании пути можно использовать маску *. Например, если ввести <em>blog</em>, то действие будет распространяться только на страницу блогов, если ввести <em>blog/*</em>, то действие будет распространяться на все страницы имеющие в пути слово <em>blog</em> (страница блогов и все записи в персональных блогах). Для указания первой страницы, используйте запись %front.','ru',0,0),(2861,'Если введённый PHP-код возвращает значение <code>TRUE</code>','ru',0,0),(2862,'Страницы или PHP код','ru',0,0),(2863,'Если выбран пункт «Если введённый PHP-код возвращает значение <code>TRUE</code>», то будет выполнен код, заключённый в теги %php. Отметьте: выполнение неверного PHP-кода может повредить сайт.','ru',0,0),(2864,'Настраиваемый по пользователям','ru',0,0),(2865,'Блок виден, но его можно скрыть','ru',0,0),(2866,'Блок скрыт, но его можно сделать видимым','ru',0,0),(2867,'Удостоверьтесь, что каждый блок имеет уникальное описание.','ru',0,0),(2868,'Модуль <em>Block</em> позволяет выводить блоки информации, которые могут размещаться в заданных регионах темы, на страницах, для ролей и имеют другие параметры. Количество регионов, доступных для размещения блоков, зависят от используемой вами темы.  Стандартная тема Seven, например, содержит четыре региона («Документ», «Справка», «Содержание панели» и «Меню панели»), в каждом из которых <a href=\"@blocks\">можно разместить</a> любой блок. Блоки могут формироваться модулями (например, блок «Новое на форумах» формируется модулем Forum) или добавляться самостоятельно.','ru',0,0),(2869,'Позиционирование содержания','ru',0,0),(2870,'При работе с блоками помните, что не все темы имеют одинаковые регионы и выводят их с одинаковыми параметрами. Поэтому, размещение блоков выполняется отдельно для каждой темы. Пользователи с правом «Управление блоками» могут выключать блоки. Выключенные блоки находятся на <a href=\"@blocks\">странице блоков</a>, но не размещены ни в одном из регионов, которые показываются пользователям.','ru',0,0),(2871,'Управление видимостью','ru',0,0),(2872,'Блоки могут показываться только на определённых страницах, только пользователям определённых ролей, если открыт документ <a href=\"@content-type\">определённого типа</a> и в зависимости от других параметров. Администраторы могут разрешить или запретить пользователям, самостоятельно определять вывод блоков в своих аккаунтах.','ru',0,0),(2873,'Добавление блоков','ru',0,0),(2874,'Пользователи с правом «Управление блоками» <a href=\"@block-add\">могут добавлять</a> на сайт новые блоки, которые будут появляться на <a href=\"@blocks\">странице блоков</a>, с которой их можно разместить в каком-либо регионе.','ru',0,0),(2875,'На данной странице с помощью интерфейса перетаскивания можно расставить блоки по областям и настроить порядок их следования в областях. Так как не все темы имеют одинаковые области и вывод этих областей отличается, то размещение блоков зависит от темы. Помните, что изменения не будут записаны, пока вы не нажмёте кнопку <em>Сохранить блоки</em> внизу страницы. Для настройки заголовка блока и параметров видимости, перейдите по ссылке  <em>настроить</em> рядом с блоком в списке.','ru',0,0),(2876,'Просмотр регионов: @theme','ru',0,0),(2877,'Управление блоками','ru',0,0),(2878,'Описание блока показывается на <a href=\"@overview\">странице блоков</a>.','ru',0,0),(2879,'Персонализировать блоки','ru',0,0),(2880,'Блоки состоят из материалов или информации, которая дополняют основной материал страницы. Вы можете включать или выключать дополнительные блоки с помощью флажков.','ru',0,0),(2881,'Кэширование блоков','ru',0,0),(2882,'Кэширование блоков неактивно потому, что вы включили модули, которые контролируют доступ к материалу.','ru',0,0),(2883,'Вывод содержания в регионах.','ru',0,0),(2884,'Используется для мультиблогового сервиса. Каждый пользователь получает персональный блог.','ru',0,0),(2885,'Персональные блоги','ru',0,0),(2886,'В записи блога каждого пользователя автоматически отображается ссылка на главную страницу блога пользователя. На сайте может создаваться столько блогов, как будто у вас сервис по созданию личных блогов.','ru',0,0),(2887,'Мультиблоговый сервис','ru',0,0),(2888,'Записи из каждого персонального блога собираются в один центральный мультиблог, где показывается содержание всех блогов в одном списоке.','ru',0,0),(2889,'В меню навигации существует (настраиваемый по желанию) пункт меню <em>Блоги</em>, который отображает содержание всех блогов доступных на вашем сайте и пункт меню <em>Мой блог</em> показывающий записи блога текущего пользователя.','ru',0,0),(2890,'Модуль Blog создаёт по умолчанию блок <em>Последние записи блога</em> который может быть включён на <a href=\"@blocks\">странице администрирования блоков</a>.','ru',0,0),(2891,'Добавить запись в блог','ru',0,0),(2892,'Включает мультиблоговый сервис','ru',0,0),(2893,'Книг нет.','ru',0,0),(2894,'Оглавление книги','ru',0,0),(2895,'<strong>Оглавление книги:</strong> типы документов, страницы которых можно включать в оглавление книг. Пользователи с правом «%outline-perm permission» могут включать в оглавление документы всех типов. <strong>Вложенные страницы:</strong> тип документов, страницы которого будут использовать при создании новой страницы книги по умолчанию.','ru',0,0),(2896,'Управление оглавлением книг','ru',0,0),(2897,'Книги являются удобным способом организации документации, справочников или сборников ответов на вопросы. На страницах, которые включены в книгу, показывается дополнительные элементы навигации: ссылки для перехода на предыдущую и следующую страницы и ссылка, для перехода к той главе, в которую входит текущая страница.','ru',0,0),(2898,'Управление книгами','ru',0,0),(2899,'Для книг можно отдельно назначить права для создания, правки и удаления страниц; создания документов в книгах и создание новых книг. Пользователи с правом «Управление оглавлением книг» могут добавлять в книги документы всех типов. Они также могут просматривать список всех книг, править и переупорядочивать страницы в книгах на <a href=\"@admin-book\">странице книг</a>.','ru',0,0),(2900,'Кроме дополнительных элементов, которые показываются в документе, который входит в книгу, модуль генерирует блок со специфическими для книг ссылками, который <a href=\'@admin-block\'>можно разместить</a> в регионе темы и настроить параметры его вывода. Для того, чтобы на страницах показывалась книжная навигация, они должны быть включены в оглавление книги.','ru',0,0),(2901,'Книги могут редактироваться совместно, так как они позволяют пользователям с соответствующими правами создавать в книге новые страницы и включать в оглавление книги любые страницы сайта.','ru',0,0),(2902,'Печать подшивки','ru',0,0),(2903,'Пользователи с правом «Просмотр версии для печати» будут видеть на страницах книги ссылку для перехода к просмотру такой версии.','ru',0,0),(2904,'Книги являются удобным способом организации документации, справочников или сборников ответов на вопросы. На страницах, которые включены в книгу, показывается дополнительные элементы навигации: ссылки для перехода на предыдущую и следующую страницы и ссылка, для перехода к той главе, в которую входит текущая страница.','ru',0,0),(2905,'Оглавление позволяет включать материалы в <a href=\"@book\">иерархию сборника</a>, а также перемещать их внутри нее или <a href=\"@book-admin\">переупорядочить книгу целиком</a>.','ru',0,0),(2906,'Создать подшивку','ru',0,0),(2907,'Добавить контент и дочерние страницы к подшивке','ru',0,0),(2908,'Просмотр версии для печати','ru',0,0),(2909,'Просмотр всех страниц книги в одной странице браузера. Такой просмотр удобен для вывода книги на печать, но если в книге много страниц и мультимедиа данных, то открытие всех страниц может занять продолжительное время.','ru',0,0),(2910,'<em>Книги</em> имеют встроенную иерархическую навигацию. Используются для справочников и руководств.','ru',0,0),(2911,'Позволяет пользователям создавать и организовывать связанные материалы в подшивки.','ru',0,0),(2912,'Модуль Color позволяет пользователям с правом <em>Управление конфигурацией сайта</em> легко и быстро изменять цветовые схемы совместимых с этим модулем оформлений. Для получения дополнительной информации смотрите онлайн справку <a href=\"@color\">по модулю Color</a>.','ru',0,0),(2913,'Изменение цветов','ru',0,0),(2914,'Использование модуля позволяет изменить цвет ссылок, фона, шрифта и других элементов темы, изменение которых она поддерживает. Для изменения параметров цвета в совместимой теме, выберите вкладку «Настройка» на <a href=\'@configure\'>странице тем</a>. Если на этой странице нет цветового круга, то значит, тема не поддерживает смену цветовой схемы. <a href=\'@troubleshoot\'>Список причин</a> по которым ещё может быть недоступен цветовой круг.','ru',0,0),(2915,'Модуль Color сохраняет изменённую копию файла стилей темы в системной папке и в дальнейшем для стилевого оформления сайта используется именно эта копия. Это означает, что если вы внесёте изменения в файл стилей темы, то вам будет нужно сохранить цветовую схему заново, чтобы модуль перезаписал копию файла в системной папке.','ru',0,0),(2916,'Библиотека GD для PHP включена, но скомпилирована без поддержки PNG. Посмотрите <a href=\"@url\">документацию PHP image </a> , чтобы узнать, как это исправить.','ru',0,0),(2917,'Библиотека PHP GD не включена или её версия устарела. Информацию об этой библиотеке можно найти на странице