ntact позволяет посетителям сайта отправлять сообщения администрации, пользуясь контактной формой сайта, или другим пользователям, пользуясь персональными контактными формами пользователей. Форма отправки сообщения содержит поля для ввода заголовка, содержания и отметку для отправки копии на свой почтовый ящик. Для дополнительной информации смотрите онлайн руководство по <a href=\"@contact\">Contact модулю</a>.','ru',0,0),(2961,'Персональные контактные формы','ru',0,0),(2962,'Пользователи могут связываться с другими пользователями пользуясь своими персональными контактными формами, что позволяет скрывать почтовые адреса пользователей. Пользователи могут самостоятельно включать или выключать свои персональные контактные формы на странице правки аккаунта. Если контактная форма включена, то на страницу профиля пользователя добавляется вкладка «Контакт», которая показывается пользователям с соответствующими правами. Администраторы сайта могут пользоваться персональной контактной формой пользователя вне зависимости от того, включил её пользователь или нет. При просмотре своего профиля, вкладка «Контакт» не показывается.','ru',0,0),(2963,'Контактная форма сайта','ru',0,0),(2964,'Страница с контактной формой сайта доступна пользователям с правом «Доступ к контактной форме сайта» и позволяет отправлять администрации комментарии, отзывы и любые другие сообщения. Для направления сообщений определённого характера на определённые почтовые адреса, для контактной формы могут быть добавлены категории и определены получатели писем для каждой из категорий. Обычными категориями для бизнес-сайта, например, являются «Отзыв о сайте» (сообщения отправляются администрации сайта) и «Информация о товаре» (сообщения отправляются сотрудникам отдела продаж). Почтовые адреса определённые для каждой категории публично не показываются.','ru',0,0),(2965,'Когда контактная форма включена, для неё создаётся ссылка в меню навигации, но по умолчанию, она является включенной. Если вы хотите показывать эту ссылку на сайте и изменить её размещение, то это можно сделать на <a href=\'@menu\'>странице меню</a>.','ru',0,0),(2966,'Настройка','ru',0,0),(2967,'Для вывода дополнительной информации на странице с контактной формой, добавьте новый блок (ссылка «Добавить блок» на <a href=\"@blocks\">странице блоков</a>), настройте параметры его вывода и разместите в нужном регионе.','ru',0,0),(2968,'Поле выбора категорий показывается на странице <a href=\"@form\">контактной формы</a> сайта (если категорий несколько). Добавить категорию можно на этой странице, воспользовавшись ссылкой «Добавить категорию».','ru',0,0),(2969,'В меню навигации <a href=\"@menu-settings\">можно включить</a> пункт «Контакт» (по умолчанию выключен). На странице параметров этого пункта можно определить меню, в котором он должен выводиться и его положение относительно других ссылок этого меню.','ru',0,0),(2970,'Для вывода дополнительной информации на странице с контактной формой, добавьте новый блок (ссылка «Добавить блок» на <a href=\"@blocks\">странице блоков</a>), настройте параметры его вывода и разместите в нужном регионе.','ru',0,0),(2971,'Управление контактными формами и их настройка','ru',0,0),(2972,'Доступ к контактной форме сайта','ru',0,0),(2973,'Использование персональных контактных форм пользователей','ru',0,0),(2974,'!sender-name (!sender-url) отправлено сообщение с использованием контактной формы в !form-url.','ru',0,0),(2975,'[!site-name] !subject','ru',0,0),(2976,'!sender-name (!sender-url) отправил вам сообщение через контактную форму (!form-url) с !site-name.','ru',0,0),(2977,'Если вы не хотите получать такие сообщения по электронной почте, то можете изменить настройки в !recipient-edit-url.','ru',0,0),(2978,'Персональная <a href=\"@url\">контактная форма</a> позволяет другим пользователям отправлять вам письма, при этом сохраняя ваш почтовый адрес скрытым. Отметьте, что администраторы сайта всегда смогут связаться с вами, даже если вы отключите свою контактную форму.','ru',0,0),(2979,'Автоматически включать персональную контактную форму при регистрации','ru',0,0),(2980,'Изменение этой настройки не коснется существующих пользователей.','ru',0,0),(2981,'Модуль Contextual links позволяет показывать контекстные ссылки связанные с регионами, блоками и документами пользователям с правом «Использование контекстных ссылок».  Для получения дополнительной информации смотрите онлайн руководство по модулю <a href=\"@contextual\">Contextual links</a>','ru',0,0),(2982,'Отображение контекстных ссылок','ru',0,0),(2983,'Контекстные ссылки реализуются модулями и предоставляют быстрый доступ к задачам, связанным с объектом, к которому они показываются. Например, если у вас есть добавленный в регион блок меню, то с этим блоком связаны модули Blocks и Menus, и для блока будут доступны ссылки для перехода к списку ссылок этого меню, перехода к правке ссылок этого меню и настройке параметров блока. Модуль Contextual links собирает эти ссылки в список, вывод которого зависит от используемой вами темы, и также добавляет JavaScript, который позволяет изначально скрывать эти ссылки и показывать их только при наведении мышки на объект, к которому они относятся.','ru',0,0),(2984,'Использование контекстных ссылок','ru',0,0),(2985,'Используйте контекстные ссылки для выполнения действий, связанных с элементами страницы.','ru',0,0),(2986,'Контекстные ссылки','ru',0,0),(2987,'Используйте контекстные ссылки для выполнения действий, связанных с элементами страницы.','ru',0,0),(2988,'Отслеживание активности пользователей','ru',0,0),(2989,'Включив блоки «Новые пользователи» и «Сейчас на сайте», администраторы могут отслеживать регистрации на сайте новых пользователей и видеть пользователей, которые в данное время находятся на сайте.','ru',0,0),(2990,'Отслеживание содержания','ru',0,0),(2991,'Включив блоки «Новое в блогах», «Новое на форуме» и «Последние комментарии», администраторы могут отслеживать новое содержание.','ru',0,0),(2992,'Просмотр административной панели управления','ru