3090,'Хранилище','ru',0,0),(3091,'Выберите хранилище для загружаемых через это поле файлов. Параметр «Секретные файлы» позволит ограничивать доступ к файлам, которые загружены через это поле.','ru',0,0),(3092,'Необязательная подпапка внутри папки для загрузок, которая будет создана для хранения файлов этого поля. Не используйте слеш в начале и конце пути.','ru',0,0),(3093,'Максимальный размер файла. Введите значение подобным образом: «512» (понимается как байты), «80 KB» (килобайты), «50 MB» (мегабайты). Если ограничение вводить не нужно, то оставьте это поле незаполненным. В этом случае максимальный размер файла будет определяться параметрами PHP (текущее ограничение: <strong>%limit</strong>).','ru',0,0),(3094,'Включить поле «Описание»','ru',0,0),(3095,'Это поле позволяет ввести описание для прикрепляемого файла.','ru',0,0),(3096,'Параметр \"!name\" должен содержать правильное значение. Вы можете оставить поле пустым или ввести строку, например \"512\" (байт), \"80 KB\" (килобайт) или \"50 MB\" (мегабайт).','ru',0,0),(3097,'Список допустимых расширений не верен. Удостоверьтесь что в списке нет ведущей точки у каждого расширения и что расширения разделены запятыми или пробелами','ru',0,0),(3098,'Общий файл','ru',0,0),(3099,'Таблица файлов','ru',0,0),(3100,'Добавить новый файл','ru',0,0),(3101,'Включить файл в отображение','ru',0,0),(3102,'Описание может использоваться как текст ссылки на файл.','ru',0,0),(3103,'Максимальный размер файла: !size.','ru',0,0),(3104,'Разрешённые типы файлов: !extensions.','ru',0,0),(3105,'Рисунки должны быть точно !size пикселя(ей)','ru',0,0),(3106,'Размер изображений должен быть между !min и !max пикселами.','ru',0,0),(3107,'Изображение должно быть больше !min пикселей.','ru',0,0),(3108,'Изображение должно быть меньше !max пикселей.','ru',0,0),(3109,'Модуль File определяет тип поля «файл» для модуля <a href=\"@field-help\">Field</a>, который позволяет управлять и проверять загружаемые файлы прикрепляемые к содержанию сайта.','ru',0,0),(3110,'Прикрепление файлов','ru',0,0),(3111,'Модуль File позволяет прикреплять файлы (PDF, документы и т.д.) к содержанию, после того, как поле «Файл» добавлено к типу содержания используя модуль <a href=\"@fieldui-help\">Field UI</a>. К этому полю можно добавить различные проверки прикрепляемых файлов, например, ограничить максимальный размер файла или разрешённые расширения файлов (типы файлов).','ru',0,0),(3112,'Показ прикреплённых файлов','ru',0,0),(3113,'Когда файл прикрепляется к содержанию, можно определить, будет показываться таблица, которая показывает информацию о прикреплении или нет. Прикреплённые файлы по умолчанию показываются в отдельной таблице под содержанием. Если прикрепление не показывается, то этот файл всё равно доступен для вставки в содержание.','ru',0,0),(3114,'Хранение файлов','ru',0,0),(3115,'При создании поля типа «Файл», нужно определить папку, в которой будут храниться файлы. Папка может быть <em>открытой</em> или <em>закрытой</em>. Доступом к файлам в открытых папках управляет веб-сервер и любой, кто знает адрес файла может получить к нему доступ. Доступом к файлам в закрытых папках управляет Drupal. К этим файлам можно определить права доступа пользователей при их прикреплении к документу. Закрытый способ хранения увеличивает нагрузку на сервер и время скачивания, так как Drupal должен обрабатывать каждый запрос такого файла.','ru',0,0),(3116,'Произошла неустранимая ошибка. Попробуйте перезагрузить форму и отправить заново.','ru',0,0),(3117,'Файл, ссылающийся на поле !name, не существует.','ru',0,0),(3118,'Файл в поле !name не был загружен.','ru',0,0),(3119,'Директория загрузки %directory для поля файла !name не может быть создано или недоступно. Поэтому недавно загруженные файлы не могут быть сохранены в этой директории, и загрузка отменена.','ru',0,0),(3120,'Сервер не может показывать процесс загрузки файлов. Показ загрузки файлов требует, чтобы PHP был запущен с <em>mod_php</em>.','ru',0,0),(3121,'Все роли могут использовать этот формат','ru',0,0),(3122,'Порядок форматов текста был сохранён.','ru',0,0),(3123,'Добавить формат текста','ru',0,0),(3124,'Этот формат может использоваться всеми ролями и это не может быть изменено.','ru',0,0),(3125,'Порядок фильтров','ru',0,0),(3126,'Имена текстовых форматов должны быть уникальны. Формат с именем %name уже существует.','ru',0,0),(3127,'Добавлен текстовый формат %format.','ru',0,0),(3128,'Текстовый формат %format был обновлён.','ru',0,0),(3129,'Форматы текста','ru',0,0),(3130,'Модуль Filter позволяет администраторам настраивать различные форматы ввода. Формат ввода определяет разрешённые в содержании HTML-теги, правила обработки введённых данных и другие параметры, которые зависят от использующихся в этом формате фильтров. Подробную информацию смотрите на странице <a href=\"@filter\">модуля Filter</a>.','ru',0,0),(3131,'Применение фильтров к тексту','ru',0,0),(3132,'Каждый формат ввода использует фильтры для обработки введённого содержания, а большинство форматов применяют сразу несколько фильтров в определённом порядке. Каждый фильтр разработан для определённых целей, в основном для добавления, удаления или изменения элементов в введённом пользователем содержании перед тем, как это содержание будет показано на сайте. Фильтры не изменяют введённое содержание, всё введённое пользователем содержание записывается в базу данных, фильтры лишь обрабатывают это содержание перед его выводом. Один фильтр может удалять перед выводом неразрешённые HTML-теги, а другой фильтр может автоматически добавлять HTML для того, чтобы введённый URL стал ссылкой, на которую можно нажать мышкой.','ru',0,0),(3133,'Определение форматов текста','ru',0,0),(3134,'Один формат является системным и не может быть удалён. Это формат «Plain text» (который удаляет все HTML-теги). Дополнительные форматы могут создаваться профилями установок при установке системы или создаваться администраторами сайта со <a href=\"@text-formats\">страницы форматов</a>.','ru',0,0),(3135,'Выбор формата текста','ru',0,0),(3136,'Форматы ввода содержат фильтры, которые изменяют данные введённые пользователем, например вырезают неразрешённые HTML-теги или делают URL ссылками, чтобы на них можно было нажать мышкой. Фильтры применяются сверху вниз и их порядок очень важен, так как к следующему фильтру данные приходят уже изменённые предыдущим фильтром. Например, когда фильтр преобразовывающий URL в ссылки применяется до фильтра удаляющего неразрешённые HTML-теги, то все ссылки могут быть удалены. Если содержание выводится не в том виде, в котором вы ожидаете его увидеть, то подумайте о переупорядочивании фильтров.','ru',0,0),(3137,'Предупреждение: в зависимости от включенных в этом формате фильтров, это право может влиять на безопасность сайта.','ru',0,0),(3138,'Использование текстового формата !text_format','ru',0,0),(3139,'Более подробная информация о текстовых форматах','ru',0,0),(3140,'Пропускать указанные ниже HTML-теги','ru',0,0),(3141,'Заменять переводы строк соответствующими HTML-тегами (т.е. <code>&lt;br&gt;</code> и <code>&lt;p&gt;</code>)','ru',0,0),(3142,'Преобразовывать адреса в ссылки','ru',0,0),(3143,'Исправлять неправильный и обрезанный HTML','ru',0,0),(3144,'Показывать любой HTML как обычный текст','ru',0,0),(3145,'Список доступных HTML-тегов. Атрибуты событий JavaScript, URL JavaScript и CSS всегда удаляются.','ru',0,0),(3146,'Показывать справку по разрешённым HTML-тегам','ru',0,0),(3147,'Добавить всем ссылкам атрибут «rel=\"nofollow\"»','ru',0,0),(3148,'Этот сайт поддерживает HTML. В то время как полное изучение HTML может быть весьма непростым, изучение небольшого числа основных тегов HTML не составит сложности. Эта таблица иллюстрирует примеры использования каждого тега на этом сайте.','ru',0,0),(3149,'Для более подробной информации обратитесь к <a href=\"@html-specifications\">спецификациям HTML</a> W3C или найдете в любимом поисковике другие сайты, обучающие HTML.','ru',0,0),(3150,'Большинство малоиспользуемых символов могут быть введены безо всяких проблем.','ru',0,0),(3151,'Если проблемы всё же возникают, попробуйте использовать сущности HTML. Типичный пример выглядит так: &amp;amp; для символа амперсанда &amp;. Полный список сущностей HTML смотрите на <a href=\"@html-entities\">соответствующей странице спецификации HTML</a>. Некоторые из доступных символов:','ru',0,0),(3152,'HTML-теги не обрабатываются и показываются как обычный текст','ru',0,0),(3153,'Фильтры содержимого в рамках подготовки к отображению.','ru',0,0),(3154,'@time назад <br /> !author','ru',0,0),(3155,'Форум %term и все под форумы были удалены.','ru',0,0),(3156,'Количество комментариев в одной теме для того, чтобы она считалась «горячей».','ru',0,0),(3157,'Нет доступных контейнеров или форумов. <a href=\"@container\">Добавить контейнер</a> или <a href=\"@forum\">Добавить форум</a>.','ru',0,0),(3158,'форум: удален %term и все связанные подфорумы.','ru',0,0),(3159,'Модуль Forum позволяет создать на сайте форум и вести на нём обсуждения различных вопросов. Форумы полезны тем, что они позволяют участникам сообщества обсуждать различные темы с другими участниками и использовать эти беседы в дальнейшем для ссылок на них. Форумы могут иметь вложенную иерархию, позволяя группировать обсуждения по темам. Иерархия форума состоит из:','ru',0,0),(3160,'Контейнеров (например, «Поддержка»), которые могут содержать:','ru',0,0),(3161,'Форумы (например, «Установка Друпала»), которые могут содержать:','ru',0,0),(3162,'Обсуждения (например, «Как сделать мультисайтинг?»), которые могут содержать:','ru',0,0),(3163,'Комментарии (например, «Значит так...»).','ru',0,0),(3164,'Структура форума','ru',0,0),(3165,'<a href=\"@forums\">Страница форумов</a> позволяет добавлять контейнеры, форумы и формировать из них структуру. Также на этой странице можно настроить параметры обсуждений, чтобы они считались горячими.','ru',0,0),(3166,'Начало обсуждения','ru',0,0),(3167,'<a href=\"@create-topic\">Добавление обсуждения</a> добавит на выбранный форум новый документ.','ru',0,0),(3168,'При включении, модуль добавляет свою ссылку в меню навигации, которая ведёт на общую <a href=\"@forums\">страницу форумов</a> сайта (если их несколько).','ru',0,0),(3169,'Перемещение тем форума','ru',0,0),(3170,'Обсуждение и все его комментарии могут быть перемещены между форумами, если перейти к правке этого обсуждения и выбрать другой форум. При перемещении обсуждения между форумами, на старом форуме может быть оставлена <em>теневая копия</em>, которая будет указывать на новое размещение обсуждаемой темы.','ru',0,0),(3171,'Закрытие обсуждений','ru',0,0),(3172,'Выбор пункта <em>Closed</em> под <em>Comment settings</em> на странице правке обсуждения приведёт к невозможности добавления новых комментариев. Выбор пункта <em>Hidden</em> приведёт к невозможности добавления новых комментариев, но при этом будут скрыты и уже добавленные комментарии.','ru',0,0),(3173,'Форумы содержат обсуждения. Для группировки форумов можно использовать контейнеры.','ru',0,0),(3174,'Контейнеры используются для группировки форумов.','ru',0,0),(3175,'Форумы используются для группировки обсуждений.','ru',0,0),(3176,'Для обсуждений ведущихся на форумах можно определить количество комментариев к обсуждения, после которого тема будет считаться «горячей», максимальное количество тем выводящихся на одной странице форума и сортировку комментариев.','ru',0,0),(3177,'Создать @node_type','ru',0,0),(3178,'<a href=\"@login\">Войдите</a>, чтобы оставлять новые сообщения на форуме.','ru',0,0),(3179,'Для сохранения документа необходимо выбрать форум. Пункт «%forum» является контейнером для форумов, а не форумом.','ru',0,0),(3180,'Обсуждение — это документ, который будет добавлен на форум. При добавлении этого документа необходимо выбрать форум, который больше всего подходит предлагаемой к обсуждению темы.','ru',0,0),(3181,'Управление параметрами форумов и их иерархией.','ru',0,0),(3182,'Словарь «Форумы» определяет структуру форумов.','ru',0,0),(3183,'Ведение обсуждений.','ru',0,0),(3184,'Выполните следующие шаги для создания и начала работы вашего сайта:','ru',0,0),(3185,'<strong>Приступаем к размещению материала</strong> И наконец, вы можете <a href=\"@content\">добавить новый материал</a> на ваш сайт.','ru',0,0),(3186,'Дополнительную информацию можно найти по ссылкам, перечисленным ниже, либо в онлайновом <a href=\"@handbook\">руководстве по Drupal</a>. Вы можете также написать сообщение на <a href=\"@forum\">форуме оф.сайта Drupal</a> или использовать возможности  <a href=\"@support\">пользовательской поддержки</a> (англ.). \r\n<small>Прим. переводчика: существует <a href=\"http://drupal.ru\">сайт русскоязычного сообщества Drupal</a>. На нем можно получить дополнительную информацию, поддержку пользователей и адреса других русскоязычных ресурсов по Drupal.</small>','ru',0,0),(3187,'Модуль <em>Help</em> позволяет создавать справочные страницы (такие, как эта), а также показывать контекстную справку на страницах управления сайтом. Это краткая версия <a href=\"@handbook\">сетевого руководства</a>, которая включена в систему. Сетевое руководство содержит большее количество справочных страниц, комментарии добавленные пользователями и служит основным местом сбора документации по системе.','ru',0,0),(3188,'Справочные страницы','ru',0,0),(3189,'Для каждого модуля включенного на сайте модуль показывает свою <a href=\"@help\">справочную страницу</a>. Справочные страницы есть для всех стандартных модулей. Многие дополнительные также содержат свои справочные страницы.','ru',0,0),(3190,'Контекстная справка','ru',0,0),(3191,'Модуль может показывать контекстную справку на различных страницах в блоке «Справка системы», который можно выводить в удобном для вас регионе темы.','ru',0,0),(3192,'Редактировать стиль %name','ru',0,0),(3193,'Этот стандартный стиль, который нельзя изменить. Для того, чтобы создать новый стиль на основе этого, нажмите кнопку «Переопределить» внизу страницы.','ru',0,0),(3194,'Название стиля изображения','ru',0,0),(3195,'Это имя используется в адресах генерируемых изображений. Используйте только строчные буквы, цифры, подчёркивание (_) и дефис (-).','ru',0,0),(3196,'Выберите новый эффект','ru',0,0),(3197,'Переопределить','ru',0,0),(3198,'Обновить стиль','ru',0,0),(3199,'Выбрать добавляемый эффект.','ru',0,0),(3200,'Эффект применён.','ru',0,0),(3201,'Стиль %style был перекрыт, что позволит вам изменить его настройки.','ru',0,0),(3202,'Название стиля','ru',0,0),(3203,'Создать новый стиль','ru',0,0),(3204,'Стиль %name был создан.','ru',0,0),(3205,'Название стиля изображения %name уже используется.','ru',0,0),(3206,'Пожалуйста, используйте для названия стилей только строчные буквы, цифры, подчёркивание (_) и дефис (-).','ru',0,0),(3207,'Без замены, только удаление','ru',0,0),(3208,'Стиль замены','ru',0,0),(3209,'Не обязательно: выберите стиль до удаления %style','ru',0,0),(3210,'Если этот стиль используется на сайте, вы можете выбрать другой в качестве замены. Все изображения, созданные предыдущим стилем, будут удалены.','ru',0,0),(3211,'Стиль %name был удален.','ru',0,0),(3212,'Вернуться к стилю %style?','ru',0,0),(3213,'Восстановление этого стиля удалит все сделанные изменения настроек и восстановит предоставленный модулем @module вид по умолчанию.','ru',0,0),(3214,'Редактирование эффекта «%label»','ru',0,0),(3215,'Добавление эффекта «%label»','ru',0,0),(3216,'Обновить эффект','ru',0,0),(3217,'Добавить эффект','ru',0,0),(3218,'Удаление из стиля «%style» эффекта «@effect»','ru',0,0),(3219,'Эффект «%name» удалён.','ru',0,0),(3220,'!name должно быть целым числом.','ru',0,0),(3221,'!name должно быть положительным числом.','ru',0,0),(3222,'!name должно быть в шестнадцатеричном значении цвета.','ru',0,0),(3223,'Ширина и высота должны быть указаны.','ru',0,0),(3224,'Удаляемая при обрезке часть.','ru',0,0),(3225,'Цвет, которым будет закрашена часть четырёхугольника, которая появится в результате поворота исходного изображения. Вводи значение в шестнадцатеричном формате, например, введите «#ffffff», чтобы использовать белый цвет или «#000000», чтобы использовать чёрный цвет.','ru',0,0),(3226,'В данный момент стилей нет. <a href=\"!url\">Добавить новый</a>.','ru',0,0),(3227,'Эффектов нет.','ru',0,0),(3228,'открыть оригинальный размер','ru',0,0),(3229,'Пример исходного изображения','ru',0,0),(3230,'Пример измененного изображения','ru',0,0),(3231,'Изменение размера, делает изображение соответствующим введённым размерам, без соблюдения исходных пропорций. Это может привести к растягиванию или сплющиванию итогового изображения, если пропорции введённых размеров, не будут соответствовать пропорциям исходного изображения.','ru',0,0),(3232,'Масштабирование позволяет изменить размеры изображения с сохранением пропорций. Если введён размер только одной стороны, то размер другой будет вычислен автоматически. Если введены два размера, то каждое будет определять максимальный размер по своему направлению и применяться в зависимости от формата изображения.','ru',0,0),(3233,'Масштабирование и обрезка','ru',0,0),(3234,'«Масштабирование и обрезка» сначала масштабирует изображение, а затем обрезает большее значение. Это наиболее эффективный способ создания миниатюр без искажения пропорций исходного изображения.','ru',0,0),(3235,'Обрезка удаляет часть изображения, чтобы привести его в соответствие с указанными размерами.','ru',0,0),(3236,'Обесцвечивание','ru',0,0),(3237,'Обесцвечивание преобразовывает изображение в оттенки серого.','ru',0,0),(3238,'Вращение поворачивает изображение на заданный угол. Это может привести к изменению пропорций изображения, вследствие необходимости заполнить пространство по диагоналям.','ru',0,0),(3239,'Ошибка при изменении размера изображения с помощью средства %toolkit в %path (%mimetype, %dimensions)','ru',0,0),(3240,'Ошибка при масштабировании изображения с помощью средства %toolkit в %path (%mimetype, %dimensions)','ru',0,0),(3241,'Ошибка при кадрировании изображения с помощью средства %toolkit в %path (%mimetype, %dimensions)','ru',0,0),(3242,'Ошибка при масштабировании и кадрировании изображения с помощью средства %toolkit в %path (%mimetype, %dimensions)','ru',0,0),(3243,'Ошибка при обесцвечивании изображения с помощью средства %toolkit в %path (%mimetype, %dimensions)','ru',0,0),(3244,'Ошибка при вращении изображения с помощью средства %toolkit в %path (%mimetype, %dimensions)','ru',0,0),(3245,'Это поле хранит ID изображения как целочисленное значение.','ru',0,0),(3246,'Если изображение не загружено, то будет отображаться стандартное изображение.','ru',0,0),(3247,'Максимальная ШИРИНАxВЫСОТА (например, 640x480). Если ограничение вводить не нужно, оставьте поле пустым. При загрузке изображения большего размера, оно будет уменьшено до максимально допустимого. Изменение размера изображения приведёт также к потере его <a href=\"http://en.wikipedia.org/wiki/Exchangeable_image_file_format\">EXIF-данных</a>.','ru',0,0),(3248,'Минимальное разрешение изображения','ru',0,0),(3249,'Минимальная ШИРИНАxВЫСОТА (например, 640x480). Если ограничение вводить не нужно, то оставьте поле незаполненным. При загрузке изображения меньшего размера, оно будет отвергнуто.','ru',0,0),(3250,'Показывать поле для ввода атрибута «alt»','ru',0,0),(3251,'Параметр «alt» позволяет ввести для изображения альтернативный текст. Этот текст используется устройствами чтения с экрана, поисковыми системами и показывается браузером вместо изображения в том случае, когда изображение не может быть загружено.','ru',0,0),(3252,'Показывать поле для ввода атрибута «title»','ru',0,0),(3253,'Параметр <em>title</em> устанавливает альтернативный текст в виде подсказки, появляющейся при наведении курсора мыши на изображение.','ru',0,0),(3254,'Высота и ширина должны быть числовыми значениями.','ru',0,0),(3255,'В поле !name должны быть указаны обе величины: высота и ширина.','ru',0,0),(3256,'Стиль изображения при предпросмотре','ru',0,0),(3257,'нет предпросмотра','ru',0,0),(3258,'Выберите стиль, который будет использоваться для изображения при редактировании документа.','ru',0,0),(3259,'Модуль Image позволяет обрабатывать изображения и добавляет поле <em>Изображение</em> для изображений в содержание. Он использует параметры определённые на страницах <em>Обработка изображений</em> и <em>Стили изображений</em>, с помощью которых можно изменять размер и параметры вывода. Для получения дополнительной информации смотрите онлайн справку по <a href=\"@image\">Image модулю</a>.','ru',0,0),(3260,'Обработка изображений','ru',0,0),(3261,'С помощью модуля Image можно изменять размер, обрезать, масштабировать, обесцвечивать и вращать изображения без потери оригинального изображения и используя <a href=\"@image\">стили изображений</a>. Когда изменяется стиль изображения, модуль автоматически обновляет все изображения использующие этот стиль. Каждый стиль изображения должен иметь название, которое используется для создания URL папки, в которой будут храниться изображения обработанные с помощью этого стиля. Есть два основных подходя для именования стилей изображений (которые зависят от того, для чего применяются стили):','ru',0,0),(3262,'На основе характера использования: например, <em>profile-picture</em>','ru',0,0),(3263,'На основе выполняемого действия: например, <em>square-85x85</em>','ru',0,0),(3264,'Прикрепление изображений','ru',0,0),(3265,'Модуль Image также позволяет прикреплять изображения к содержанию как поля. Для добавления поля изображений <a href=\'@content-type\'>типу документов</a>, перейдите на вкладку «Поля» в этом типе документов и добавьте новое поле типа «Изображение». Прикрепление изображений к документам таким путём, позволит применять к ним стили и также предоставляет большую гибкость, чем темизация.','ru',0,0),(3266,'Стили изображений обычно используются для указания размера изображения, который должен использоваться в кратком содержании документа и размера изображения, который должен использоваться в полном содержании документа. Кроме этого, стили изображений можно использовать и вместе с любыми другими доступными эффектами. Когда к изображению применяется какой-либо стиль, то для этого изображения создаётся новая копия, а оригинальный файл никогда не изменяется, что позволяет в дальнейшем изменить стиль, после чего все изображения будут обновлены из оригинального файла, в соответствии с новыми условиями.','ru',0,0),(3267,'Управление стилями изображений','ru',0,0),(3268,'Создание и изменение стилей, которые отвечают за генерацию разных версий изображений, например таких как миниатюры.','ru',0,0),(3269,'Нет заданных стилей','ru',0,0),(3270,'Генерация изображения. Попробуйте вскоре.','ru',0,0),(3271,'Ошибка генерации изображения.','ru',0,0),(3272,'Невозможно создать заданное изображение в %path.','ru',0,0),(3273,'Не удалось создать каталог стилей: %directory','ru',0,0),(3274,'Кэшированный файл %destination уже существует. Возможно, проблемы с настройками перезаписи.','ru',0,0),(3275,'Создать стиль изображения','ru',0,0),(3276,'Стили изображения','ru',0,0),(3277,'Управление стилями, которые используются для изменения размеров изображений и других различных эффектов.','ru',0,0),(3278,'Список текущих стилей изображения на сайте.','ru',0,0),(3279,'Добавить стиль','ru',0,0),(3280,'Добавление стиля.','ru',0,0),(3281,'Настроить стиль изображения.','ru',0,0),(3282,'Удалить стиль изображения','ru',0,0),(3283,'Вернуть прежный стиль','ru',0,0),(3284,'Вернуть прежный стиль изображения.','ru',0,0),(3285,'Редактировать эффект изображения','ru',0,0),(3286,'Убрать эффект изображения','ru',0,0),(3287,'Добавить эффект изображения','ru',0,0),(3288,'Добавление эффекта стилю.','ru',0,0),(3289,'Инструменты для обработки изображений.','ru',0,0),(3290,'Выберите язык в раскрывающемся списке и нажмите кнопку «Добавить язык».','ru',0,0),(3291,'Префикс языка','ru',0,0),(3292,'Введённое значение будет использоваться в URL страниц сайта. Обычно, в качестве префикса пути используют код языка или любое другое обозначение, которое будет легко понято пользователями. Например, для русского языка можно ввести «russian». В этом случае URL страницы будет выглядеть как «example.com/russian/...». Отметьте: изменение этого параметра может привести к тому, что существующие ссылки станут ссылаться на несуществующие адреса, так как изменение этого параметра приведёт к изменению URL страницы.','ru',0,0),(3293,'Метод определения','ru',0,0),(3294,'Часть URL','ru',0,0),(3295,'Если используется префикс пути, то для URL вида http://example.com/ru/contact, будет использоваться русский язык. Если используется домен, то для URL вида http://ru.example.com/contact, будет использоваться русский язык. Отметьте: изменение этого параметра может привести к тому, что существующие ссылки станут ссылаться на несуществующие адреса, так как изменение этого параметра приведёт к изменению URL страницы.','ru',0,0),(3296,'Параметр запроса/сессии','ru',0,0),(3297,'Значение параметра запроса/сессии, которое будет использоваться для определения языка.','ru',0,0),(3298,'Фильтр переводимых строк','ru',0,0),(3299,'Тип даты','ru',0,0),(3300,'Вы уверены, что хотите изменить форматы дат %language на глобальные, устанавливаемые по умолчанию?','ru',0,0),(3301,'Сброс параметров удалит все локализованные форматы дат для этого языка. Это действие нельзя отменить.','ru',0,0),(3302,'Модуль Locale позволяет использовать на сайте интерфейс на различных языках, которые отличаются от английского. Модуль работает управляя переводами строк интерфейса в базе данных, проверяя наличие перевода каждой нужной строки перед её выводом на монитор. Если строка с переводом доступна, то она показывается вместо оригинальной строки. Когда строка с переводом недоступна, то показывается оригинальная строка на английском языке, что позволяет избежать отсутствия на сайте каких-либо элементов, если они не переведены. Для дополнительной информации смотрите онлайн справку на странице <a href=\"@locale\">Locale модуля</a>.','ru',0,0),(3303,'Перевод интерфейса','ru',0,0),(3304,'Интерфейс может быть переведён несколькими способами:','ru',0,0),(3305,'Через страницу <a href=\'@translate\'>перевода строк</a>.','ru',0,0),(3306,'Путём импорта готовых переводов, известных как пакет перевода. Пакет перевода содержит файлы с переводами строк в формате Gettext Portable Object (<em>.po</em>) и позволяет показывать интерфейс на выбранном языка. Пакеты перевода существуют для многих языков и версии системы, их можно загрузить с <a href=\"@translations\">сервера переводов</a>.','ru',0,0),(3307,'Если готовый пакет переводов вас не устраивает, вы можете изменить входящие в него файлы в формате Gettext Portable Object (<em>.po</em>) используя специальные программы или создать новые <em>.po</em>-файлы. Модуль позволяет <a href=\'@import\'>импортировать</a> на сайт переводы из <em>.po</em>-файлов, а также <a href=\'@export\'>экспортировать</a> переводы с сайта, которые в дальнейшем можно импортировать на другой сайт или воспользоваться программой для редактирования перевода.','ru',0,0),(3308,'Настройка мультиязычности','ru',0,0),(3309,'Условия определённые для языка позволяют автоматически использовать в адресах страниц сайта нужный язык основываясь на домене или дополнительной части адреса. Пользователи могут выбрать предпочитаемый ими язык в своём аккаунте, а анонимным посетителям сайт может показываться на предпочитаемым ими языке в зависимости от параметров их браузеров. Документы сайта могут быть переведены с использованием модуля <a href=\'@content-help\'>Content translation</a>.','ru',0,0),(3310,'Включение нескольких языков позволит переводить на эти языки интерфейс сайта и содержание документов. Скачать переводы на большинство языков можно с сайта <a href=\"http://drupal.org/project/translations\">drupal.org</a>, переводы на русский язык доступны на сайте <a href=\"http://localize.drupal.org/translate/languages/ru/\">L.D.O</a>.','ru',0,0),(3311,'Добавление языка приведёт к поддержки этого языка сайтом, что позволит перевести на этот язык интерфейс сайта и элементы страниц. Если в секции «Выбрать язык» не содержится нужного языка, то его можно добавить воспользовавшись секцией «Добавить язык». Для добавляемого языка нужно определить различные параметры, будьте особенно внимательны при указании кода языка, так как этот код может использоваться браузерами для определения языка, на котором нужно показывать содержание сайта.','ru',0,0),(3312,'Если используется определение языка на основе запроса/параметра сессии, то запрос URL вида http://example.com?language=ru, приведёт к тому, что будет использовать русский язык (если в качестве префикса пути или домена используется значение «ru»).','ru',0,0),(3313,'Добавление на сайт новых языков и правила работы с языками, выполняется на <a href=\"@languages\">странице языков</a>.','ru',0,0),(3314,'Для любого языка можно импортировать перевод из файла в формате Gettext Portable Object (<em>.po</em>). Этот формат является стандартным и поддерживается всеми программами для локального перевода. Отметьте: импорт файла может занять продолжительное время.','ru',0,0),(3315,'Интерфейс сайта позволяет переводить найденные строки. Отметьте: для перевода большого объёма текста, более удобным будет воспользоваться вкладкой «<a href=\"@export\">Экспорт</a>», чтобы экспортировать найденные строки и воспользоваться локальным редактором. Поиск можно ограничить определённым языком, а также выполнять поиск по уже переведённому или ещё не переведённому тексту.','ru',0,0),(3316,'Управление языками','ru',0,0),(3317,'Перевод интерфейса','ru',0,0),(3318,'Порядок методов определения языка страницы. Если версия страницы на определённом этими методами языке доступна, то она будет показана.','ru',0,0),(3319,'Порядок способов определения языка. Если перевод интерфейса пользователя доступен для найденного языка, он будет показан на этом языке.','ru',0,0),(3320,'Определение языка на основе URL (домена или префикса).','ru',0,0),(3321,'Определение языка на основе параметра запроса/сессии','ru',0,0),(3322,'Следовать языковым предпочтениям пользователя.','ru',0,0),(3323,'Определение языка на основе нас