к для меню основных ссылок','ru',0,0),(3360,'Выберите, что должно отображаться в качестве меню основных ссылок (обычно в верхней части страницы).','ru',0,0),(3361,'Нет меню дополнительных ссылок','ru',0,0),(3362,'Источник для меню дополнительных ссылок','ru',0,0),(3363,'Определите источник для меню дополнительных ссылок. Расширенные настройки позволяют использовать один и тот же источник для обоих меню: меню основных ссылок (используется %main) и меню дополнительных ссылок. Если источник меню имеет 2 уровня вложенности, ссылки верхнего уровня попадут в меню основных ссылок, а их дочерние - в меню дополнительных ссылок.','ru',0,0),(3364,'Удалено пользовательское меню %title и все его ссылки.','ru',0,0),(3365,'Пункт меню %title удалён.','ru',0,0),(3366,'<strong>Предупреждение:</strong> В настоящий момент в %title @count ссылка меню. Она будет удалена (определенные системой элементы будут сброшены).','ru',0,0),(3367,'<strong>Предупреждение:</strong> В настоящий момент в %title @count ссылок меню. Они будут удалены (определенные системой элементы будут сброшены).','ru',3366,1),(3368,'<strong>Предупреждение:</strong> В настоящий момент в %title @count[2] ссылок меню. Они будут удалены (определенные системой элементы будут сброшены).','ru',3367,2),(3369,'Управление меню','ru',0,0),(3370,'Пользователи с правом «Управление меню» могут добавлять, редактировать и удалять меню сайта на <a href=\"@menu\">странице меню</a>. Можно добавить меню, которое будет содержать ссылки для навигации по документам определённой темы, меню содержащее внешние ссылки или комбинировать в одном меню внутренние и внешние ссылки. Можно добавить неограниченное количество дополнительных меню, для каждого из которых будет создан связанные с этим меню блок. Страница со списком ссылок в меню позволяет настраивать отдельные ссылки и управлять общим порядком всех ссылок и упорядочивать ссылки меню в иерархию.','ru',0,0),(3371,'Показ меню','ru',0,0),(3372,'После того, как вы создали меню, необходимо включить и определить положение соответствующего блока на <a href=\"@blocks\">странице управления блоками</a>.','ru',0,0),(3373,'Вы можете включить только что созданный блок этого меню на  <a href=\"@blocks\">странице управления блоками</a>.','ru',0,0),(3374,'Каждое меню имеет соответствующий блок, который настраивается на <a href=\"@blocks\">странице управления блоками</a>.','ru',0,0),(3375,'Управление меню и пунктами меню','ru',0,0),(3376,'Создать ссылку в меню','ru',0,0),(3377,'Ссылки меню с более легким весом \"всплывают\" над ссылками более тяжелыми.','ru',0,0),(3378,'Доступные меню','ru',0,0),(3379,'Доступные меню для расположения ссылок на этот тип содержимого.','ru',0,0),(3380,'Родительский элемент по умолчанию','ru',0,0),(3381,'Выберите элемент меню, который будет родителем для новой ссылки в содержимом формы автора.','ru',0,0),(3382,'Добавление новых меню, правка существующих, переименование и переупорядочивание ссылок меню.','ru',0,0),(3383,'Родитель пункта меню','ru',0,0),(3384,'Редактировать ссылку меню','ru',0,0),(3385,'Сбросить ссылку меню','ru',0,0),(3386,'Удалить ссылку меню','ru',0,0),(3387,'Меню навигации создаётся системой и содержит ссылки, предназначенные пользователям. Ссылки добавляются в меню автоматически некоторыми модулями и показываются при наличии соответствующих прав пользователя.','ru',0,0),(3388,'Меню пользователя содержит ссылки, связанные с учетной записью текущего пользователя, а также ссылку «Выход».','ru',0,0),(3389,'Меню управления содержит ссылки на страницы администрирования сайтом.','ru',0,0),(3390,'Меню основных ссылок показывает главные разделы сайта. Обычно выводятся в виде горизонтальной полосы вверху страницы.','ru',0,0),(3391,'управление отображением','ru',0,0),(3392,'Нет доступных типов материалов. <a href=\"@link\">Добавить тип материалов</a>.','ru',0,0),(3393,'Удобочитаемое название типа материалов. Этот текст будет показан в списке на странице <em>создания материала</em>. Рекомендуется использовать названия, начинающиеся с прописной буквы и состоящие только из букв, цифр и пробелов. Название должно быть уникальным.','ru',0,0),(3394,'Описание документа показывается на странице добавления/правки документа и странице типов документов.','ru',0,0),(3395,'Просмотр перед сохранением','ru',0,0),(3396,'Содержание этого поля будет показываться вверху страницы добавления и редактирования документов этого типа. Вы можете использовать справку для информирования пользователей о правилах добавления документов.','ru',0,0),(3397,'Пользователи с правом <em>Управление материалами</em> могут переопределять эти параметры.','ru',0,0),(3398,'Показывать автора и дату публикации.','ru',0,0),(3399,'Будут показаны имя автора и дата публикации.','ru',0,0),(3400,'Ошибочное машино-читаемое имя. Введите имя, отличное от %invalid.','ru',0,0),(3401,'На сайте имеется @count материал типа %type. Если вы удалите это тип материалов, вы не сможете редактировать материалы типа %type, и они могут некорректно отображаться.','ru',0,0),(3402,'На сайте имеется @count материала типа %type. Если вы удалите это тип материалов, вы не сможете редактировать материалы типа %type, и они могут некорректно отображаться.','ru',3401,1),(3403,'На сайте имеется @count[2] материалов типа %type. Если вы удалите это тип материалов, вы не сможете редактировать материалы типа %type, и они могут некорректно отображаться.','ru',3402,2),(3404,'Опубликовать выбранные материалы','ru',0,0),(3405,'Снять с публикации выбранные материалы','ru',0,0),(3406,'Разместить выбранные материалы на главной','ru',0,0),(3407,'Убрать выбранные материалы с главной страницы','ru',0,0),(3408,'Прикрепить выбранные материалы вверху списков','ru',0,0),(3409,'Отменить прикрепление выбранных материалов вверху списков','ru',0,0),(3410,'Удалить выбранные материалы','ru',0,0),(3411,'Удалено @count сообщений.','ru',0,0),(3412,'Вы уверены, что хотите удалить это?','ru',0,0),(3413,'Вы уверены, что хотите удалить всё это?','ru',3412,1),(3414,'<em>Редактирование </em> @title <em>(@type)</em>','ru',0,0),(3415,'Вы не создали ни одного материала. Откройте <a href=\"@create-content\"> страницу создания материалов</a> чтобы создать новые материалы.','ru',0,0),(3416,'Сообщение лога редакций','ru',0,0),(3417,'Объясняйте вносимые вами изменения. Это поможет другим авторам понять, чем вы руководствовались, внося эти изменения.','ru',0,0),(3418,'Маркеры связанные с отдельными типами материалов или материалами','ru',0,0),(3419,'Уникальный ID элемента содержимого.','ru',0,0),(3420,'Полное содержание материала.','ru',0,0),(3421,'Краткое резюме полного содержания материала.','ru',0,0),(3422,'Права доступа к материалу должны быть переопределены. <a href=\"@node_access_rebuild\">Переопределить права</a>.','ru',0,0),(3423,'Модуль Node управляет созданием, редактированием, удалением, параметрами и выводом материалов сайта. Элементы материала управляются этим модулем и показываются на сайте как страницы, состоящие из заголовка, мета-данных (автор, дата создания, тип материала и т.д.) и дополнительных полей, содержащих текст или другие данные (поля управляются модулем <a href=\"@field\">Field</a>). См. подробности в онлайн-руководстве по модулю <a href=\"@node\">Node </a>.','ru',0,0),(3424,'Создание материалов','ru',0,0),(3425,'Когда добавляется новый документ, то модуль Node записывает основную информацию о документе, включая автора, дату создания и <a href=\"@content-type\">тип документа</a>. Он также управляет параметрами публикации, которые определяют будет или нет документ опубликован, будет ли он выведен на первую страницу сайта и(или) закреплён вверху списков с документами. Параметры, которые будут использоваться по умолчанию, можно настроить отдельно для каждого <a href=\"@content-type\">типа документов</a>.','ru',0,0),(3426,'Создание пользовательских типов материалов','ru',0,0),(3427,'Пользователи с правом «Управление типами материалов» <a href=\"@content-new\">могут добавлять</a> новые типы, удалять и редактировать параметры уже существующих. Добавление новых типов материалов позволяет гибко настроить <a href=\"@field\">поля</a> и различные параметры, которые используются для различного содержания сайта.','ru',0,0),(3428,'Управление материалами','ru',0,0),(3429,'<a href=\"@content\">Страница управления материалами</a> позволяет просматривать имеющиеся на сайте материалы и выполнять с ними групповые операции.','ru',0,0),(3430,'Запись редакций','ru',0,0),(3431,'Модуль Node также позволяет создавать несколько редакций материалов и возвращаться к старым редакциям, используя настройки <em>Информации о редакции</em>.','ru',0,0),(3432,'Права пользователя','ru',0,0),(3433,'Модуль Node создает набор прав, доступных для каждого типа материалов, который можно настроить на <a href=\"@permissions\">странице прав</a> роли.','ru',0,0),(3434,'Каждый тип материалов может иметь свой набор различных полей, параметров и связанных с ними прав.','ru',0,0),(3435,'Материалы могут отображаться различными способами: анонс, полная версия, версия для печати, RSS-лента и т.д. <em>Анонс</em> обычно используется на страницах со списком материалов. <em>Полная версия</em> обычно используется при показе материалов на отдельной странице.','ru',0,0),(3436,'Для типа материалов %type можно настроить, какие поля будут показаны при использовании определённого способа вывода. Кроме того, для каждого способа вывода можно настроить и то, каким образом будет выводится используемое в нём поле.','ru',0,0),(3437,'Версии позволяют отслеживать изменения вносимые в документ.','ru',0,0),(3438,'Содержимое полностью','ru',0,0),(3439,'Результат поиска','ru',0,0),(3440,'Содержимое этой страницы было изменено другим пользователем, или вы уже сохранили изменения, используя эту форму. В результате ваши изменения не могу быть сохранены.','ru',0,0),(3441,'Управление типами материалов','ru',0,0),(3442,'Предупреждение: это право связано с безопасностью сайта. Предоставляйте это право только ролям тех пользователей, которым вы доверяете.','ru',0,0),(3443,'Просмотр опубликов