присутствуют возможности, которые должны обеспечиваться модулями, которые были удалены.','ru',0,0),(3468,'Права доступа к материалам','ru',0,0),(3469,'Права доступа определены @count раз','ru',0,0),(3470,'Права доступа определены @count раза','ru',3469,1),(3471,'Права доступа определены @count[2] раз','ru',3470,2),(3472,'Поиск и управление материалами','ru',0,0),(3473,'Управление типами материалов, в том числе состоянием по умолчанию, выводом на главную страницу, настройками комментариев и т.д.','ru',0,0),(3474,'Редактировать тип материала','ru',0,0),(3475,'Этот сайт поддерживает <a href=\"@openid-net\">OpenID</a>, безопасный способ входа на различные сайты с использованием одного имени пользователя и пароля. OpenID может уменьшить необходимость управления многими именами пользователя и паролями на разных сайтах.','ru',0,0),(3476,'Если у вас уже есть OpenID, введите ниже URL вашего сервера OpenID (например, myusername.openidprovider.com). В следующий раз, когда вы будете входить в систему, вы сможете использовать этот URL вместо обычного имени пользователя и пароля. Вы можете иметь несколько серверов OpenID, если вам так хочется, просто продолжайте добавлять их здесь.','ru',0,0),(3477,'Модуль <em>OpenID</em> позволяет пользователям входить в свои аккаунты используя технологию OpenID. <a href=\"@openid-net\">Технология OpenID</a> является безопасным способом посещения аккаунтов на разных сайтов с использованием одного логина и пароля. Использование на сайте OpenID не требует установки дополнительного программного обеспечения, провайдер OpenID не обменивается паролями с посещаемыми пользователями сайтами. Основное преимущество, которое получает от использования OpenID пользователь является тем, что можно использовать один пароль на любом сайте. Это означает, что пароль можно легко обновить только один раз в центральном месте, вместо обновления многих отдельных паролей на разных сайтах.','ru',0,0),(3478,'Вход по OpenID','ru',0,0),(3479,'Для того, чтобы входить на сайт по OpenID, у пользователя должен быть OpenID-аккаунт у провайдера OpenID. Любой пользователь может указать в своём аккаунте любое количество принадлежащих ему OpenID-аккаунтов и использовать любой из них для входа на сайт. Использование на сайте OpenID позволяет снять барьер для регистрации на сайте и помогает увеличить базу пользователей сайта, при этом предлагая удобные и безопасные возможности для входа в аккаунт. Так как OpenID не гарантирует того, что это не спам-бот, подтверждение почтового адреса по-прежнему необходимо. Для входа в аккаунт нужно использовать OpenID URL, который выглядит как <em>myusername.openidprovider.com</em>. Сайт свяжется с указанным OpenID-сервером и попросит подтвердить его подлинность. Если пользователь сможет войти на указанный OpenID-сервер, то сервер ответит сайту, что подлинность пользователя подтверждена. Если пользователь не сможет войти на указанный OpenID-сервер, то OpenID-сервер попросит пользователя повторно ввести пароль.','ru',0,0),(3480,'После того как вы подтвердили свой адрес электронной почты, вы можете войти с помощью OpenID.','ru',0,0),(3481,'Адрес OpenID-аккаунта введён неверно.','ru',0,0),(3482,'Завершите регистрацию, заполнив форму внизу. Если у вас уже есть учётная запись, можно <a href=\"@login\">войти</a> и добавить ваш OpenID на странице «Моя учётная запись».','ru',0,0),(3483,'Регистрация учетной записи с помощью информации, предоставленной вашим провайдером OpenID, не удалась по причинам, перечисленным ниже. Завершите регистрацию, заполнив форму ниже. Если у вас уже есть учетная запись, вы можете <a href=\"@login\">войти</a>, и добавить свой OpenID на странице «Моя учётная запись»','ru',0,0),(3484,'Модуль Overlay показывает страницы управления в накладываемом поверх страницы слое. Накладываемой слой появляется при нажатии на административную ссылку, вместо открытия новой страницы в браузере. Для наложения слоя используется JavaScript. После выполнения нужных действий сохраните страницу в слое или нажмите кнопку закрытия слоя, в результате этого вы окажетесь на той странице, над которой был наложен слой.','ru',0,0),(3485,'Доступ к управлению сайтом в наложенном слое','ru',0,0),(3486,'Просмотр страниц управления в накладываемом поверх страницы слое.','ru',0,0),(3487,'Вывод интерфейса в накладываемом поверх страницы слое.','ru',0,0),(3488,'Диалог @title','ru',0,0),(3489,'Введите существующий системный адрес, для которого добавляется альтернативный. Примеры: <em>node/1</em>, <em>forum/1</em>, <em>taxonomy/term/1</em>.','ru',0,0),(3490,'Модуль <em>Path</em> позволяет добавить любому системному пути на сайте альтернативный путь. Не следует путать альтернативные адресе с перенаправлениями, которые позволяют добраться до изменённого адреса или заменяют неактивный адрес активным. В дополнение к тому, что альтернативные адреса более читаемы, чем системные, они также позволяют поисковым системам лучше индексировать содержание. Для каждого системного адреса может использоваться неограниченное количество альтернативных адресов. Для автоматизации процесса добавления альтернативных адресов можно поставить модуль <a href=\"@pathauto\">Pathauto</a>.','ru',0,0),(3491,'Создание синонимов','ru',0,0),(3492,'Пользователи с <a href=\"@permissions\">соответствующими правами</a> могут добавлять альтернативные адреса в их секции при редактировании различных страниц сайта. Некоторые примеры альтернативных адресов: ','ru',0,0),(3493,'<em>member/jane-smith</em> имеет альтернативный путь <em>user/123</em>','ru',0,0),(3494,'<em>about-us/team</em> имеет альтернативный путь <em>node/456</em>','ru',0,0),(3495,'Управление синонимами','ru',0,0),(3496,'Модуль Path генерирует страницу со <a href=\"@aliases\">списком альтернативных путей</a>, на которой можно искать и редактировать существующие на сайте альтернативные пути. На этой страницы могут быть добавлены. отредактированы и удалены альтернативные пути.','ru',0,0),(3497,'Альтернативный адрес определяет другой путь, по которому будет доступен существующий системный. Например, для системного пути «node/1» можно добавить альтернативный — «about». У одного системного пути может быть неограниченное количество альтернативных.','ru',0,0),(3498,'Управление синонимами','ru',0,0),(3499,'Создание и редактирование синонимов','ru',0,0),(3500,'Синоним уже используется.','ru',0,0),(3501,'Альтернативный путь, по которому будет доступен этот термин. Используйте относительный путь и не используйте слеш (/) на конце.','ru',0,0),(3502,'Включить исполнение PHP в текстовых полях','ru',0,0),(3503,'PHP filter позволяет пользователям с соответствующими правами включать PHP-код в содержание, который будет выполнен при открытии страницы. Вместе с тем, что это мощная и гибкая возможность, одновременно с этим, эта возможность представляет угрозу безопасности сайта, особенно если ею пользуются неопытные люди. Даже опытные пользователи могут допустить ошибку в PHP-коде, которая может повредить сайт. Поэтому, всегда следует проверять код на тестовом сайте, прежде чем использовать его на рабочем. В сетевом руководстве можно найти <a href=\"@php-snippets\">список сниппетов</a>, которые можно использовать вместе с этим фильтром (но которые также следует предварительно проверить на тестовом сайте).','ru',0,0),(3504,'Определение параметров PHP-кодом','ru',0,0),(3505,'<p>Создайте на сайте собственный блок с названием «Добро пожаловать!» Выберите формат ввода «PHP» (или любой другой, поддерживающий ввод PHP) и добавьте в тело блока:</p>\r\n<pre>\r\nprint t(\'Приветствуем тебя, посетитель! Спасибо за посещение нашего сайта.\');¬\r\n</pre>','ru',0,0),(3506,'<p>Чтобы подставлять имена для зарегистрированных пользователей, замените код на следующий:</p>\r\n<pre>\r\nglobal $user;\r\nif ($user->uid) {\r\n  print t(\'Приветствуем тебя, @name! Спасибо за посещение нашего сайта.\', array(\'@name\' => format_username($user)));\r\n}\r\nelse {\r\n  print t(\'Приветствуем тебя, посетитель! Спасибо за посещение нашего сайта.\');\r\n}\r\n</pre>','ru',0,0),(3507,'Модуль PHP отключен. Любые существующие материалы, использующие фильтр PHP, будут показаны как обычный текст. Это может быть потенциально опасно, если конфиденциальная информация содержится в коде PHP.','ru',0,0),(3508,'Модуль <em>Poll</em> позволяет создавать вопросники и проводить исследования с выводом общего итога голосований. Опросы являются хорошим способом узнать мнения пользователей сайта и получить отзывы. Для дополнительной информации смотрите в онлайновом руководстве статью <a href=\"@poll\">Poll</a>.','ru',0,0),(3509,'Добавление опроса','ru',0,0),(3510,'Пользователи могут добавлять опросы на странице <a href=\"@add-content\">добавления документов</a>. При добавлении опроса нужно ввести заголовок опроса и варианты ответов, для каждого из которых будет подсчитываться количество голосов. Статус (активно или закрыто) и продолжительность (промежуток времени, в течение которого можно выбирать ответы на вопрос) могут быть настроены.','ru',0,0),(3511,'Просмотр опросов','ru',0,0),(3512,'Модуль генерирует страницу со <a href=\"@poll\">списком опросов</a>, которые добавлялись на сайт. В качестве альтернативы можно воспользоваться блоком «Последний опрос» на <a href=\"@blocks\">странице блоков</a>. Для комментирования опроса или просмотра его результатов, нужно зайти непосредственно на страницу этого опроса.','ru',0,0),(3513,'Голосовать','ru',0,0),(3514,'Отмена и изменение своих ответов','ru',0,0),(3515,'Ваш голос был отменен.','ru',0,0),(3516,'Чтобы сделать доступной страницу этого поля по значению, введите заголовок этой страницы. Вместо <code>%value</code> будет использовано соответствующее значение поля. Например, страница «Люди, любимый цвет которых %value». Такие страницы доступны только для публичных полей.','ru',0,0),(3517,'Чтобы сделать доступной страницу этого поля по значению, введите заголовок этой страницы. Например, страница «Люди, у которых есть работа». Такие страницы доступны только для публичных полей.','ru',0,0),(3518,'Модуль Profile даёт администраторам возможность определять поля для профилей пользователей, такие как страна, полное имя или возраст, которые показываются в закладках страницы <a href=\"@user\">Моя учётная запись</a>. Это позволяет посетителям опубликовать о себе больше информации и помогает сайтам-сообществам упорядочить пользователей по указаной ими информации. Подробнее смотрите в руководстве на странице <a href=\"@profile\">модуля Profile</a>.','ru',0,0),(3519,'Добавление полей в профиль по умолчанию','ru',0,0),(3520,'Для того, чтобы дать возможность пользователям указать больше информации о себе, модуль Profile позволяет создать дополнительные поля, которые будут показаны на странице профиля пользователя. К примеру, такими полями могут быть: <em>Местонахожение</em>, <em>Компания</em>, <em>Возраст</em>, or <em>Обо мне</em>.','ru',0,0),(3521,'Страницы информации о пользователе','ru',0,0),(3522,'Модуль Profile позволяет делать ссылки на дополнительные страницы с фильтрацией пользователей по значениям заполненных ими полей. Помимо основной <a href=\"@profile\">страницы профиля</a>, доступны специальные страницы по ссылкам с заполненных полей. Например, на странице Drupal.org <a href=\"@profile-country\">People who live in Canada</a> показан список пользователей, указавших в поле <em>Country</em>  значение <em>Canada</em>.','ru',0,0),(3523,'Блок информации об авторе','ru',0,0),(3524,'<em>Блок информации об авторе</em> — это блок модуля Profile, который можно включить на <a href=\"@blocks\">странице управления блоками</a>. В нём отображается информация об авторе текущей страницы.','ru',0,0),(3525,'На этой странице находится список дополнительных полей для профилей пользователей, которые показываются на странице <em>Моя учетная запись</em>. Для структурирования однотипные поля можно группировать в категории. Для добавления новой категории (или редактирования существующей), измените название категории в режиме редактирования поля.','ru',0,0),(3526,'Дополняет материал метаданными, что позволяет другим приложениям (таким, как поисковые системы, сборщики лент) лучше распознавать связи и атрибуты материала.','ru',0,0),(3527,'Активные модули поиска были изменены.','ru',0,0),(3528,'Необходимо указать не менее одного ключевого слова.','ru',0,0),(3529,'Необходимо указать не менее одного ключевого слова, состоящего из @count или более букв.','ru',3528,1),(3530,'Необходимо указать не менее одного ключевого слова, состоящего из @count[2] или более букв.','ru',3529,2),(3531,'Поиск %type по запросу %keys.','ru',0,0),(3532,'Модуль <em>Search</em> позволяет индексировать содержание сайта и выполнять поиск по ключевым словам в содержании документов или по именам пользователей. Для дополнительной информации смотрите в онлайновом руководстве статью <a href=\"@search-module\">Search</a>.','ru',0,0),(3533,'Поиск содержимого и пользователей','ru',0,0),(3534,'Пользователи с правом «Использование поиска» могут пользоваться блоком поиска и <a href=\"@search\">страницей поиска</a>. Пользователи с правом «Просмотр опубликованных документов» могут искать по содержанию этих документов используя ключевые слова. Пользователи с правом «Просмотр профилей» могут искать пользователей по именам, а пользователи с правом «Управление пользователями» могут искать пользователей по почтовым адресам. Дополнительно, пользователи с правом «Использование расширенного поиска» могут использовать при поиске дополнительные способы и фильтровать полученные результаты используя секцию «Расширенный поиск» на странице поиска.','ru',0,0),(3535,'Содержимое индексируется cron\'ом','ru',0,0),(3536,'Настройка свойств поиска','ru',0,0),(3537,'Параметры индексации могут быть настроены на странице поиска. Пользователи с правом «Управление поиском» могут изменять количество индексируемых при запуске <em>cron</em> документов, минимальное количество букв в слове для его индексации, определять индексируемые данные и влияние определённых элементов на порядок поисковой выдачи.','ru',0,0),(3538,'Модуль поиска генерирует свой блок, который позволяет разместить форму поиска в одном из регионов сайта на <a href=\"@blocks\">странице блоков</a>. Блок доступен для пользователей с правом «Использование поиска».','ru',0,0),(3539,'Модуль Extending Search','ru',0,0),(3540,'По умолчанию, модуль Search поддерживает только слова совпадающие со словами в содержание. Улучшить поведение модуля можно установив модули работающие с морфологией языков (например <a href=\"http://drupal.org/project/porterstemmer\">Porter Stemmer</a> для американского английского), который позволяют искать не только точное совпадение букв, но и возможные изменённые варианты слова. Другой подход заключается в использовании других поисковых систем, например <a href=\"http://drupal.org/project/apachesolr\">Apache Solr</a> или <a href=\"http://drupal.org/project/sphinx\">Sphinx</a>. Кроме этого, на <a href=\"@contrib-search\">странице проектов</a> можно отфильтровать модули, связанные с поиском.','ru',0,0),(3541,'<ul> <li>Проверьте наличие орфографических ошибок</li> <li>Не используйте кавычки: запрос «голубое небо» даст больше результатов, чем запрос «\"голубое небо\"».</li> <li>Попробуйте использовать оператор «OR»: запрос «голубое OR небо» даст больше результатов, чем запрос «голубое небо».</li> </ul>','ru',0,0),(3542,'Управлять поиском','ru',0,0),(3543,'Использовать поиск','ru',0,0),(3544,'Использовать расширенный поиск','ru',0,0),(3545,'Настройка индексирования, веса учитываемых при поиске факторов и других параметров поиска.','ru',0,0),(3546,'Выберите свой набор ярлыков','ru',0,0),(3547,'Выберите набор ярлыков для этого пользователя','ru',0,0),(3548,'Выбор набора «%set_name» сохранён. Вы можете настроить ярлыки этого набора или <a href=\"@switch-url\">вернуться обратно</a>.','ru',0,0),(3549,'Пользователь %user теперь использует набор ярлыков %set_name shortcut. Вы можете редактировать его на этой странице.','ru',0,0),(3550,'Выбор набора «%set_name» сохранён.','ru',0,0),(3551,'Пользователь %user теперь использует набор ярлыков %set_name shortcut.','ru',0,0),(3552,'Сохранить','ru',0,0),(3553,'Набор ярлыков обновлён.','ru',0,0),(3554,'Добавление ярлыка','ru',0,0),(3555,'Редактирование ярлыка «@shortcut»','ru',0,0),(3556,'Название ярлыка.','ru',0,0),(3557,'Путь к ярлыку','ru',0,0),(3558,'Указанного пути не существует. Ссылка должна вести на существующий адрес.','ru',0,0),(3559,'Ярлык «%link» обновлён.','ru',0,0),(3560,'Для %title добавлен ярлык','ru',0,0),(3561,'Вы уверены, что хотите удалить ярлык %title?','ru',0,0),(3562,'Ярлык для %title удалён.','ru',0,0),(3563,'Невозможно добавить ярлык для %title.','ru',0,0),(3564,'Добавление и удаление ярлыков','ru',0,0),(3565,'Показ ярлыков','ru',0,0),(3566,'Выводить ярлыки можно включи блок «Ярлыки» на <a href=\"@blocks\">странице блоков</a>. Определённые модули также могут выводить свои ярлыки. Например, стандартный модуль <a href=\"@toolbar-help\">Toolbar</a> показывает их вверху страницы вместе со ссылкой «Правка ярлыков».','ru',0,0),(3567,'Управление ярлыками','ru',0,0),(3568,'Ярлыки набора «@shortcut_set»','ru',0,0),(3569,'Добавить в набор ярлыков %shortcut_set','ru',0,0),(3570,'Добавить в ярлыки','ru',0,0),(3571,'Удалить из набора ярлыков %shortcut_set','ru',0,0),(3572,'Удалить из ярлыков','ru',0,0),(3573,'Правка ярлыков','ru',0,0),(3574,'Добавить ярлык','ru',0,0),(3575,'Редактировать ярлык','ru',0,0),(3576,'Удалить ярлык','ru',0,0),(3577,'Позволяет пользователям управлять настраиваемыми списками ярлыков быстрого доступа.','ru',0,0),(3578,'Значение @value ИСТИНА.','ru',0,0),(3579,'Значение @value ЛОЖЬ.','ru',0,0),(3580,'Значение @value NULL.','ru',0,0),(3581,'Значение @value не пусто.','ru',0,0),(3582,'Значения @first и @second равны.','ru',0,0),(3583,'Значение @first не равно @second.','ru',0,0),(3584,'Значения @first и @second идентичны.','ru',0,0),(3585,'Значение @first не совпадает с @second.','ru',0,0),(3586,'Тест не был завершен по причине фатальной ошибки.','ru',0,0),(3587,'Ссылка с текстом %label найдена.','ru',0,0),(3588,'Ссылка с меткой %label не найдена.','ru',0,0),(3589,'Ссылка на %href найдена.','ru',0,0),(3590,'Ссылок на %href не найдено.','ru',0,0),(3591,'На странице @url_before нажата ссылка %label (@url_target)','ru',0,0),(3592,'Для поля @id выбран вариант @option.','ru',0,0),(3593,'Опция @option для поля @id не выбрана.','ru',0,0),(3594,'По умолчанию, SimpleTest очищает результаты после их просмотра на странице результатов, но в некоторых случаях может быть полезно оставить результаты в базе данных. Результаты могут быть просмотрены на <em>admin/config/development/testing/[test_id]</em>. ID теста можно найти в базе данных, таблице simpletest, или запомнить при первоначальном просмотре результатов. Кроме того, некоторые модули могут проводить углубленный анализ или предоставлять функции, требующие, чтобы этот параметр был отключен.','ru',0,0),(3595,'GSS negotiate','ru',0,0),(3596,'NTLM','ru',0,0),(3597,'Любая безопасная','ru',0,0),(3598,'Модуль тестирования предоставляет возможность для запуска автоматизированных тестов. Он может использоваться для проверки рабочего состояния Drupal до и после любых изменений кода, или в качестве средства для разработчиков, чтобы писать и выполнять тесты для своих модулей. Более подробную информацию смотрите в руководстве на странице <a href=\"@simpletest\">модуля тестирования</a>.','ru',0,0),(3599,'Проведение тестов','ru',0,0),(3600,'На <a href=\"@admin-simpletest\">странице тестирования</a> можно посмотреть список доступных тестов. Для полного тестирования выберите <em>все</em> тесты. Для выборочного тестирования выберите только те тесты, которые необходимо провести. Более подробную информацию о создании и редактировании собственных тестов смотрите в <a href=\"@simpletest-api\">документации по API тестирования</a> в руководстве.','ru',0,0),(3601,'После того, как тест завершится, рядом с каждой группой тестов будет показано сообщение, показывающее, пройдены ли тесты, провалены, или в ходе тестов возникли исключения. Пройденный тест означает, что тест вернул ожидаемые результаты, в то время как провал означает, что он этого не сделал. Исключения обычно указывают на ошибки вне теста, таких как предупреждения или уведомления РНР. Если были сбои или исключения, то результаты будут детализированы, а тесты, в которых они произошли, помечены красным или розовым. Вы можете использовать эти результаты для проверки кода и тестов до тех пора, пока все тесты не будут пройдены.','ru',0,0),(3602,'Управление тестами','ru',0,0),(3603,'Тест пройден за @elapsed.','ru',0,0),(3604,'Используйте кнопку <em>Очистить окружение</em> для очистки временных файлов и таблиц.','ru',0,0),(3605,'Для работы системы тестирования необходимо, чтобы ограничение PHP <a href=\"@open_basedir-url\">open_basedir</a> было отключено. Проверьте настройки сервера или свяжитесь с хостером.','ru',0,0),(3606,'Модуль <em>Testing</em> не включен, так как библиотека PHP <a href=\"@curl_url\">cURL</a> не найдена.','ru',0,0),(3607,'Модуль <em>Testing</em> не включен, так как расширение PHP <a href=\"@curl_url\">hash</a> не включено.','ru',0,0),(3608,'Ограничение PHP open_basedir','ru',0,0),(3609,'разблокировать IP адрес','ru',0,0),(3610,'блокировать IP адрес','ru',0,0),(3611,'Модуль Statistics позволяет собирать информацию о количестве просмотров документов, просматривавшем страницу пользователи, страницу с которой пользователь перешёл на страницу документа и время, когда документ просматривался. Эта информация может быть полезна для выяснения того, какие документы пользователи предпочитают просматривать и как они перемещаются по сайту. Для получения дополнительной информации смотрите онлайн справку по <a href=\"@statistics\">модулю Statistics</a>.','ru',0,0),(3612,'Параметры модуля','ru',0,0),(3613,'Для сбора информации о доступе к документам, на <a href=\"@statistics-settings\">странице статистики</a> должно быть отмечено поле «Статистика доступа». Параметр «Хранение статистики» позволяет определить время, в течение которого записи будут храниться в журнале. Записи старше выбранного периода удаляются при <a href=\"@cron\">запуске cron</a>.','ru',0,0),(3614,'Просмотр статистики','ru',0,0),(3615,'Модуль позволяет легко просмотреть данные о пользователях просматривавших страницы и получить информацию о том, как они используют сайт. Для этого, модулем генерируются несколько отчётов:','ru',0,0),(3616,'Страница «<a href=\"@recent-hits\">Просмотры</a>» позволяет увидеть последнюю активность на сайте. Записывается информацию о времени просмотра, просмотренной странице и открывшем её пользователе. Если имя пользователя недоступно (это был анонимный посетитель), то записывается IP-адрес с которого была открыта страница.','ru',0,0),(3617,'Страница «<a href=\"@top-referrers\">Последние посещения</a>» позволяет увидеть информацию о посещениях страниц сайта с внешних источников. Записывается информация о количестве посещений, адресе источника посещений и времени последнего посещения с этого источника.','ru',0,0),(3618,'Страница «<a href=\"@top-pages\">Страницы</a>» позволяет увидеть список страниц по тому, как часто они просматривались. Записывается информация о количестве просмотров страницы, среднем времени генерации страницы и общем времени генерации страницы.','ru',0,0),(3619,'Страница «<a href=\"@top-visitors\">Посетители</a>» позволяет увидеть самых активных пользователей сайта, которые просматривают наибольшее количество страниц. Записывается информация о количестве просмотров, посетителе и общем времени генерации страниц. Кроме этого, на этой странице можно блокировать IP-адрес посетителя.','ru',0,0),(3620,'Популярные документы','ru',0,0),(3621,'Модуль генерирует блок «Популярное содержание», в котором могут выводиться самые просматриваемые документы за разные периоды времени, которые может определить администратор. Чтобы этот блок стал доступен, необходимо включить параметр «Счётчик просмотров» на <a href=\"@statistics-settings\">странице статистики</a>. После этого, блок появится на <a href=\"@blocks\">странице блоков</a>.','ru',0,0),(3622,'Счётчик просмотров','ru',0,0),(3623,'Модуль статистики позволяет учитывать просмотр каждой страницы. Для включения этой возможности отметьте поле «Счётчик просмотров» на <a href=\"@statistics-settings\">странице статистики</a>. Количество просмотров может показываться на странице документа пользователям с <a href=\"@permissions\">правом</a> «Просмотр счётчика просмотра документов».','ru',0,0),(3624,'Управление статистикой','ru',0,0),(3625,'Просмотр истории просмотра документов','ru',0,0),(3626,'Просмотр счётчика просмотра документов','ru',0,0),(3627,'Настройка статистической информации, которую Drupal собирает на сайте.','ru',0,0),(3628,'Модуль Syslog регистрирует события, отправляя сообщения на их регистрацию в операционной системе вашего веб-сервера. Syslog — это системная утилита для учёта происходящих на сервере событий, для облегчения управления системой и аудита безопасности.  Предназначенный для средних и больших сайтов, Syslog предоставляет инструменты фильтрации, позволяющие сортировать сообщения по их типу и статусу. Более подробную информацию смотрите в руководстве на странице <a href=\'@syslog\'>модуля Syslog</a>, а также описания функций PHP <a href=\'@php_openlog\'>openlog</a> и <a href=\'@php_syslog\'>syslog</a>.','ru',0,0),(3629,'Вход для UNIX, Linux и Mac OS X','ru',0,0),(3630,'В UNIX, Linux и Mac OS X файл <em>/etc/syslog.conf</em> задает настройки маршрутизации. Сообщения могут быть помечены от <code>LOG_LOCAL0</code> до <code>LOG_LOCAL7</code>. Для справки по журналам Syslog, уровням приоритета и настройке <em>syslog.conf</em> используйте консольную справку по <em>syslog.conf</em>.','ru',0,0),(3631,'Вход для Microsoft Windows','ru',0,0),(3632,'В Microsoft Windows сообщения всегда записываются в журнал событий с кодом code>LOG_USER</code>.','ru',0,0),(3633,'Механизм системных журналов Syslog','ru',0,0),(3634,'В зависимости от системных настроек Syslog и другие журнальные утилиты используют этот код для поиска и фильтрации сообщений внутри системного журнала.','ru',0,0),(3635,'Невозможно повернуть изображение %file, т.к. функция imagerotate() не доступна в этой сборке PHP.','ru',0,0),(3636,'Невозможно обесцветить изображение %file, т.к. imagefilter() не доступна в этой сборке PHP.','ru',0,0),(3637,'Снимок экрана для темы !theme','ru',0,0),(3638,'Настройки для темы !theme','ru',0,0),(3639,'Отключить тему !theme','ru',0,0),(3640,'Установить тему !theme как тему по умолчанию','ru',0,0),(3641,'Включить тему !theme','ru',0,0),(3642,'Включить и установить по умолчанию','ru',0,0),(3643,'Включить тему !theme и назначить используемой по умолчанию','ru',0,0),(3644,'стандартная тема','ru',0,0),(3645,'Выберите пункт «Стандартная тема», чтобы для всех страниц сайта использовалась одна тема.','ru',0,0),(3646,'Использовать административную тему при редактировании или создании материала','ru',0,0),(3647,'Тема %theme была включена.','ru',0,0),(3648,'Тема %theme не была найдена.','ru',0,0),(3649,'Тема %theme является темой по умолчанию и не может быть отключена.','ru',0,0),(3650,'Тема %theme была отключена.','ru',0,0),(3651,'Пожалуйста, обратите внимание, что административная тема по-прежнему установлен в %admin_theme, следовательно, тема на этой странице остается неизменной. Всё в не-административных разделах сайта, показываются в выбранной теме %selected_theme по умолчанию.','ru',0,0),(3652,'Стандарной темой (темой выбранной по умолчанию) установлена тема %theme.','ru',0,0),(3653,'Статус проверки пользователя в комментариях','ru',0,0),(3654,'Эти настройки существуют только для тем, базированных на системе тем %engine.','ru',0,0),(3655,'Логотип не может быть закачан.','ru',0,0),(3656,'Иконка не может быть закачана.','ru',0,0),(3657,'Введенный путь для логотипа неверен.','ru',0,0),(3658,'Введенный путь для favicon неверен.','ru',0,0),(3659,'@module (<span class=\"admin-missing\">несовместим с </span> версией @version)','ru',0,0),(3660,'Эта версия не совместима с Drupal !core_version и должна быть заменена.','ru',0