т определённый набор возможностей и может быть включен или выключен в зависимости от необходимости. Кроме этого, на сайте могут быть включены любые другие <a href=\"@drupal-modules\">дополнительные модули</a>, которые не входят в стандартную сборку.','ru',0,0),(3743,'Управление темами','ru',0,0),(3744,'Модуль System позволяет пользователям с соответствующими правами включать и выключать дополнительные темы на <a href=\"@themes\">странице тем</a>. В стандартный пакет Drupal уже входят несколько тем и каждая тема реализует определённый набор возможностей и может быть включена или выключена в зависимости от необходимости. Кроме этого, на сайте могут быть включены любые другие <a href=\"@drupal-themes\">дополнительные темы</a>, которые не входят в стандартную сборку.','ru',0,0),(3745,'Управление кэшированием','ru',0,0),(3746,'Модуль System позволяет пользователям с соответствующими правами управлять кэшированием на <a href=\'@cache-settings\'>странице управления кэшированием</a>. В Drupal есть эффективная система кэширования, которая позволяет кэшировать страницы и при последующем запросе отдавать страницу из кэша. Страницы, которые отдаются анонимным посетителям хранятся в сжатом формате и в зависимости от параметров сайта кэширование может снизить нагрузку на сервер, уменьшить трафик и значительно увеличить быстродействие сайта.','ru',0,0),(3747,'Техническое обслуживание системы','ru',0,0),(3748,'Основные параметры сайта','ru',0,0),(3749,'Модуль System позволяет управлять основными параметрами сайта, такими как <a href=\"@date-time-settings\">дата и время</a>, <a href=\"@file-system\">файловая система</a>, <a href=\"@clean-url\">чистые ссылки</a>, <a href=\"@site-info\">информация о сайте</a> и <a href=\"@maintenance-mode\">обслуживание сайта</a>.','ru',0,0),(3750,'Управление действиями','ru',0,0),(3751,'Действия являются отдельными задачами, которые может выполнить система. Например, к действиям относятся депубликация документа или блокирование пользователя. Такие модули как <a href=\"@trigger-help\">Trigger</a> позволяют автоматизировать и настроить выполнение действий при возникновении определённых системных событий. Например, действие может быть автоматически выполнено после создания документа или после входа пользователя в аккаунт. Различные модули могут добавлять свои действия. Настроить действия можно на <a href=\"@actions\">странице действий</a>.','ru',0,0),(3752,'Выберите и настройте тему, которая будет использоваться на сайте по умолчанию. Дополнительные темы можно найти на странице <a href=\"@themes\">http://drupal.org/project/themes</a>.','ru',0,0),(3753,'Для расширения возможностей сайта, можно воспользоваться <a href=\"@modules\">дополнительными модулями</a>.','ru',0,0),(3754,'Следите за <a href=\"@updates\">обновлениями</a> используемых модулей и всегда запускайте файл <a href=\"@update-php\">update.php</a> после обновления файлов. Запуск этого файла полностью обновит кэш сайта и позволит внести необходимые изменения в базу данных.','ru',0,0),(3755,'Следите за <a href=\"@updates\">обновлениями</a> используемых модулей и всегда запускайте файл <a href=\"@update-php\">update.php</a> после обновления файлов. Запуск этого файла полностью обновит кэш сайта и позволит внести необходимые изменения в базу данных.','ru',0,0),(3756,'Следите за <a href=\"@updates\">обновлениями</a> используемых модулей и всегда запускайте файл <a href=\"@update-php\">update.php</a> после обновления файлов. Запуск этого файла полностью обновит кэш сайта и позволит внести необходимые изменения в базу данных.','ru',0,0),(3757,'Запускайте файл <a href=\"@update-php\">update.php</a> каждый раз, когда вы обновляете систему, любой дополнительный модуль или дополнительную тему. Запуск этого файла полностью обновит кэш сайта и позволит внести необходимые изменения в базу данных.','ru',0,0),(3758,'Есть два типа действий: простые и расширенные. Простые действия не требуют дополнительной настройки и перечислены ниже. Расширенные действия требуют определения дополнительных параметров и обладают большими возможностями. Например, с помощью расширенного действия можно отправить письмо на определённый адрес или провести проверку содержания на наличие определённых слов. Расширенные действия нужно настроить прежде чем вы сможете их использовать (в первом случае из этих примеров настройка будет заключаться в определении адреса на который нужно отправить письмо, во втором, потребуется определить слова). Для добавления расширенного действия, выберите его тип в раскрывающемся списке и нажмите кнопку «Создать».','ru',0,0),(3759,'Расширенные действия имеют дополнительные параметры настройки, которые могут быть заполнены ниже. Рекомендуется изменить поле <em>Описание</em>, чтобы точно определить действие, которое будет совершаться. Это описание будет отображаться в модулях, таких как модуль Trigger, для привязки действий к системным событиям, так что лучше делать его максимально информативным (например, «Отправить по электронной почте для команды модераторов», вместо «Отправить по электронной почте»).','ru',0,0),(3760,'Управление модулями','ru',0,0),(3761,'Управление конфигурацией сайта','ru',0,0),(3762,'Управление темами','ru',0,0),(3763,'Управление действиями','ru',0,0),(3764,'Использовать страницы администрирования и справку','ru',0,0),(3765,'Использование сайта в режиме обслуживания','ru',0,0),(3766,'Просмотр отчётов сайта','ru',0,0),(3767,'Блокирование IP-адресов','ru',0,0),(3768,'Общие файлы','ru',0,0),(3769,'Открытый — передачей файлов управляет веб-сервер','ru',0,0),(3770,'Закрытый — передачей файлов управляет Drupal','ru',0,0),(3771,'Временные файлы','ru',0,0),(3772,'Временные локальные файлы для загрузки и просмотра.','ru',0,0),(3773,'Обновить модули','ru',0,0),(3774,'Обновить темы','ru',0,0),(3775,'SSH','ru',0,0),(3776,'Ваш пароль не сохраняется в базе данных и используется только для установления соединения.','ru',0,0),(3777,'Будет создано соединение между вашим веб-сервером и машиной, хранящей файлы веб-сервера. В 