ице <a href=\"@phpinfo\">о включении и выключении phpinfo()</a>.','ru',0,0),(3830,'Для запуска <em>cron</em> используйте ссылку <a href=\"!cron\">!cron</a>.','ru',0,0),(3831,'Попытка создать папку закончилась неудачей, скорее всего, из-за отсутствия необходимых прав доступа. Для продолжения установки вы можете создать эту папку самостоятельно и установить права разрешающие программе установки запись в эту папку. Дополнительную информацию можно найти в файле <em>INSTALL.txt</em> или в <a href=\"@handbook_url\">сетевом руководстве</a>.','ru',0,0),(3832,'Ваши настройки были сохранены.','ru',0,0),(3833,'Нет доступных словарей. <a href=\"@link\">Добавить словарь</a>.','ru',0,0),(3834,'Нет доступных терминов. <a href=\"@link\">Добавить термин</a>.','ru',0,0),(3835,'На данный момент нет содержимого, классифицированного этим термином.','ru',0,0),(3836,'Токены, связанные с терминами таксономии.','ru',0,0),(3837,'Токены, связанные со словарями таксономии.','ru',0,0),(3838,'Модуль Taxonomy позволяет классифицировать содержимое вашего веб-сайта. Для классификации создаются <em>словари</em> содержащие <em>термины</em>','ru',0,0),(3839,'Создание словарей','ru',0,0),(3840,'Пользователи с соответствующими <a href=\"@perm\">правами</a> могут добавлять словари и термины на <a href=\"@taxo\">странице таксономии</a>. Страницы со списками терминов предоставляют возможности по настройке каждого термина и их упорядочивания. Термины могут вкладываться друг в друга и из них может выстраиваться иерархия. К примеру, словарь классифицирующий музыку может выглядеть следующим образом:','ru',0,0),(3841,'<em>словарь</em>: Музыка','ru',0,0),(3842,'<em>термин</em>: Джаз','ru',0,0),(3843,'<em>термин</em>: Свинг','ru',0,0),(3844,'<em>термин</em>: Фьюжн','ru',0,0),(3845,'<em>термин</em>: Рок','ru',0,0),(3846,'<em>термин</em>: Кантри-рок','ru',0,0),(3847,'<em>термин</em>: Хард-рок','ru',0,0),(3848,'Кроме этого, любой термин может быть вложен сразу в несколько других терминов. Например, можно вложить термин «Фьюжн» и в термин «Рок» и в термин «Джаз».','ru',0,0),(3849,'Словари могут содержать не только заранее определённые администратором термины, но и термины, которые можно добавлять на страницах редактирования документов. Такие словари называются словарями со свободным вводом. При этом вместо слова <em>термин</em> обычно используется слово <em>тег</em>, что позволяет сразу получить информацию о параметрах словаря. Словари со свободным вводом тегов обычно используются в блогах, т.к. невозможно заранее предусмотреть все теги, которыми можно отметить запись.','ru',0,0),(3850,'Связывание словарей с типами документов','ru',0,0),(3851,'Перед тем, как словарь можно будет использовать в документах, его нужно связать с типом документов в которых он должен использоваться. Это можно сделать на странице настройки типа документов, перейдя на вкладку «Поля» и добавив типу документов поле таксономии. При добавлении поля таксономии можно выбрать виджет, который будет использоваться для работы с терминами словаря: список выбора, флажки, радиокнопки или поле с автозавершением ввода (для создания словаря со свободным вводом тегов). После выбора типа поля и виджета, нужно определить различные параметры поля. Один и тот же словарь может быть связан с разными типами документов путём использования поля «Добавить существующее», вместо создания нового поля.','ru',0,0),(3852,'Классификация содержания','ru',0,0),(3853,'После того, как словаря связан с типом документов, его можно использовать для классификации документов этого типа. Поля терминов будут показывать на страницах редактирования существующих документов этого типа и при <a href=\"@addnode\">добавлении новых</a> документов.','ru',0,0),(3854,'Просмотр списков и лент по терминам','ru',0,0),(3855,'Для каждого термина автоматически создаётся обзорная страница, на которой показываются все документы, с которыми связан этот термин. Кроме этого, для каждой такой страницы автоматически создаётся RSS-лент. Например, если есть термин «Кантри-рок» и номер (идентификатор, TID) этого термина 123, то список документов связанных с этим термином можно найти на странице <em>taxonomy/term/123</em>, а RSS-ленту этого термина можно найти на странице <em>taxonomy/term/123/feed</em> (при открытии обзорной страницы, значок RSS-ленты будет показываться в адресной строке браузера).','ru',0,0),(3856,'Расширение модуля таксономии','ru',0,0),(3857,'Существует большое количество <a href=\"@taxcontrib\">дополнительных модулей</a> расширяющих возможности таксономии.','ru',0,0),(3858,'Таксономия позволяет классифицировать содержание. В таксономии используются словари и термины, которые входят в словари. Например, словарь который называется «Фрукты», может содержать термины «Яблоко», «Апельсин» и «Банан».','ru',0,0),(3859,'Параметры любого термина можно изменить, нажав ссылку «изменить» напротив этого тега.','ru',0,0),(3860,'Словарь %capital_name имеет древовидную структуру. Порядок терминов в словаре %capital_name можно изменить, перетащив термин мышкой в нужное место.','ru',0,0),(3861,'Словарь %capital_name имеет термины с множественными родителями. Сортировка перетаскиванием мышкой для таких словарей не поддерживается, чтобы эта возможность заработала, у каждого термина должно быть не более одного родителя.','ru',0,0),(3862,'Управление словарями и терминами','ru',0,0),(3863,'%vocabulary: правка терминов словаря','ru',0,0),(3864,'%vocabulary: удаление терминов словаря','ru',0,0),(3865,'Страница термина','ru',0,0),(3866,'Ссылка на термин','ru',0,0),(3867,'Это поле хранит ссылку на термин таксономии.','ru',0,0),(3868,'Автозавершение ввода','ru',0,0),(3869,'Словарь, который предоставляет значения для этого поля.','ru',0,0),(3870,'Модуль <a href=\"@toolbar\">Toolbar</a> показывает ссылки первого уровня меню управления сайтом и ссылки других модулей вверху страницы.','ru',0,0),(3871,'Вывод ссылок управления сайтом','ru',0,0),(3872,'Использование панели инструментов','ru',0,0),(3873,'Переключить видимость вывода','ru',0,0),(3874,'Панель инструментов администратора.','ru',0,0),(3875,'Модуль Tracker позволяет отслеживать изменения в содержании сайта. Он показывает информацию о добавленных и обновлённых документах и о добавлении к документам комментариев. Отслеживать изменения в содержании можно не только для всего содержания сайта сразу, но и на основе пользователей. Этот модуль не имеет настраиваемых параметров. Для получения дополнительной информации смотрите онлайн справку по <a href=\"@tracker\">Tracker модулю</a>.','ru',0,0),(3876,'Модуль Tracker добавляет новый пункт в меню навигации, который называется «Новые сообщения». Настроить параметры этого пункта и его размещение можно на <a href=\"@menus\">странице меню</a>.','ru',0,0),(3877,'Отслеживание изменений','ru',0,0),(3878,'Отслеживать новые и обновлённые документы можно на странице <a href=\'@recent\'>новых сообщений</a>, на которых обновлённое содержание показывается в обратном хронологическом порядке. На этой странице содержится информация об обновлённом документе, характере обновления, тип документа, автор документа, количество комментариев и дата последнего обновления. Документ считается изменённым в том случае, если изменилась какая-либо информация связанная с документом или к документу был добавлен комментарий. Для пользователей, которые вошли в аккаунт, на странице новых сообщений показывается вкладка «Мои сообщения», которая позволяет ограничить список изменённых документов, которые связаны с аккаунтом текущего пользователя.','ru',0,0),(3879,'Отслеживание изменений на основе пользователей','ru',0,0),(3880,'Отслеживать новые и обновлённые документы можно на странице новых сообщений, которая доступна на странице профиля пользователя и называется «История».','ru',0,0),(3881,'Все последние материалы','ru',0,0),(3882,'Мои последние материалы','ru',0,0),(3883,'Отслеживание материалов','ru',0,0),(3884,'Включает отслеживание последнего содержимого для пользователей.','ru',0,0),(3885,'Модуль Content translation позволяет переводить документы сайта на разные языки. Работая вместе с модулем <a href=\"@locale\">Locale</a> (который управляет включенными на сайте языками и предоставляет интерфейс для перевода интерфейса сайта), модуль Content translation является ключевым для создания и управления переведёнными на другие языки документами. Для получения дополнительной информации смотрите онлайн руководство по модулю <a href=\"@translation\">Content translation</a>.','ru',0,0),(3886,'Настройка типов документов','ru',0,0),(3887,'Для настройки документов определённого типа для перевода, зайдите на страницу <a href=\"@content-types\">типов документов</a> и перейдите к правке того типа документов, который вы хотите настроить. В секции «Публикация» выберите пункт «Поддержка мультиязычности → Включить и разрешить перевод».','ru',0,0),(3888,'Назначение документу языка','ru',0,0),(3889,'Используйте поле «Язык» и раскрывающийся список языков для выбора языка документа при его добавлении или правке.','ru',0,0),(3890,'Перевод документа','ru',0,0),(3891,'Пользователи с правом «Перевод документов» могут переводить документы на включенные на сайте языки. После того, как в типе документов будет разрешён их перевод, в документах этого типа будет показываться вкладка «Перевод» (если при сохранении документа выбран какой-либо определённый язык, а не поле «нейтральный»), перейдя на которую можно выбрать язык на который нужно перевести документ.','ru',0,0),(3892,'Поддержка переводов','ru',0,0),(3893,'Если правка документа на одном языке требует того, чтобы изменения были переведены на другие языки, то перед сохранением документа в секции «Информация о переводе» отметьте поле «Необходимо обновление перевода». Если это поле будет отмечено, то после сохранения документа, его переводы на другие языки будут отмечены устаревшими.','ru',0,0),(3894,'Перевод содержимого','ru',0,0),(3895,'Перевод на этот язык уже существует.','ru',0,0),(3896,'Триггер: !description','ru',0,0),(3897,'Нет доступных действий для этого триггера. <a href=\"@link\">Добавить действие</a>.','ru',0,0),(3898,'Отсутствует/не определено действие сохранить (%save_aid) для действия %aid.','ru',0,0),(3899,'Было добавлено действие %label, которое необходимо, чтобы сохранить изменение свойства.','ru',0,0),(3900,'Действия %label было перенесено, чтобы сохранить изменения свойств.','ru',0,0),(3901,'Системными событиями являются, например, добавление нового документа или вход пользователя в аккаунт. События связаны с действиями, то есть определёнными задачами, которые нужно выполнить при возникновении определённого события. На <a href=\"@url\">странице действий</a> можно найти список существующих действий и добавить, в случае необходимости, новые.','ru',0,0),(3902,'Модуль <a href=\"@trigger\">Trigger</a> позволяет вызывать <em>действия</em> при возникновении определённых системных <em>событий</em>, таких как добавление нового документа или вход пользователя в аккаунт. Действия являются задачами, которые необходимо выполнять при возникновении событий, например снять документ с публикации или отправить администратору письмо.','ru',0,0),(3903,'Конфигурирование триггеров и действий','ru',0,0),(3904,'Комбинации действий и событий позволяют автоматизировать выполнение многих нужных задач, например они могут оповещать администратора об удалении аккаунта или автоматически депубликовать комментарии содержащие определённые слова. В стандартной сборке доступно пять типов событий, связанных с комментариями, документами, системой, таксономией и пользователями. Другие типы событий могут быть добавлены при помощи дополнительных модулей. Для настройки комбинации событие–действие, сначала зайдите на <a href=\"@actions-page\">страницу действий</a>. На этой странице вы найдёте список существующих на сайте действий и сможете создать дополнительные действия, которые вам нужны. После настройки действий, зайдите на <a href=\"@triggers-page\">страницу событий</a> и перейдите на нужную вкладку («Комментарий», «Таксономия» и так далее), которая характеризует события. Здесь можно связать действия и события вместе, назначив определённому событию действие, которое должно выполняться после того, как это событие произошло.','ru',0,0),(3905,'Документ добавлен или обновлён','ru',0,0),(3906,'После сохранения обновлённого материала','ru',0,0),(3907,'Комментарий добавлен или обновлён','ru',0,0),(3908,'После создания учётной записи','ru',0,0),(3909,'После обновления учётной записи','ru',0,0),(3910,'Выбор действий, которые будут выполняться при возникновении тех или иных событий.','ru',0,0),(3911,'Установка обновлений','ru',0,0),(3912,'Подготовка к обновлению сайта','ru',0,0),(3913,'Установка %project','ru',0,0),(3914,'Подготовка к установке','ru',0,0),(3915,'Ошибка установки/обновления','ru',0,0),(3916,'Установка %project_name успешна','ru',0,0),(3917,'Обновление выполнено успешно. Сайт выведен из режима обслуживания.','ru',0,0),(3918,'Обновление успешно завершено.','ru',0,0),(3919,'Ошибка обновления! См. журнал ниже для получения дополнительной информации.','ru',0,0),(3920,'Ошибка обновления! См. журнал ниже для получения дополнительной информации. Ваш сайт в режиме обслуживания.','ru',0,0),(3921,'Установка выполнена успешно. Сайт выведен из режима обслуживания.','ru',0,0),(3922,'Установка успешно завершена.','ru',0,0),(3923,'Установка не удалась! См. журнал ниже для получения дополнительной информации.','ru',0,0),(3924,'Установка не удалась! См. журнал ниже для получения дополнительной информации. Ваш сайт в режиме обслуживания.','ru',0,0),(3925,'Сбой при попытке получить обновления.','ru',0,0),(3926,'Нет доступных данных для обновления','ru',0,0),(3927,'Проверка обновлений','ru',0,0),(3928,'Пытаюсь проверить информацию об обновлениях...','ru',0,0),(3929,'Ошибка проверки информации об обновлениях.','ru',0,0),(3930,'Проверка обновлений...','ru',0,0),(3931,'Проверена информация об обновлениях для %title.','ru',0,0),(3932,'Сбой при попытке проверить информацию об обновлениях для %title.','ru',0,0),(3933,'Возникла ошибка при поп