ить, обновление каких проектов нужно выполнить. После этого будет запрошен пароль для FTP/SSH доступа к сайту, после чего файлы будут переданы в папки, в которые установлены проекты и перезаписаны их файлы.','ru',0,0),(3982,'Установка новых модулей и тем через пользовательский интерфейс','ru',0,0),(3983,'Вы также можете установить новые модули и темы подобным образом, через <a href=\"@install\">страницу установки</a> или нажав ссылку установки новых модулей/тем вверху <a href=\"@modules_page\">страницы модулей</a> и <a href=\"@themes_page\">страницы тем</a>. В этом случае, будет запрошен URL по которому находится пакет для установки или можно загрузить пакет самостоятельно с локального компьютера.','ru',0,0),(3984,'Нет информации об обновлениях. <a href=\"@run_cron\">Запустите cron</a> или <a href=\"@check_manually\">проверьте вручную</a>.','ru',0,0),(3985,'Вы можете автоматически устанавливать пропущенные обновления, используя Менеджер обновлений:','ru',0,0),(3986,'Ваш сайт в настоящее время сконфигурирован для отправки этих email\'ов, только когда доступны любые обновления. Для оповещения о других событиях, пройдите по ссылке: !url.','ru',0,0),(3987,'Ваш сайт в настоящее время сконфигурирован для отправки этих email\'ов, только когда доступны только обновления безопасности. Для оповещения о других событиях, пройдите по ссылке: !url.','ru',0,0),(3988,'Установленная версия по крайней мере одного модуля или темы более не поддерживается. Настоятельно рекомендуется обновить или отключить его. Смотрите страницу данного проекта для дополнительной информации.','ru',0,0),(3989,'Возникла проблема с проверкой <a href=\"@update-report\">доступных обновлений</a> для Drupal.','ru',0,0),(3990,'Возникла проблема с проверкой <a href=\"@update-report\">доступных обновлений</a> для ваших модулей или тем оформления.','ru',0,0),(3991,'Смотрите страницу <a href=\"@available_updates\">доступных обновлений</a> для дополнительной информации и установки обновлений.','ru',0,0),(3992,'Готов 