атов ввода</a> позволяет перейти к настройке любого формата ввода. В интересах безопасности, непроверенные пользователи должны иметь доступ только к тем форматам ввода, которые ограничивают используемые HTML-теги (т.к. определённые теги позволяют внедрять на страницу различные объекты или скрипты) или выводят всю введённую информацию в виде обычного текста. Проверенные пользователи могут использовать форматы с менее ограниченными параметрами. <strong>Неправильная настройка формата ввода представляет угрозу безопасности сайта!</strong>','ru',0,0),(4146,'Если у пользователя есть права дающие доступ более чем к одному формату ввода, то пользователь может выбирать какой формат использовать в том или ином случает. Выбор формата выполняется в секции «Формат ввода», которая показывается вместе с формой редактирования содержания. Администраторы могут определить форматы ввода доступные каждой роли пользователей и управлять порядком форматов, в котором они будут перечислены на <a href=\"@text-formats\">странице форматов</a>.','ru',0,0),(4147,'Форматы ввода определяют правила обработки содержания при его выводе на страницу. Для обработки содержания форматы ввода используют фильтры, которые применяются в определённой последовательности. Если роли доступно несколько форматов ввода, то пользователи этой роли могут выбирать, какой из форматов ввода следует использовать для обработки содержания. Дополнительную информацию можно найти на странице справки модуля <a href=\"@filterhelp\">Filter</a>','ru',0,0),(4148,'Показать больше материалов','ru',0,0),(4149,'Свернуть','ru',0,0),(4150,'Система тестирования требует чтобы класс DOMDocument был доступными. Проверьте настройки команды <a href=\"@link-phpinfo\">страница PHP информации</a>.','ru',0,0),(4151,'Сообщения об ошибках','ru',0,0),(4152,'Выберите, каким образом будут показываться обнаруженные ошибки. Рекомендуется не выводить ошибки на монитор на рабочем сайте.','ru',0,0),(4153,'Невозможно открыть %file_path','ru',0,0),(4154,'Название термина','ru',0,0),(4155,'Описание термина','ru',0,0),(4156,'Инструкции по сбросу пароля будут высланы на %email. Вы должны выйти с сайта, чтобы использовать сброс пароля по ссылке с вашего e-mail.','ru',0,0),(4157,'Введите Ваш текущий пароль для смены %mail или %pass. !request_new.','ru',0,0),(4158,'Текущий пароль','ru',0,0),(4159,'Ваш текущий пароль отсутствует либо неверен. Рекомендуется изменить %name.','ru',0,0),(4160,'Дальнейшие инструкции пользователю «<a href=\"@url\">%name</a>» отправлены.','ru',0,0),(4161,'Дальнейшие инструкции отправлены на указанный почтовый адрес.','ru',0,0),(4162,'Настройка учетных записей пользователей.','ru',0,0),(4163,'Настройка регистрации на сайте, содержание отправляемых писем, использование подписей и изображений пользователями.','ru',0,0),(4164,'Модуль %module установлен.','ru',0,0),(4165,'Таблица %name уже существует.','ru',0,0),(4166,'Невозможно переименовать %table в %table_new: Таблица %table не существует.','ru',0,0),(4167,'Невозможно переименовать %table в %table_new: таблица %table_new уже существует.','ru',0,0),(4168,'Невозможно добавить поле %table.%field: таблицы не существует.','ru',0,0),(4169,'Невозможно добавить поле %able.%field: поле уже существует.','ru',0,0),(4170,'Невозможно установить значение по умолчанию для поля  %table.%field: поле не существует.','ru',0,0),(4171,'Невозможно удалить значение по умолчанию поля %table.%field: поле не существует.','ru',0,0),(4172,'Невозможно добавить первичный ключ в таблицу %table: таблицы не существует.','ru',0,0),(4173,'Невозможно добавить первичный ключ в таблицу %table: первичный ключ уже существует.','ru',0,0),(4174,'Невозможно добавить уникальный ключ %name в таблицу %table: таблицы не существует.','ru',0,0),(4175,'Невозможно добавить уникальный ключ %name в таблицу %table: уникальный ключ уже существует.','ru',0,0),(4176,'Невозможно добавить индекс %name в таблицу %table: таблицы не существует.','ru',0,0),(4177,'Невозможно добавить индекс %name в таблицу %table: индекс уже существует.','ru',0,0),(4178,'Невозможно изменить определение поля %table.%name: поле не существует.','ru',0,0),(4179,'Невозможно переименовать поле из %table.%name в %name_new: такое поле уже существует.','ru',0,0),(4180,'Используйте эту страницу для создания нового пользовательского блока.','ru',0,0),(4181,'Количество последних сообщений блога для отображения','ru',0,0),(4182,'@node_type (поле комментария)','ru',0,0),(4183,'Редактировать комментарий %comment','ru',0,0),(4184,'Модуль <a href=\"@field_ui\">Field UI</a> реализует интерфейс по работе с прикреплением дополнительных полей к объектам и управления ими. Поля могут быть определены на уровне типа документов для прикрепления полей к документам и комментариям, на уровне словарей, для прикрепления полей к терминам и на уровне сайта для прикрепления полей к аккаунтам. Другие модули могут также включать определение полей для своих данных. Типы полей (текст, изображение, число и так далее) определяются другими модулями и управляются модулем <a href=\"@field\">Field</a>.','ru',0,0),(4185,'Проектирование полей','ru',0,0),(4186,'Как поле будет называться','ru',0,0),(4187,'У поля есть заголовок (метка), который показывается пользователям и системное название, которое используется системой. Заголовок может быть изменён после создания поля (если нужно), но системное название не может быть изменено после создания поля.','ru',0,0),(4188,'Какой тип данных поле будет хранить','ru',0,0),(4189,'Каждой поле может хранить один тип данных (текст, числа, файлы и т.д.). Когда вы определяете поле, вы выбираете тип поля, который связан с хранимым полем типом данных. Тип поля не может быть изменён после того, как поле создано.','ru',0,0),(4190,'Как данные поля будут вводиться и выводиться','ru',0,0),(4191,'Как много значений поле будет хранить','ru',0,0),(4192,'Вы можете хранить одно значение, определённое максимальное количество значений или неограниченное количество значений в каждом поле. Например, поле для ввода номера сотрудника может содержать одно число, а поле для ввода номера телефона может содержать несколько чисел. Эти параметры могут быть изменены после создания поля, но если вы уменьшите определённое ранее максимальное количество значений, то вы можете потерять часть данных.','ru',0,0),(4193,'Использование полей','ru',0,0),(4194,'После того, как вы определили поле, вы можете его многократно использовать. Например, вы определили поле для добавления изображений для одного из типов документов и вам нужно добавить поле для изображений с такими же параметрами в другой тип документов. Вы можете добавить это же поле и во второй тип документов выбрав его в поле «Существующее поле» на странице управления полями в типе документов. Вы также можете добавить это поле и в словарь, и в комментарии, и в аккаунт, и т.д.','ru',0,0),(4195,'Некоторые параметры многократно используемого поля уникальны в каждом из его использований, другие параметры этого поля общие. Например, заголовок текстового поля уникален для всех использований этого поля, а параметр количества допустимых значений общий.','ru',0,0),(4196,'Есть две основных причины многократного использования полей. Первая заключается в том, что многократное использование одного поля сохраняет время по определению новых полей. Вторая заключается в том, что многократное использование поля позволяет вам выводить, фильтровать, группировать и сортировать содержание на основе одного поля сквозь типы документов. Например, модуль Views позволяет создавать списки документов. Если вы используете одно поле в нескольких типах документов, вы можете создать вид содержащий все эти типы документов вместе, использовав это поле, сортировать их по этому полю и (или) фильтровать по этому полю.','ru',0,0),(4197,'Поля в документах','ru',0,0),(4198,'Поля в документах определяются на уровне типа документов, на вкладке «Поля» для каждого типа документов (на которую можно зайти и со страницы <a href=\"@types\">типов документов</a>). Когда вы определяете поле для типа документов, каждый документ этого типа получит это поле. Некоторые поля, такие как «Заголовок» и «Содержание» добавляются в тип документа при его создании или могут быть добавляться в типы документов профилями установок.','ru',0,0),(4199,'Поля в терминах','ru',0,0),(4200,'Поля в терминах таксономии определяются на уровне словарей, на вкладке «Поля» для каждого словаря (на которую можно зайти и со <a href=\"@taxonomy\">страницы таксономии</a>). Когда вы определяете поле для словаря, каждый термин этого словаря получит это поле. Например, вы можете определить поле изображения для словаря, чтобы добавлять значки для каждого его термина.','ru',0,0),(4201,'Поля в аккаунтах','ru',0,0),(4202,'Поля в аккаунтах определяются на уровне сайта, на вкладке «<a href=\"@fields\">Поля</a>» страницы <a href=\"@accounts\">настройки аккаунта</a>. Когда вы определяете поле для аккаунта, каждый аккаунт получит это поле. Например, вы можете добавить длинное поле текста, чтобы разрешить пользователям вводить свою биографию.','ru',0,0),(4203,'Поля в комментариях','ru',0,0),(4204,'Поля в комментариях определяются на уровне типа документов, на вкладке «Поля комментария» для каждого типа документов (на которую можно зайти и со страницы <a href=\"@types\">типов документов</a>). Когда вы добавляете поле для комментариев, каждый комментарий этого типа получит это поле. Например, вы можете добавить поле для ввода адреса сайта в комментариях к обсуждениям на форуме, чтобы разрешить комментаторам добавлять ссылку на свой сайт.','ru',0,0),(4205,'Управление текстовыми форматами и фильтрами','ru',0,0),(4206,'Способ определения языка: @type','ru',0,0),(4207,'Новые строки добавить, существующие заменить. Формы множественного числа обновить.','ru',0,0),(4208,'Добавить только новые строки. Уже существующие и формы множественного числа оставить прежними.','ru',0,0),(4209,'Определение языка выполняется для того, чтобы показать пользователю элементы интерфейса сайта на том языке, который он предпочитает. К элементам относятся заголовки и описания полей, кнопки,  системные сообщения, справочный текст и т.д. Для определения языка можно использовать сразу несколько способов.','ru',0,0),(4210,'Текст пользовательского интерфейса','ru',0,0),(4211,'Использовать опознанный язык интерфейса.','ru',0,0),(4212,'Добавить новый %type','ru',0,0),(4213,'При создании нового набора в него копируются ссылки из стандартного.','ru',0,0),(4214,'Новый набор создан из набора ярлыков %default','ru',0,0),(4215,'В настоящий момент вы используете набор ярлыков %set-name.','ru',0,0),(4216,'изменить название','ru',0,0),(4217,'удалить','ru',0,0),(4218,'Сохранить','ru',0,0),(4219,'Набор «%set_name» добавлен. Отредактируйте его ярлыки ниже.','ru',0,0),(4220,'Название набора ярлыков изменено на «%set-name».','ru',0,0),(4221,'Если вы выбрали этот набор ярлыков по умолчанию для нескольких (или всех) пользователей, то его удаление может затронуть и их.','ru',0,0),(4222,'Удаление набора ярлыков «%title»','ru',0,0),(4223,'Набор ярлыков «%title» удалён.','ru',0,0),(4224,'1 пользователь связан с этим набором ярлыков.','ru',0,0),(4225,'@count пользователя связаны с этим набором ярлыков.','ru',4224,1),(4226,'@count[2] пользователей связаны с этим набором ярлыков.','ru',4225,2),(4227,'Модуль Shortcut даёт пользователям возможность создавать наборы <em>ярлыков</em> со ссылками на часто посещаемые страницы. Каждый пользователь с правом <em>Выбор из всех наборов ярлыков</em> может выбрать себе любой из созданных кем-либо наборов. Более подробную информацию смотрите в руководстве на странице <a href=\"@shortcut\">модуля Shortcut</a>.','ru',0,0),(4228,'Управление ярлыками','ru',0,0),(4229,'Пользователи с правом «Управление ярлыками» могут управлять наборами ярлыков и редактировать ярлыки в наборах на <a href=\"@shortcuts\">странице ярлыков</a>.','ru',0,0),(4230,'Выбор набора','ru',0,0),(4231,'Пользователи с правом выбора наборов могут выбирать набор ярлыков, который будет показываться на вкладке «Ярлыки» в их аккаунтах.','ru',0,0),(4232,'Модуль Shortcut создаёт ссылку для добавления/удаления ярлыка для каждой страницы сайта. Эта ссылка позволяет добавить или удалить ярлык текущей страницы в текущем наборе ярлыков (если ваша тема отображает их). \r\n\r\nСсылка показывается только в том случае, если на сайте используется тема, которая может показывать эту ссылку и пользователя есть права для изменения ярлыков в наборе. Стандартная тема Seven показывает эту ссылку после заголовка страницы как маленький значок «+» или «–». Если нажать на значок «+», то ссылка на страницу будет добавлена в набор ярлыков. Если страница уже находится в наборе, то показывается значок «–», нажатие на который приведёт к удалению текущей страницы из набора.','ru',0,0),(4233,'Управлять наборами ярлыков вы можете в вкладке <a href=\"@shortcut-link\">Ярлыки</a> на странице вашей учётной записи.','ru',0,0),(4234,'Правка существующего набора ярлыков','ru',0,0),(4235,'Редактирование существующих наборов ярлыков затронет всех пользователей сайта, которые используют этот набор. Предоставление, вместе с этим правом, права «Выбор из всех наборов ярлыков», позволит пользователю редактировать любой существующий набор ярлыков.','ru',0,0),(4236,'Выбор из всех наборов ярлыков','ru',0,0),(4237,'Это право позволяет пользователю выбрать активный набор ярлыков из всех существующих на сайте наборов. Без этого права, набор ярлыков для пользователей выбирает администратор.','ru',0,0),(4238,'Добавление и изменение наборов ярлыков.','ru',0,0),(4239,'Добавить набор','ru',0,0),(4240,'Изменить название','ru',0,0),(4241,'Удалить набор ярлыков','ru',0,0),(4242,'@remote не может быть сохранено в @path.','ru',0,0),(4243,'Drupal требует включения следующих расширений PHP (<a href=\"@system_requirements\">системные требования</a>):','ru',0,0),(4244,'Поддержка базы данных','ru',0,0),(4245,'Ваш сервер не поддерживает никаких из известных расширений баз данных PDO (PHP Data Objects). Уточните у вашего хостера, поддерживают ли они PDO и 