— IP-адрес посетителя</li>\r\n  <li>!request_uri — запрошенный URI</li>\r\n  <li>!referer — HTTP Referer (если есть)</li>\r\n  <li>!uid — номер пользователя</li>\r\n  <li>!link — ссылка на сообщение</li>\r\n  <li>!message — содержание сообщения</li>\r\n</ul>','ru',0,0),(4268,'Drupal может автоматически оптимизировать такие файлы как CSS и JavaScript, что позволяет снизить трафик и количество запросов. CSS-файлы могут быть склеены в один файл и затем сжаты, JavaScript-файлы только склеиваются, но не сжимаются. Всё вместе это позволяет снизить нагрузку на сервер, снизить трафик и время загрузки страниц.','ru',0,0),(4269,'Дата в формате \"времени с\". (%date)','ru',0,0),(4270,'Расположение файла относительно корня сайта Drupal.','ru',0,0),(4271,'Возникла HTTP ошибка @errorcode при попытке получить @remote.','ru',0,0),(4272,'Из-за настроек системы сервера или конфигурации сети Drupal не имеет доступа к веб-страницам, что снижает его функциональность. Это может быть связано с настройками веб-сервера или PHP, и должно быть исправлено для того, чтобы загружать информацию о доступных обновлениях, входить в систему с помощью OpenID, или использовать другие зависимые от сети сервисы. Если вы уверены, что у Drupal есть доступ к веб-страницам, но вы по-прежнему видите это сообщение, добавьте <code>$conf[\'drupal_http_request_fails\'] = FALSE;</code> в конец файла settings.php.','ru',0,0),(4273,'Перевод %title на %language уже существует, новый %type будет создан вместо перевода.','ru',0,0),(4274,'Ваши модули были скачаны и обновлены.','ru',0,0),(4275,'<a href=\"@update\">Запустить обновление базы данных</a>','ru',0,0),(4276,'@name <em>(заблокирован)</em>','ru',0,0),(4277,'Вы уверены, что хотите удалить роль %name?','ru',0,0),(4278,'Права доступа позволяют управлять возможностями пользователей на сайте. Каждая <a href=\"@role\">роль</a> имеет свой набор прав. Например, можно дать пользователям роли «зарегистрированный пользователь» право добавлять комментарии, а пользователям роли «анонимный посетитель» такого права не давать. Все права данные роли «зарегистрированный пользователь» распространяются на пользователей всех ролей, за исключением роли «анонимный посетитель». Для управления сайтом <a href=\"@settings\">можно выбрать</a> роль, которой будут автоматически назначаться все возможные права.','ru',0,0),(4279,'Роли используются для группировки пользователей и передачи им определённых <a href=\"@permissions\">прав</a>. Примеры ролей: «анонимный посетитель», «зарегистрированный пользователь», «администратор», «модератор», «редактор», «покупатель» и т.д. Для удаления роли, выберите ссылку «правка», напротив её названия.','ru',0,0),(4280,'Статья — это документ, который обычно используется для новостей, анонсов и любых других сообщений, для которых не задействованы другие типы документов. Этот тип документа также используют для ведения персонального блога. По умолчанию, документы этого типа выводятся на первую страницу сайта и их разрешено комментировать.','ru',0,0),(4281,'Филипино','ru',0,0),(4282,'Швейцарский диалект','ru',0,0),(4283,'Шотландский','ru',0,0),(4284,'Кэшировать страницы для анонимных пользователей','ru',0,0),(4285,'Bartik','ru',0,0),(4286,'Мультиколоночная тема с поддержкой изменения цветов, переменной шириной и большим количеством регионов.','ru',0,0),(4287,'Выделено','ru',0,0),(4288,'Вторая боковая панель','ru',0,0),(4289,'Первый триптих','ru',0,0),(4290,'Триптих в середине','ru',0,0),(4291,'Последний триптих','ru',0,0),(4292,'Основной фон','ru',0,0),(4293,'Фон колонок-меню','ru',0,0),(4294,'Граница колонок-меню','ru',0,0),(4295,'Фон подвала','ru',0,0),(4296,'Plum','ru',0,0),(4297,'!local-task-title!active','ru',0,0),(4298,'Введите список HTML-тегов, которые будут разрешены в получаемых сайтом лентах. Теги, которых нет в списке разрешённых, будут удалены.','ru',0,0),(4299,'%field может состоять только из букв a-z, нижнего подчеркивания и дефиса.','ru',0,0),(4300,'%field не может содержать разметку.','ru',0,0),(4301,'Нет синонимов URL. <a href=\"@link\">Добавить синоним</a>.','ru',0,0),(4302,'Для обеспечения поиска по ключевым словам, поисковая система собирает в индекс слова найденные в содержании различных полей, по которым выполняется поиск, включая текст добавленный дополнительными модулями содержащийся в документах (например, содержание комментариев, которыми управляет модуль Comment или термины, которыми управляет модуль Taxonomy). Индексация происходит при запуске <a href=\"@cron\">запуск cron</a>. Пользователи с правом «Управление поиском» могут определять параметры индексации на <a href=\"@searchsettings\">странице поиска</a>.','ru',0,0),(4303,'Содержимое переиндексируется','ru',0,0),(4304,'Действия связанные с документами (создание, редактирование или удаление документов и комментариев) автоматически приводят к тому, что это содержание отмечается необходимым для переиндексации при следующем запуске <em>cron</em>. Когда содержание отмечается необходимым для переиндексации, при запуске <em>cron</em> старое содержание удаляется из индекса и добавляется новое. В отличие от действия связанных с содержанием, действия связанные со структурой сайта не приводят к отмечанию объектов с которыми они работают к переиндексации. В качестве примеров действий связанных со структурой можно назвать удаление или редактирование терминов, включение или выключение модулей, которые добавляют содержание (такие модуля как Taxonomy, Comment, модули добавляющие дополнительные поля). К этим действиям относятся и изменение полей или параметров вывода в типах документов. Если вы выполняете одно из таких действий и хотите быть уверены, что поисковый индекс обновится в связи с изменениями структуры сайта, вы можете отметить всё содержание необходимым к переиндексации нажав кнопку «Переиндексация» на <a href=\"@searchsettings\">странице поиска</a>. Если на сайте большое количество документов, то для переиндексации всего содержания может потребоваться несколько запусков <em>cron</em>.','ru',0,0),(4305,'Кэширо