лько число, то оно будет использовано как ключ и как подпись.','ru',0,0),(4633,'Также, можно указать просто список меток (одна метка на строку), но только в том случае, если значения поля не привязаны к чему-нибудь ещё. Цифровые значения в этом случае будут сгенерированы и подставлены в этот список автоматически.','ru',0,0),(4634,'Ключ  - это значение, которое хранится в базе данных. А метка будет использоваться для отображения значения и в формах редактирования.','ru',0,0),(4635,'Метку указывать не обязательно, если строка содержит обычный текст, он будет использован и как ключ, и как метка.','ru',0,0),(4636,'Список допустимых значений: неверный ввод.','ru',0,0),(4637,'Список допустимых значений: некоторые из удаляемых значений в настоящее время используются.','ru',0,0),(4638,'Не удалось подключиться к серверу. Ответ сервера: !message. Подробнее об установке и обновлении кода вашего сервера читайте в <a href=\"@handbook_url\">руководстве</a>.','ru',0,0),(4639,'Невозможно обработать информацию в файле: %info_file.','ru',0,0),(4640,'В info-файле (%info_file) не определён атрибут \'name\'.','ru',0,0),(4641,'Система тестирования требует ограничение  по PHP памяти по крайней мере %memory_minimum_limit. Текущее значение %memory_limit. <a href=\"@url\">Выполните следующие шаги для продолжения</a>.','ru',0,0),(4642,'Вы можете найти <a href=\"@module_url\">модули</a> и <a href=\"@theme_url\">темы оформления</a> на <a href=\"@drupal_org_url\">drupal.org</a>. Поддерживаются следующие расширения файлов: %extensions.','ru',0,0),(4643,'Сервер не поддерживает обновление модулей и тем оформлений с помощью данного интерфейса. Вместо этого, можно обновить модули и оформления, закачав новые версии напрямую на сервер, как описано в <a href=\"@handbook_url\">руководстве</a>.','ru',0,0),(4644,'Сервер не поддерживает установку модулей и тем оформлений с помощью данного интерфейса. Вместо этого, можно установить модули и оформления, закачав их напрямую на сервер, как описано в <a href=\"@handbook_url\">руководстве</a>.','ru',0,0),(4645,'Обновление модулей и тем требует <strong>@backends доступа</strong> на ваш сервер. Смотрите <a href=\"@handbook_url\">руководство</a> для справки о других методах обновления.','ru',0,0),(4646,'Обновление модулей и тем требует доступа на ваш сервер с помощью одного из следующих методов:<strong>@backends</strong>. Смотрите <a href=\"@handbook_url\">руководство</a> для справки о других методах обновления.','ru',4645,1),(4647,'Для установки модулей и оформлений необходим <strong>@backends access</strong> к серверу. Смотрите <a href=\"@handbook_url\">в руководстве</a> информацию о других способах установки.','ru',0,0),(4648,'Для установки модулей и оформлений необходим один из следующих доступов к серверу: <strong>@backends</strong>. Смотрите <a href=\"@handbook_url\">в руководстве</a> информацию о других способах установки.','ru',4647,1),(4649,'%archive_file не содержит ни одного .info файла.','ru',0,0),(4650,'Управление материалами и комментариями.','ru',0,0),(4651,'Поля комментария','ru',0,0),(4652,'RSS-категория','ru',0,0),(4653,'%name должен быть корректным шестнадцатеричным CSS-значением цвета.','ru',0,0),(4654,'У каждого типа поля есть один или несколько связанных с ним <em>виджетов</em>. Виджет представляет собой механизм для ввода данных при редактировании (текстовое поле, выпадающий список, поле загрузки файла, и т.д.). Кроме того, у каждого типа поля есть один или несколько вариантов отображения, которые определяют, как отображается поле для посетителей сайта. Виджет и параметры отображения можно будет изменить после создания поля.','ru',0,0),(4655,'Поле %id (%old_field_name) нельзя переименовать в %new_field_name, потому что оно использует тип хранения данных, отличный от field_sql_storage.','ru',0,0),(4656,'Изменения стиля были сохранены.','ru',0,0),(4657,'Этот блок показывается только когда <a href=\"@languages\">на сайте включены как минимум два языка</a>, и в качестве <a href=\"@configuration\">способа определения языка</a> выбрано <em>URL</em> или <em>Сессия</em>.','ru',0,0),(4658,'Модуль Menu предоставляет интерфейс для управления меню. Меню — это  иерархическая коллекция ссылок, как внутренних, так и внешних, обычно использующихся для навигации по сайту. Для каждого меню создаётся блок, который можно включить и разместить на сайте с помощью <a href=\"@blocks\">страницы управления блоками</a>. Просматривать и управлять меню можно на <a href=\"@menus\">странице управления меню</a>. Более подробную информацию смотрите в руководстве на странице <a href=\"@menu\">модуля Menu</a>.','ru',0,0),(4659,'(Машинное имя: @type)','ru',0,0),(4660,'Для работы ассоциаций OpenID необходимо включить либо <a href=\"@gmp\">GMP Math</a> (рекомендуется для лучшей производительности), либо <a href=\"@bc\">BC Math</a>.','ru',0,0),(4661,'Не оптимизировано','ru',0,0),(4662,'Для работы OpenID нужна библиотека GMP Math для PHP, для наилучшей производительности. Инструкции по установке смотрите в <a href=\"@url\">документации GMP Math</a>.','ru',0,0),(4663,'Математическая библиотека OpenID','ru',0,0),(4664,'Модуль @module отсутствует, поэтому зависимый от него модуль @depends будет отключен.','ru',0,0),(4665,'Модуль @module отсутствует, поэтому зависимые от него модули @depends будут отключены.','ru',4664,1),(4666,'Машинное имя не может быть \"add\" или \"list\".','ru',0,0),(4667,'Включить поддержку многоязычности для данного типа содержимого. Если многоязычность включена, к форме редактирования будет добавлено поле выбора языка, позволяющее выбрать один из <a href=\"!languages\">доступных языков</a>. Также возможно разрешить перевод данного типа содержимого на любой из установленных языков. Если многоязычность выключена, новые сообщения сохраняются с языком по умолчанию. Изменение данного параметра не влияет на существующее содержимое.','ru',0,0),(4668,'Запрос привязан к таблице прав доступа, но в нём отсутствует поле nid. Чтобы исправить, добавьте в схему внешний ключ к node.nid.','ru',0,0),(4669,'Данный запрос списка материалов, использующий @fallback в качестве базовой таблицы, связан с таблицей прав доступа. Это может быть небезопасно и неработоспособно. Определите внешний ключ к node.nid в схеме этой таблицы. ','ru',0,0),(4670,'Неизвестное поле: @field_name','ru',0,0),(4671,'%field: Может быть только один десятичный разделитель (@separator).','ru',0,0),(4672,'Включить !title','ru',0,0),(4673,'Установить !title по умолчанию','ru',0,0),(4674,'Включенные модули: %modules','ru',0,0),(4675,'Файл %file не может быть скопирован, потому что каталог назначения %destination указан неправильно. Такое часто происходит в результате неправильного использования file_copy() или из-за отсутствующей обёртки потока (stream wrapper).','ru',0,0),(4676,'Файл %file не может быть скопирован, потому что он не существует.','ru',0,0),(4677,'Файл %file не может быть перенесён, потому что каталог назначения %destination указан неправильно. Такое часто происходит в результате неправильного использования file_move() или из-за отсутствующей обёртки потока (stream wrapper).','ru',0,0),(4678,'Файл %file не может быть удалён, потому что это не корректный URI. Такое часто происходит в результате неправильного использования file_delete() или из-за отсутствующей обёртки потока (stream wrapper).','ru',0,0),(4679,'Путь к существующей в файловой системе директории для хранения личных файлов. Она должна иметь права на запись для Drupal, и быть недоступной через браузер. Смотрите в руководстве <a href=\"@handbook\">дополнительную информацию о защите личных файлов</a>.','ru',0,0),(4680,'Curaçao','ru',0,0),(4681,'Отсутствует связующее свойство у сущности типа @entity_type.','ru',0,0),(4682,'Используемые типы полей','ru',0,0),(4683,'Поля, ожидающие удаления','ru',0,0),(4684,'(модуль: !module)','ru',0,0),(4685,'Расширение функциональности сайта.','ru',0,0),(4686,'Страница \"@path\" не найдена.','ru',0,0),(4687,'Эта форма устарела. Скопируйте все несохраненные изменения и <a href=\"@link\">обнови